>Twój motyw (%s) zawiera przestarzałe kopie niektórych plików szablonów WooCommerce.</strong> Pliki te mogą wymagać aktualizacji w celu zapewnienia ich zgodności z aktualną wersją WooCommerce. Sugestie, aby to naprawić:','<strong>You’re editing details specific to this variation.</strong> Some information, like description and images, will be inherited from the main product, <noticeLink><parentProductName/></noticeLink>.'=>'<strong>Edytujesz szczegóły specyficzne dla tej odmiany.</strong> Niektóre informacje, takie jak opis i obrazki, zostaną odziedziczone z głównego produktu, <noticeLink><parentProductName/></noticeLink>.','<title>AOV</title> <rule/> <filter/>'=>'<title>AOV</title> <rule/> <filter/>','<title>Country / Region</title> <rule/> <filter/>'=>'<title>Kraj/Region</title> <rule/> <filter/>','<title>Coupon code</title> <rule/> <filter/>'=>'<title>Kod kuponu</title> <rule/> <filter/>','<title>Customer is</title> <filter/>'=>'<title>Klient jest</title> <filter/>','<title>Email</title> <rule/> <filter/>'=>'<title>Email</title> <rule/> <filter/>','<title>IP Address</title> <rule/> <filter/>'=>'<title>Adres IP</title> <rule/> <filter/>','<title>Last active</title> <rule/> <filter/>'=>'<title>Ostatnio aktywny</title> <rule/> <filter/>','<title>Name</title> <rule/> <filter/>'=>'<title>Name</title> <rule/> <filter/>','<title>No. of Orders</title> <rule/> <filter/>'=>'<title>Liczba zamówień</title> <rule/> <filter/>','<title>Order #</title> <rule/> <filter/>'=>'<title>Order #</title> <rule/> <filter/>','<title>Order status</title> <rule/> <filter/>'=>'<title>Status zamówienia</title> <rule/> <filter/>','<title>Product attribute</title> <rule/> <filter/>'=>'<title>Atrybut produktu</title> <rule/> <filter/>','<title>Product category</title> <rule/> <filter/>'=>'<title>Kategoria produktu</title> <rule/> <filter/>','<title>Product variation</title> <rule/> <filter/>'=>'<title>Odmiana produktu</title> <rule/> <filter/>','<title>Product</title> <rule/> <filter/>'=>'<title>Product</title> <rule/> <filter/>','<title>Refund</title> <filter/>'=>'<title>Refundacja</title> <filter/>','<title>Registered</title> <rule/> <filter/>'=>'<title>Zarejestrowany</title> <rule/> <filter/>','<title>Tax Rate</title> <rule/> <filter/>'=>'<title>Stawka podatku</title> <rule/> <filter/>','<title>Total Spend</title> <rule/> <filter/>'=>'<title>Total Spend</title> <rule/> <filter/>','<title>Username</title> <rule/> <filter />'=>'<title>Username</title> <rule/> <filter />','<title>Username</title> <rule/> <filter/>'=>'<title>Username</title> <rule/> <filter/>','[%1$s] %2$s: %3$s WooCommerce log message'=>'[%1$s] %2$s: %3$s komunikat z logów WooCommerce' . "\0" . '[%1$s] %2$s: %3$s komunikaty z logów WooCommerce' . "\0" . '[%1$s] %2$s: %3$s komunikatów z logów WooCommerce','[%1$s] Payment gateway "%2$s" enabled'=>'[%1$s] Bramka płatności "%2$s" włączona','[deleted]'=>'[usunięto]','[Failed] Orders table could not be created.'=>'[Niepowodzenie] Nie można było utworzyć tabeli zamówień.','[Failed] Some installed plugins are incompatible. Please review the plugins by going to WooCommerce > Settings > Advanced > Features and see the "Order data storage" section.'=>'[Niepowodzenie] Niektóre zainstalowane wtyczki są niezgodne. Proszę sprawdzić wtyczki w sekcji „Przechowywanie danych zamówień” przechodząc do WooCommerce > Ustawienia > Zaawansowane > Funkcje.','[Failed] The orders table does not exist and this is not a new shop. Please create the table by going to WooCommerce > Settings > Advanced > Features and enabling sync.'=>'[Niepowodzenie] Tabela zamówień nie istnieje, a to nie jest nowy sklep. Proszę utworzyć tabelę przechodząc do WooCommerce > Ustawienia > Zaawansowane > Funkcje i włączając synchronizację.','[Failed] There are orders pending sync. Please run `%s` to sync pending orders.'=>'[Niepowodzenie] Są zamówień oczekujące na synchronizację. Proszę uruchomić `%s`, aby zsynchronizować zamówienia.','[Failed] This is not a new shop, but --for-new-shop flag was passed.'=>'[Niepowodzenie] Przekazano flagę --for-new-shop, a to nie jest nowy sklep.','[Order #%1$s] (%2$s)'=>'[Zamówienie %1$s] (%2$s)','[Order #%s]'=>'[Zamówienie %s]','[Performance] Removes session cookies for non-logged in customers when session data is empty, improving page caching performance. May cause compatibility issues with extensions that depend on the session cookie without using session data.'=>'[Wydajność] Usuwa sesyjne pliki cookie dla niezalogowanych klientów, gdy dane sesji są puste, poprawiając wydajność buforowania stron. Może powodować problemy z kompatybilnością z rozszerzeniami, które zależą od plików cookie sesji bez korzystania z danych sesji.','[product description rendering halted]'=>'[wstrzymano renderowanie opisu produktu]','[Remove]'=>'[Usuń]','[{site_title}]: New order #{order_number}'=>'[{site_title}]: Nowe zamówienie {order_number}','[{site_title}]: Order #{order_number} has been cancelled'=>'[{site_title}]: Zamówienie #{order_number} zostało anulowane','[{site_title}]: Order #{order_number} has failed'=>'[{site_title}]: Zamówienie {order_number} nie powiodło się','[{site_title}]: You\'ve got a new order: #{order_number}'=>'[{site_title}]: Masz nowe zamówienie: #{order_number}','[{site_title}]: Your order #{order_number} has been cancelled'=>'[{site_title}]: Twoje zamówienie nr {order_number} zostało anulowane','[{site_title}]: Your {report_name} Report download is ready'=>'[{site_title}]: Twój raport – {report_name}, jest gotowy do pobrania','A 2 digit country code, e.g. US. Leave blank to apply to all.'=>'Dwuliterowy kod kraju, np. PL. Pozostaw puste, aby zastosować do wszystkich.','A 2 digit state code, e.g. AL. Leave blank to apply to all.'=>'Dwuliterowy kod stanu, np. AL. Pozostaw puste, aby zastosować do wszystkich.','A <a href="%s">notification</a> for the same product and customer already exists in your database.'=>'<a href="%s">powiadomienie</a> dla tego samego produktu i klienta już istnieje w twojej bazie danych.','A block that displays a selection of products in your store.'=>'Blok wyświetlający wybór produktów w sklepie.','A cloud of your most used product tags.'=>'Chmura najczęściej używanych znaczników produktów.','A collection of email content layouts.'=>'Zbiór układów treści wiadomości e-mail.','A collection of related products.'=>'Kolekcja powiązanych produktów.','A Coruña'=>'A Coruña','A decorative arrow appended to the next and previous product reviews link.'=>'Dekoracyjna strzałka dołączona do linku do następnej i poprzedniej recenzji produktu.','A description of the purpose of the email template.'=>'Opis celu szablonu wiadomości e-mail.','A digital product like service, downloadable book, music or video.'=>'Produkt cyfrowy, taki jak usługa, książka do pobrania, muzyka lub wideo.','A European payments solution that allows you to accept payments in over 25 countries and multiple currencies.'=>'Europejskie rozwiązanie płatnicze, które pozwala akceptować płatności w ponad 25 krajach i wielu walutach.','A font face with slug "%s" already exists.'=>'Uproszczona nazwa „%s” jest już wykorzystywana przez krój pisma.','A font family with slug "%s" already exists.'=>'Uproszczona nazwa „%s” jest już wykorzystywana przez rodzinę krojów pisma.','A friendly name for the webhook.'=>'Przyjazna nazwa dla webhooka.','A friendly summary of the response including the HTTP response code, message, and body.'=>'Przyjazne podsumowanie odpowiedzi, w tym kod odpowiedzi HTTP, wiadomości i treści.','A full checkout experience embedded on your site that includes all popular payment methods (Pay Now, Pay Later, Financing, Installments).'=>'Pełna obsługa płatności osadzona w twojej witrynie, która obejmuje wszystkie popularne metody płatności (zapłać teraz, zapłać później, finansowanie, raty).','A fully embedded checkout, with all popular payment methods, for more sales and less abandoned shopping carts.'=>'W pełni zintegrowana kasa (checkout), ze wszystkimi popularnymi metodami płatności, zapewniająca większą sprzedaż i mniej porzuconych koszyków.','A general template for emails.'=>'Ogólny szablon wiadomości e-mail.','a group of regions that can be assigned different shipping methods and rates.'=>'grupa obszarów, do których mogą być przypisane różne metody i stawki wysyłki.','A human readable description for the setting used in interfaces.'=>'Opis ustawień użytych w interfejsach, zrozumiały dla człowieka.','A human readable label for the setting used in interfaces.'=>'Etykieta ustawień użytych w interfejsach, zrozumiała dla człowieka.','A human-readable description of the resource.'=>'Czytelny dla człowieka opis zasobu.','A link to a product category.'=>'Odnośnik do kategorii produktu.','A link to a product form.'=>'Odnośnik do formularza produktu.','A link to a product sold on a different website, e.g. brand collab.'=>'Odnośnik do produktu sprzedawanego na innej stronie internetowej, np. w ramach współpracy z marką.','A link to a product tag.'=>'Odnośnik do znacznika produktu.','A link to a product.'=>'Odnośnik do produktu.','A link to set a new password will be sent to your email address.'=>'Na adres e-mail zostanie wysłany odnośnik do ustawienia nowego hasła.','A list of line items (products) within this order.'=>'Lista pozycji (produktów) w ramach tego zamówienia.','A list of plugins to install'=>'Lista wtyczek do zainstalowania','A list of stats to query must be provided.'=>'Należy podać listę statystyk do wykonania zapytania.','A list of taxonomy terms that can be used in regard to order/product statuses.'=>'Lista terminów taksonomii, która mogą być użyte do statusów zamówień/produktów.','A list of taxonomy terms used for product visibility.'=>'Taksonomie użyte do wyświetlania produktów.','A list of your store\'s products.'=>'Lista produktów w sklepie.','A list of your store\'s top-rated products.'=>'Lista najwyżej ocenianych produktów.','A list or dropdown of product categories.'=>'Rozwijana lista kategorii.','A live rate is the exact cost to ship an order, quoted directly from the shipping carrier.'=>'Stawki wysyłkowe w czasie rzeczywistym to dokładny koszt wysyłki zamówienia, podany bezpośrednio przez kuriera.','A Location title is required'=>'Wymagany jest tytuł lokalizacji','A map of provider ID to integer values representing the sort order.'=>'Mapa identyfikatora dostawcy na wartości całkowite reprezentujące kolejność sortowania.','A message indicating that the action completed successfully.'=>'Komunikat informujący o pomyślnym zakończeniu akcji.','A minimum order amount'=>'Minimalna wartość zamówienia','A minimum order amount AND a coupon'=>'Minimalnej wartości zamówienia ORAZ kuponu','A minimum order amount AND coupon'=>'Minimalnej wartości zamówienia ORAZ kuponu','A minimum order amount OR a coupon'=>'Minimalnej wartości zamówienia LUB kuponu','A minimum order amount OR coupon'=>'Minimalnej wartości zamówienia LUB kuponu','A new queue has begun processing. <a href="%s">View actions in-progress &raquo;</a>'=>'Rozpoczęto przetwarzanie nowej kolejki. <a href="%s">Zobacz akcje w trakcie realizacji &raquo;</a>','A note has been added to your order'=>'Nowa notka została dodana do Twojego zamówienia','A note has been added to your order from {site_title}'=>'Do zamówienia z {site_title} została dodana notatka.','A partial IP address can be passed and matching results will be returned.'=>'Można przekazać częściowy adres IP i zostaną zwrócone pasujące wyniki.','A password reset email has been sent to the email address on file for your account, but may take several minutes to show up in your inbox. Please wait at least 10 minutes before attempting another reset.'=>'E-mail z linkiem do zresetowania hasła został wysłany na adres przypisany do konta. Może minąć kilka minut zanim pojawi się on w twojej skrzynce. Poczekaj co najmniej 10 minut przed ponowną próbą zresetowania hasła.','A payment provider in the context of the main Payments Settings page list.'=>'Dostawca płatności w kontekście głównej listy strony Ustawienia płatności.','A plugin was successfully activated.'=>'Wtyczka została pomyślnie aktywowana.','A plugin was successfully installed and activated.'=>'Wtyczka została pomyślnie zainstalowana i aktywowana.','A product must be associated with this brand for the coupon to remain valid or, for "Product Discounts", products with these brands will be discounted.'=>'Aby kupon zachował ważność, produkt musi być powiązany z tą marką lub w przypadku "Rabatów na produkty", produkty z tymi markami zostaną przecenione.','A product with this ID already exists.'=>'Produkt o tym identyfikatorze już istnieje.','A product with this SKU already exists.'=>'Produkt z tym SKU już istnieje.','A product with variations like color or size.'=>'Produkt z odmianami, takimi jak kolor lub rozmiar.','A search box to allow customers to search for products by keyword.'=>'Pole wyszukiwania umożliwiające klientom wyszukiwanie produktów według słów kluczowych.','A search form for your store.'=>'Formularz wyszukiwania dla sklepu.','A sentence describing filters for Categories. See screen shot for context: https://cloudup.com/cSsUY9VeCVJCategories match <select/> filters'=>'Kategorie pasują do filtrów <select/>','A sentence describing filters for Coupons. See screen shot for context: https://cloudup.com/cSsUY9VeCVJCoupons match <select/> filters'=>'Kupony pasują do filtrów <select/>','A sentence describing filters for Customers. See screen shot for context: https://cloudup.com/cCsm3GeXJbECustomers match <select/> filters'=>'Klienci pasujący do filtrów <select/>','A sentence describing filters for Downloads. See screen shot for context: https://cloudup.com/ccxhyH2mEDgDownloads match <select/> filters'=>'Pliki do pobrania pasują do filtrów <select/>','A sentence describing filters for Orders. See screen shot for context: https://cloudup.com/cSsUY9VeCVJOrders match <select/> filters'=>'Zamówienia pasują do filtrów <select/>','A sentence describing filters for Products. See screen shot for context: https://cloudup.com/cSsUY9VeCVJProducts Match <select/> Filters'=>'Produkty pasują do filtrów <select/>','A sentence describing filters for Revenue. See screen shot for context: https://cloudup.com/cSsUY9VeCVJRevenue Matches <select/> Filters'=>'Filtry dopasowań przychodów <select/>','A sentence describing filters for Taxes. See screen shot for context: https://cloudup.com/cSsUY9VeCVJTaxes match <select/> filters'=>'Podatki pasują do filtrów <select/>','A sentence describing filters for Variations. See screen shot for context: https://cloudup.com/cSsUY9VeCVJVariations match <select/> filters'=>'Warianty pasują do filtrów <select/>','A set of products that go well together, e.g. camera kit.'=>'Zestaw produktów, które dobrze do siebie pasują, np. zestaw kamer.','A shipment from {site_title} order {order_number} has been cancelled'=>'Przesyłka z zamówienia {site_title} o numerze {order_number} została anulowana','A shipment from {site_title} order {order_number} has been updated'=>'Przesyłka z zamówienia {site_title} o numerze {order_number} została zaktualizowana','A shipping class with that slug already exists.'=>'Klasa wysyłkowa z tym slugiem już istnieje.','A shipping zone consists of the region(s) you\'d like to ship to and the shipping method(s) offered. A shopper can only be matched to one zone, and we\'ll use their shipping address to show them the methods available in their area.'=>'Strefa wysyłki składa się z regionu(-ów), do którego chcesz wysyłać oraz oferowanych metod wysyłki. Kupujący może być przypisany tylko do jednej strefy, a my użyjemy ich adresu wysyłki, aby pokazać im dostępne w ich okolicy metody.','A shipping zone is a geographic region where a certain set of shipping methods and rates apply.'=>'Strefa wysyłki to grupa regionów, do których mogą być przypisane różne metody i stawki wysyłki.','A simple offline gateway that lets you accept a check as method of payment.'=>'Prosta bramka płatności offline pozwalająca na płatność czekiem.','A simple offline gateway that lets you accept BACS payment.'=>'Proste płatności za pomocą przelewu bankowego.','A simple offline gateway that lets you accept cash on delivery.'=>'Proste płatności przy odbiorze.','A single physical or virtual product, e.g. a t-shirt or an eBook.'=>'Pojedynczy produkt fizyczny lub wirtualny, np. koszulka lub eBook.','A subject for provided email type after filters are applied and placeholders replaced.'=>'Temat dla podanego rodzaju wiadomości e-mail po zastosowaniu filtrów i zastąpieniu symboli zastępczych.','A subscription helps us to continuously improve your extensions, themes, and WooCommerce experience.'=>'Subskrypcja pomaga nam stale ulepszać rozszerzenia, motywy i obsługę WooCommerce.','A suggestion category.'=>'Kategoria sugestii.','A suggestion with full details.'=>'Sugestia z pełnymi szczegółami.','A tangible item that gets delivered to customers.'=>'Namacalny przedmiot, który jest dostarczany do klientów.','A test account is already set up.'=>'Konto testowe jest już skonfigurowane.','A test account will be created for you to {{link}}test payments on your store{{/link}}. You\'ll need to activate payments later to process real transactions.'=>'Konto testowe zostanie utworzone w celu {{link}}testowania płatności w sklepie{/link}}. Będziesz musiał aktywować płatności później, aby przetwarzać prawdziwe transakcje.','A unique ID string for the email template.'=>'Unikatowy ciąg identyfikatora dla szablonu wiadomości e-mail.','A unique identifier for the setting.'=>'Unikatowy identyfikator dla ustawienia.','A unique identifier for the tool.'=>'Unikatowy identyfikator narzędzia.','A unique identifier that can be used to link settings together.'=>'Unikatowy identyfikator, który może służyć do powiązania ustawień.','A URL to redirect the customer after checkout. This could be, for example, a link to the payment processors website.'=>'Adres URL, na który przekierować klienta po zamówieniu. Może to być na przykład odnośnik do strony operatora płatności.','A valid email address is required'=>'Wymagane jest wprowadzenie prawidłowego adresu e-mail','A valid event name must be specified.'=>'Należy określić prawidłową nazwę zdarzenia.','A valid free shipping coupon'=>'Kuponu umożliwiającego darmową wysyłkę','A valid prop name must be specified'=>'Należy określić prawidłową nazwę właściwości','A zip file of the theme to be uploaded.'=>'Plik zip motywu, który należy przesłać.','A ‘brewtiful’ experience :-)'=>'Piękne doświadczenie :-)','A → Z'=>'A → Z','Aargau'=>'Aargau','Abia'=>'Abia','Abim'=>'Abim','Abort'=>'Przerwij','Abort the product attributes lookup table regeneration'=>'Przerwij odnawianie tabeli do wyszukiwania atrybutów produktu','About'=>'Informacje','About Action Scheduler %s'=>'O harmonogramie akcji %s','About the form…'=>'O formularzu..','About WooCommerce'=>'O WooCommerce','Abra'=>'Abra','Abuja'=>'Abuja','Accent'=>'Akcent','Accept all popular payment methods for Finnish B2C and B2B customers'=>'Akceptuj wszystkie popularne metody płatności dla fińskich klientów B2C i B2B','Accept Cards, Apple Pay, Google Pay, Bizum, PayPal, and many more payment methods in your store.'=>'Akceptuj karty, Apple Pay, Google Pay, Bizum, PayPal i wiele innych metod płatności w swoim sklepie.','Accept cash on delivery if the order is virtual'=>'Akceptuj płatność za pobraniem, jeśli zamówienie jest wirtualne','Accept COD if the order is virtual'=>'Akceptuj "za pobraniem", jeśli zamówienie jest wirtualne','Accept credit and debit cards on your WooCommerce store with advanced features like partial refunds, full/partial captures, and 3D Secure security.'=>'Akceptuj karty kredytowe i debetowe w swoim sklepie WooCommerce dzięki zaawansowanym funkcjom, takim jak częściowe zwroty, pełne/częściowe przechwytywanie i zabezpieczenia 3D Secure.','Accept credit cards and other popular payment methods with %1$sWooPayments%2$s'=>'Akceptuj karty kredytowe i inne popularne metody płatności za pomocą %1$sWooPayments%2$s','Accept debit and credi