duct updates.'=>'Dostęp do najnowszych funkcji i aktualizacji produktów.','Access to Purchased Downloads'=>'Dostęp do kupionych plików do pobrania','Access your updates'=>'Dostęp do aktualizacji','Accessibility'=>'Dostępność','Accordion content will be displayed by default.'=>'Zawartość akordeonu będzie wyświetlana domyślnie.','Accordion title'=>'Tytuł akordeonu','Account and Privacy'=>'Konto i prywatność','Account creation'=>'Rejestracja konta','Account creation and guest checkout'=>'Tworzenie konta i płatność gościnna','Account creation and guest checkout settings can be managed in your store settings.'=>'Ustawieniami tworzenia konta i realizacji zakupu przez gościa można zarządzać w ustawieniach sklepu.','Account creation options'=>'Opcje tworzenia konta','Account details'=>'Szczegóły konta','Account details changed successfully.'=>'Zmieniono szczegóły konta.','Account details:'=>'Szczegóły konta:','Account endpoints'=>'Punkty końcowe konta','account erasure request'=>'żądania usunięcia konta','Account erasure requests'=>'Prośby o usunięcie kont','Account Name'=>'Nazwa konta','Account name'=>'Nazwa konta','Account Number'=>'Numer konta','Account number'=>'Numer konta','Account pages'=>'Strony konta','Account Type'=>'Rodzaj konta','Account username'=>'Konto użytkownika','Accounts'=>'Konta','Accounts &amp; Privacy'=>'Konta i prywatność','Acre'=>'Akr','Action'=>'Akcja','Action [%1$s] has an invalid schedule: %2$s'=>'Czynność [%1$s] ma nieprawidłowy harmonogram: %2$s','Action [%1$s] has invalid arguments. It cannot be JSON decoded to an array. $args = %2$s'=>'Akcja [%1$s] ma nieprawidłowe argumenty. Nie można jej zdekodować do tablicy JSON. $args = %2$s','action canceled'=>'akcja została anulowana','action complete'=>'akcja zakończona','action complete via %s'=>'akcja zakończona przez %s','action created'=>'akcja została utworzona','Action event'=>'Akcja','action failed via %1$s: %2$s'=>'nie powiodła się akcja przez %1$s: %2$s','Action failed. Please refresh the page