wność','Activity log for the action.'=>'Dziennik aktywności wykonanych działań.','Actual products will vary depending on the page being viewed.'=>'Rzeczywiste produkty będą się różnić w zależności od przeglądanej strony.','Actual products will vary depending on the product being viewed.'=>'Rzeczywiste produkty będą się różnić w zależności od oglądanego produktu.','Adamawa'=>'Adamawa','Adana'=>'Adana','Add'=>'Dodaj','Add "read more" link text'=>'Dodaj tekst linku "czytaj więcej"','Add "Reply-to" email'=>'Dodaj wiadomość e-mail z odpowiedzią','Add %s'=>'Dodaj %s','Add %s section'=>'Dodaj sekcję %s','Add a bank account'=>'Dodaj konto bankowe','Add a filter'=>'Dodaj filtr','Add a link and choose a label for the button linked to a product sold elsewhere.'=>'Dodaj łącze i wybierz etykietę dla przycisku powiązanego z produktem sprzedawanym w innym miejscu.','Add a meaningful description, including a note of the person, company or app you are sharing the key with.'=>'Dodaj  zrozumiały opis, w tym notatkę o osobie, firmie lub aplikacji, której udostępniasz klucz.','Add a note for your reference, or add a customer note (the user will be notified).'=>'Dodaj notkę dla siebie lub dla klienta (klient zostanie powiadomiony).','Add a note to your order'=>'Dodaj notatkę do zamówienia','Add a price for customers who choose local pickup'=>'Dodaj cenę dla klientów, którzy wybiorą odbiór lokalny','Add a review'=>'Dodaj opinię','Add a touch of charm and coziness this holiday season with a wide selection of hand-picked decorations — from minimalist vases to designer furniture.'=>'Dodaj odrobinę uroku i przytulności w tym sezonie świątecznym dzięki szerokiemu wyborowi ręcznie dobranych dekoracji - od minimalistycznych wazonów po designerskie meble.','Add additional piece of info about each category to the report.'=>'Dodaj dodatkowe informacje o każdej kategorii do raportu.','Add additional piece of info about each coupon to the report.'=>'Dodaj dodatkowe informacje o każdym kuponie do rapo