essionally designed theme'=>'Wybierz profesjonalnie zaprojektowany motyw','Choose a state&hellip;'=>'Wybierz stan&hellip;','Choose a tax class for this product. Tax classes are used to apply different tax rates specific to certain types of product.'=>'Wybierz klasę podatkową dla tego produktu. Klasy podatkowe umożliwiają przypisywanie różnych stawek podatkowych do różnych typów produktów.','Choose a tax partner'=>'Wybór partnera podatkowego','Choose a theme that best fits your brand\'s look and feel, then make it your own. Change the colors, add your logo, and create pages.'=>'Wybierz motyw, który najlepiej pasuje do wyglądu i stylu twojej marki, a następnie dostosuj go do własnych potrzeb. Zmieniaj kolory, dodaj logo i twórz strony.','Choose among these pre-sets'=>'Wybierz spośród tych ustawień wstępnych','Choose an action...'=>'Wybierz akcję…','Choose an image'=>'Wybierz obrazek','Choose an option'=>'Wybierz opcję','Choose collection'=>'Wybierz kolekcję','Choose countries / regions&hellip;'=>'Wybierz kraje / regiony&hellip;','Choose coupons&hellip;'=>'Wybierz kupony&hellip;','Choose file'=>'Wybierz plik','Choose fonts'=>'Wybór czcionek','Choose from the most used tags'=>'Wybierz z najczęściej używanych znaczników','Choose from uploaded media'=>'Wybierz spośród przesłanych multimediów','Choose how long to retain personal data when it\'s no longer needed for processing. Leave the following options blank to retain this data indefinitely.'=>'Wybierz jak długo przechowywać dane osobowe, jeśli nie są już używane do realizacji zamówień. Pozostaw puste pole, aby nigdy nie usuwać danych.','Choose how many icons to display. To show all icons, use 0 (zero).'=>'Wybierz liczbę ikon do wyświetlenia. Aby wyświetlić wszystkie ikony, użyj 0 (zero).','Choose how this block is displayed to your customers.'=>'Wybierz sposób wyświetlania tego bloku klientom.','Choose how you want to present bank transfer to your customers during checkout.'=>'Wybierz sposób prezentacji przelewu bankowego swoim klientom podczas realizacji transakcji.','Choose how you want to present cash on delivery payments to your customers during checkout.'=>'Wybierz sposób prezentacji płatności za pobraniem swoim klientom podczas realizacji zakupu.','Choose how you want to present check payments to your customers during checkout.'=>'Wybierz, w jaki sposób chcesz prezentować klientom płatności czekiem podczas realizacji transakcji.','Choose if you want to include an icon with the customer account link.'=>'Wybierz, czy łącze do konta klienta ma zawierać ikonę.','Choose images'=>'Wybierz obrazy','Choose payment providers and enable payment methods at checkout.'=>'Wybierz pośredników i włącz metody płatności na stronie zamówienia.','Choose products for me'=>'Wybierz produkty dla mnie','Choose the color palette that best suits your brand. Want to change it? Create your custom color palette below, or update it later in Editor.'=>'Wybierz paletę kolorów, która najlepiej pasuje do Twojej marki. Chcesz ją zmienić? Utwórz własną paletę kolorów poniżej lub zaktualizuj ją później w Edytorze.','Choose the payment that you want, pay now, pay later or slice it. No credit card numbers, no passwords, no worries.'=>'Wybierz płatność, którą chcesz, zapłać teraz, zapłać później lub podziel ją. Bez numerów kart kredytowych, bez haseł, bez obaw.','Choose the payment that you want, pay now, pay later or slice it. No credit card numbers, no passwords, no worries. <a href="%s" target="_blank">Learn more about Klarna</a>.'=>'Wybierz jak chcesz zapłacić: zapłać teraz, zapłać później lub rozłóż na raty. Nie potrzebujesz karty kredytowej, haseł, nie masz zmartwień. <a href="%s" target="_blank">Dowiedz się więcej o Klarna</a>.','Choose the shipping method you wish to add. Only shipping methods which support zones are listed.'=>'Wybierz metodę wysyłki, którą chcesz dodać. Widoczne są tylko metody, które wspierają strefy wysyłki.','Choose the size of each thumbnail in respect to the product image. If thumbna