nt values.'=>'Wpisz tekst opisu. Użyj „%s” do oddzielenia wartości.','Enter some text, or some attributes by pipe (|) separating values.'=>'Wpisz tekst lub atrybuty oddzielając symbolem pionowej linii (|).','Enter the action that will trigger this webhook.'=>'Wpisz akcję, która uruchomi webhook.','Enter the address where you want your order delivered.'=>'Wprowadź adres, na który ma zostać dostarczone zamówienie.','Enter the billing address that matches your payment method.'=>'Wprowadź adres rozliczeniowy zgodny z metodą płatności.','Enter the billing and shipping address that matches your payment method.'=>'Wprowadź adres rozliczeniowy i adres wysyłki zgodny z metodą płatności.','Enter the external URL to the product'=>'Wprowadź zewnętrzny adres URL produktu','Enter the external URL to the product.'=>'Wpisz zewnętrzny adres URL do produktu.','Enter the number of days before a download link expires, or leave blank'=>'Wprowadź liczbę dni do wygaśnięcia łącza pobierania lub pozostaw puste','Enter the number of days before a download link expires, or leave blank.'=>'Wpisz liczbę dni po których pobieranie wygaśnie albo pozostaw puste.','Enter tracking number'=>'Wprowadź numer śledzenia','Enter tracking URL'=>'Wprowadź adres URL śledzenia','Enter your address to view shipping options.'=>'Wpisz swój adres, aby wyświetlić opcje wysyłki.','Enter your coupon code'=>'Wpisz swój kod kuponu','Enter your PayPal API credentials to process refunds via PayPal. Learn how to access your <a href="%s">PayPal API Credentials</a>.'=>'Wpisz dane PayPal API, aby procesować zwroty przez PayPal. Dowiedz się jak zdobyć dane <a href="%s">PayPal API tutaj</a>.','Entre Ríos'=>'Entre Ríos','Enugu'=>'Enugu','Environment.'=>'Środowisko.','Epirus'=>'Epir','Equatorial Guinea'=>'Gwinea Równikowa','Eritrea'=>'Erytrea','Eritrean nakfa'=>'Nakfa','Erongo'=>'Erongo','Errachidia'=>'Errachidia','Error'=>'Błąd','Error 404'=>'Błąd 404','Error code'=>'Kod błędu','Error during status transition.'=>'Błąd podczas z