znej.','If checked, free shipping would be available based on pre-discount order amount.'=>'Jeśli zaznaczone, bezpłatna wysyłka będzie dostępna na podstawie kwoty zamówienia przed rabatem.','If COD is only available for certain methods, set it up here. Leave blank to enable for all methods.'=>'Jeśli ta metoda płatności ma być dostępna tylko dla wybranych sposobów wysyłki, ustaw je tutaj. Pozostaw puste, aby włączyć dla wszystkich.','If enabled, this method will appear on the block based checkout.'=>'Jeśli włączysz tę opcję, ta metoda pojawi się w bloku zamówienia.','If enabled, this text will be shown site-wide. You can use it to show events or promotions to visitors!'=>'Jeśli włączysz tę opcję, tekst będzie widoczny na każdej podstronie. Możesz w ten sposób prezentować swoim klientom wydarzenia lub promocje!','If local pickup is enabled, the "Hide shipping costs until an address is entered" setting will be ignored.'=>'Jeśli włączony jest odbiór lokalny, ustawienie "Ukryj koszty wysyłki do momentu wprowadzenia adresu" zostanie zignorowane.','If managing stock, this controls if backorders are allowed.'=>'Kontroluje czy możliwe są zamówienia oczekujące, jeśli włączone jest zarządzanie stanem magazynowym.','If managing stock, this controls whether or not backorders are allowed. If enabled, stock quantity can go below 0.'=>'Jeśli zarządzanie stanem magazynowym jest nieaktywne, zamówienia poza stan magazynowy będą możliwe. Jeśli ta opcja jest włączona stan magazynowy może wynosić poniżej 0.','If requested, calculates attribute term counts for products in the collection.'=>'Jeśli żądane, oblicza wystąpienia taksonomii atrybutu dla produktów w kolekcji.','If requested, calculates taxonomy term counts for products in the collection.'=>'Na żądanie oblicza liczbę terminów taksonomii dla produktów w kolekcji.','If the "Delete all content" option is selected, the affected WooCommerce webhooks will <b>not</b> be deleted and will be attributed to user id 0.<br/>'=>'Jeśli wybrana zostanie opcja "Usuń całą zawartość", dotknięte webhooki WooCommerce <b>nie</b> zostaną usunięte i zostaną przypisane do identyfikatora użytkownika 0.<br/>','If the "Force Downloads" or "X-Accel-Redirect/X-Sendfile" download method is selected but does not work, the system will use the "Redirect" method as a last resort. <a href="%1$s">See this guide</a> for more details.'=>'Jeśli wybrano metodę pobierania "Wymuszaj pobieranie" lub "X-Accel-Redirect/X-Sendfile", ale nie będzie ona działać, system użyje w ostateczności metody "Tylko przekierowanie". <a href="%1$s">Zobacz ten przewodnik</a>, aby uzyskać więcej informacji.','If the content exceeds the word limit, only the first paragraph will be shown. If the content is within the limit, all paragraphs will be displayed. Set to 0 to remove the word limit.'=>'Jeśli treść przekracza limit słów, wyświetlony zostanie tylko pierwszy akapit. Jeśli treść mieści się w limicie, wyświetlone zostaną wszystkie akapity. Ustaw wartość 0, aby usunąć limit słów.','If the payment was refunded via the API.'=>'Jeśli płatność została zwrócona przez API.','If the product is downloadable.'=>'Jeśli produkt jest do pobrania.','If the product is virtual.'=>'Czy produkt jest wirtualny.','If the quantity is editable or fixed.'=>'Czy ilość jest edytowalna czy stała.','If the variation is downloadable.'=>'Jeśli wariant jest do pobrania.','If the variation is virtual.'=>'Jeśli wariant jest wirtualny.','If the variation is visible.'=>'Czy wariant jest widoczny.','If this attribute has term archive pages.'=>'Jeśli ten atrybut ma strony archiwów taksonomii.','If this is a default attribute'=>'Jeśli jest to atrybut domyślny','If true and if the free shipping method requires a coupon, this coupon will enable free shipping.'=>'Jeśli "true" i darmowa wysyłka wymaga użycia kuponu, ten kupon włączy darmową wysyłkę.','If true, calculates rating counts for products in the collection.'=>'Jeśli prawda, oblicza liczbę ocen dla produktów w kolekcji.','If true, calculates stock counts for products in the collection.'=>'Jeśli prawda, oblicza stany magazynowe dla produktów w kolekcji.','If true, calculates the minimum and maximum product prices for the collection.'=>'Jeśli prawdziwe, oblicza minimalne i maksymalne ceny produktów dla kolekcji.','If true, empty terms will not be returned.'=>'Jeśli prawda, puste taksonomie nie zostaną zwrócone.','If true, only one item of this product is allowed for purchase in a single order.'=>'Jeśli prawda, tylko jeden produkt może zostać zakupiony w pojedynczym zamówieniu.','If true, the coupon can only be used individually. Other applied coupons will be removed from the cart.'=>'Jeśli "true", kupon może być użyty tylko pojedynczo. Inne zastosowane kupony zostaną usunięte z koszyka.','If true, the effective value is the base value from the parent product plus the defined value; if false, the defined value is the final effective value.'=>'Jeśli wartość ta jest prawdziwa, wartością efektywną jest wartość bazowa z produktu nadrzędnego plus zdefiniowana wartość; jeśli jest fałszywa, zdefiniowana wartość jest ostateczną wartością efektywną.','If true, the incentive dismissal will be ignored by tracking.'=>'Jeśli to prawda, odrzucenie zachęty będzie ignorowane przez śledzenie.','If true, the note will be shown to customers and they will be notified. If false, the note will be for admin reference only.'=>'Jeśli "true", notatka będzie widoczna dla klienta i zostanie on o niej powiadomiony. Jeśli "false", notatka będzie widoczna tylko dla admina.','If true, the note will be shown to customers. If false, the note will be for admin reference only.'=>'Jeśli to prawda, notatka będzie wyświetlana klientom. Jeśli false, notatka będzie dostępna tylko dla administratora.','If true, this coupon will not be applied to items that have sale prices.'=>'Jeśli "true", kupon nie będzie stosowany do produktów, które są w promocji.','If true, this note will be attributed to the current user. If false, the note will be attributed to the system.'=>'Jeśli ustawione na "true", notatka ta zostanie przypisana do bieżącego użytkownika. Jeśli na "false", notatka zostanie przypisana do systemu.','If unchecked, customers will need to set a username during account creation.'=>'Jeśli opcja nie jest zaznaczona, klienci będą musieli ustawić nazwę użytkownika podczas tworzenia konta.','If you are modifying WooCommerce on a parent theme that you did not build personally we recommend using a child theme. See: <a href="%s" target="_blank">How to create a child theme</a>'=>'Jeśli modyfikujesz WooCommerce lub motyw nadrzędny, którego nie jesteś autorem, polecamy używanie motywu potomnego. Zobacz: <a href="%s" target="_blank">Jak tworzyć motywy potomne</a>','If you are using X-Accel-Redirect download method along with NGINX server, make sure that you have applied settings as described in <a href=\'%s\'>Digital/Downloadable Product Handling</a> guide.'=>'Jeśli używasz metody pobierania X-Accel-Redirect wraz z serwerem NGINX, upewnij się, że zastosowano ustawienia zgodnie z opisem w <a href=\'%s\'>Przewodniku do obsługi produktów do pobierania</a>.','If you change your mind within 30 days of your purchase, we\'ll give you a full refund — hassle-free.'=>'Jeśli zmienisz zdanie w ciągu 30 dni od zakupu, zwrócimy Ci pełną kwotę - bez żadnych problemów.','If you continue, some variations of this product will be deleted and customers will no longer be able to purchase them.'=>'Jeśli będziesz kontynuować, niektóre warianty tego produktu zostaną usunięte, a klienci nie będą już mogli ich kupić.','If you continue, the cart block will be replaced with the classic experience powered by shortcodes. This means that you may lose customizations that you made to the cart block.'=>'Jeśli będziesz kontynuować, blok koszyka zostanie zastąpiony klasycznym doświadczeniem opartym na skrótach. Oznacza to, że dostosowania wprowadzone w bloku koszyka mogą zostać utracone.','If you continue, the checkout block will be replaced with the classic experience powered by shortcodes. This means that you may lose:'=>'Jeśli będziesz kontynuować, blok kasy zostanie zastąpiony klasycznym doświadczeniem opartym na skrótach. Oznacza to, że możesz stracić:','If you continue, this variation with all of its information will be deleted and customers will no longer be able to purchase it.'=>'Jeśli będziesz kontynuować, ten wariant wraz ze wszystkimi informacjami zostanie usunięty, a klienci nie będą już mogli go kupić.','If you copied over a template file to change something, then you will need to copy the new version of the template and apply your changes again.'=>'Jeśli skopiowałeś plik szablonu, aby coś zmienić, musisz skopiować nową wersję szablonu i zastosować zmiany ponownie.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Jeśli utworzysz konto, zachowamy twoje imię i nazwisko, adres, e-mail oraz numer telefonu, które będą wykorzystane przy składaniu następnych zamówień.','If you define a "Terms" page the customer will be asked if they accept them when checking out.'=>'Jeśli ustawisz stronę "Regulamin" klient będzie proszony o zaakceptowanie regulaminu przy finalizacji zamówienia.','If you didn\'t make this request, just ignore this email. If you\'d like to proceed:'=>'Jeśli to nie twoja prośba, zignoruj tę wiadomość. Jeśli chcesz kontynuować:','If you didn’t make this request, just ignore this email. If you’d like to proceed, reset your password via the link below:'=>'Jeśli nie złożyłeś takiej prośby, zignoruj tę wiadomość. Jeśli chcesz kontynuować, zresetuj hasło za pomocą poniższego odnośnika:','If you don\'t have an application password (not your account password), generate a password from %s'=>'Jeżeli nie masz hasła do aplikacji (to nie jest hasło do konta), wygeneruj hasło na stronie %s','If you find a bug within WooCommerce core you can create a ticket via <a href="%1$s">GitHub issues</a>. Ensure you read the <a href="%2$s">contribution guide</a> prior to submitting your report. To help us solve your issue, please be as descriptive as possible and include your <a href="%3$s">system status report</a>.'=>'Jeśli znajdziesz błąd w WooCommerce możesz utworzyć zgłoszenie poprzez <a href="%1$s">GitHub</a>. Przed zgłoszeniem przeczytaj <a href="%2$s">wskazówki dla współtwórców</a>. Aby pomóc nam w rozwiązaniu problemu, prosimy o obszerne opisanie problemu i załączenie <a href="%3$s">statusu systemu</a>.','If you have any questions or notice anything unexpected, feel free to reach out to our support team through your account or reply to this email.'=>'Jeśli masz jakieś pytania lub zauważysz coś nieoczekiwanego, skontaktuj się z naszym zespołem pomocy technicznej za pośrednictwem swojego konta lub odpowiedz na tę wiadomość e-mail.','If you have shopped with us before, please enter your details below. If you are a new customer, please proceed to the Billing section.'=>'Jeśli już robiłeś/aś u nas zakupy, prosimy wpisz swoje dane poniżej. Jeśli jesteś nowym klientem przejdź do sekcji danych płatności.','If you like %1$s please leave us a %2$s rating. A huge thanks in advance!'=>'Jeśli lubisz %1$s, zostaw nam ocenę %2$s. Z góry dziękujemy!','If you like, you may enter custom structures for your product URLs here. For example, using <code>shop</code> would make your product links like <code>%sshop/sample-product/</code>. This setting affects product URLs only, not things such as product categories.'=>'Jeśli chcesz, możesz ustawić własną strukturę URL dla produktów. Na przykład używając <code>sklep</code>, produkty będą dostępne pod adresem <code>%ssklep/przykladowy-produkt/</code>. To ustawienie dotyczy jedynie adresów stron produktowych, a nie dotyczy innych, np. kategorii.','If you need any help with your order, please contact us at %s'=>'Jeśli potrzebujesz pomocy z zamówieniem, skontaktuj się z nami pod adresem %s','If you need any help with your order, please contact us at %s.'=>'Jeśli potrzebujesz pomocy z zamówieniem, skontaktuj się z nami pod adresem %s.','If you need any help with your order, please contact us at {store_email}.'=>'Jeśli potrzebujesz pomocy z zamówieniem, skontaktuj się z nami pod adresem {store_email}.','If you need to access the setup wizard again, please click on the button below.'=>'Kliknij przycisk poniżej, jeśli chcesz użyć kreatora konfiguracji jeszcze raz.','If you need to enable or disable the extended task lists, please click on the button below.'=>'Jeśli chcesz włączyć lub wyłączyć rozszerzone listy zadań, kliknij na poniższy przycisk.','If you need to enable or disable the task lists, please click on the button below.'=>'Jeśli chcesz włączyć lub wyłączyć listę zadań, kliknij na przycisk poniżej.','If you remove this attribute, customers will no longer be able to purchase some variations of this product.'=>'Jeśli usuniesz ten atrybut klienci nie będą mogli kupić niektórych z wariantów tego produktu.','If you would like to use this block as your default cart, <a>update your page settings</a>.'=>'Jeśli chcesz używać tego bloku jako domyślnego koszyka, <a>zaktualizuj ustawienia strony</a>.','If you would like to use this block as your default checkout, <a>update your page settings</a>.'=>'Jeśli chcesz używać tego bloku jako domyślnej opcji płatności, <a>zaktualizuj ustawienia strony</a>.','If you\'d like to continue with your purchase, please return to %s and try a different method of payment.'=>'Jeśli chcesz kontynuować zakup, wróć do %s i wypróbuj inną metodę płatności.','If you\'d like to offer <span class="help_tip" data-tip="%1$s">live rates</span> from a specific carrier (e.g. UPS) you can find a variety of extensions available for WooCommerce <a href="%2$s" target="_blank">here</a>.'=>'Jeśli chcesz zaoferować <span class="help_tip" data-tip="%1$s">>stawki wysyłkowe w czasie rzeczywistym</span> od określonego operatora (np. UPS), możesz znaleźć różne rozszerzenia dostępne dla WooCommerce <a href="%2$s" target="_blank">tutaj</a>.','If you\'ve just placed an order, give your email a quick check for the confirmation.'=>'Jeśli właśnie złożyłeś zamówienie, szybko sprawdź swoją skrzynkę e-mail w poszukiwaniu potwierdzenia.','If your main PayPal email differs from the PayPal email entered above, input your main receiver email for your PayPal account here. This is used to validate IPN requests.'=>'Jeśli Twój główny e-mail PayPal różni się od e-maila podanego powyżej, wpisz tutaj e-mail PayPal do odbioru płatności. Ten adres jest używany do walidacji żądań IPN.','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Jeśli twój sklep znajduje się na terenie UE, zalecamy, aby oprócz podatków automatycznych, korzystać z rozszerzenia EU VAT Number. Dzięki niemu w momencie składania zamówienia zostanie wyświetlone pole do pobrania i walidacji numeru VAT UE klienta, jeśli taki posiada.','If you’d like to speed up your process and print your shipping label straight from your Woo dashboard, WooCommerce Shipping may be for you! '=>'Jeśli chcesz przyspieszyć swój proces i wydrukować etykietę wysyłkową bezpośrednio z pulpitu nawigacyjnego Woo, WooCommerce Shipping może być dla Ciebie!','Ifrane'=>'Ifrane','IFSC'=>'Kod IFSC','Ifugao'=>'Ifugao','Iganga'=>'Iganga','Ilaam (ایلام)'=>'Ilaam (ایلام)','Ilfov'=>'Ilfov','Illinois'=>'Illinois','Illizi'=>'Illizi','Ilocos Norte'=>'Ilocos Norte','Ilocos Sur'=>'Ilocos Sur','Iloilo'=>'Iloilo','Image'=>'Obrazek','Image alternative text.'=>'Alternatywny opis obrazka.','Image data.'=>'Dane obrazka.','Image fit'=>'Dopasowanie obrazu','Image ID.'=>'Identyfikator obrazka.','Image is scaled and cropped to fill the entire space without being distorted.'=>'Obraz jest skalowany i przycinany, aby wypełnić całą przestrzeń bez zniekształceń.','Image is scaled to fill the space without clipping nor distorting.'=>'Obraz jest skalowany w celu wypełnienia przestrzeni bez przycinania lub zniekształcania.','Image name.'=>'Nazwa obrazka.','Image of the product that the review belongs to.'=>'Obrazek produktu, do którego należy opinia.','Image position. 0 means that the image is featured.'=>'Pozycja obrazka. Zero oznacza zdjęcie wyróżnione.','Image preview'=>'Podgląd obrazu','Image size'=>'Rozmiar obrazu','Image size used for products in the catalog.'=>'Rozmiar obrazka w katalogu produktów.','Image size used for the main image on single product pages. These images will remain uncropped.'=>'Rozmiar używany dla głównego obrazka na stronie produktu. Te obrazki nie będą przycinane.','Image upload icon'=>'Ikona przesyłania obrazu','Image url'=>'Adres URL obrazka','Image URL.'=>'Adres URL obrazka.','Image width'=>'Szerokość obrazu','Image will be stretched and distorted to completely fill the space.'=>'Obraz zostanie rozciągnięty i zniekształcony, aby całkowicie wypełnić przestrzeń.','Images'=>'Obrazki','Images will be cropped into a square'=>'Obrazki zostaną przycięte do kwadratu','Images will be cropped to a custom aspect ratio'=>'Obrazki zostaną przycięte do niestandardowego współczynnika proporcji','Images will display using the aspect ratio in which they were uploaded'=>'Obrazki będą wyświetlane w takich proporcjach, w jakich zostały przesłane','Imbabura'=>'Imbabura','Immediately'=>'Natychmiast','Imo'=>'Imo','Imperia'=>'Imperia','Import'=>'Importuj','Import <strong>products</strong> to your store via a csv file.'=>'Importuj <strong>produkty</strong> do swojego sklepu z pliku CSV.','Import <strong>tax rates</strong> to your store via a csv file.'=>'Import <strong>stawek podatkowych</strong> do sklepu z pliku csv.','Import a .json file. You can import only one Blueprint at a time.'=>'Import pliku .json. Jednocześnie można zaimportować tylko jeden Blueprint.','Import all products at once by uploading a CSV file.'=>'Zaimportuj wszystkie produkty jednocześnie, przesyłając plik CSV.','Import as meta data'=>'Importuj jako dane meta','Import complete - imported %s tax rates.'=>'Import zakończony - zaimportowano stawki podatkowe: %s.','Import complete!'=>'Import został zakończony!','Import CSV'=>'Import CSV','Import historical data'=>'Import danych historycznych','Import Products'=>'Importuj produkty','Import products'=>'Import produktów','Import products from a CSV file'=>'Importuj produkty z pliku CSV','Import products using the CSV Importer and Exporter'=>'Importuj produkty za pomocą importera i eksportera CSV','Import sample products'=>'Importuj przykładowe produkty','Import tax rates'=>'Import stawek podatkowych','Import your products'=>'Zaimportuj swoje produkty','Import your products from a CSV file.'=>'Importuj produkty z pliku CSV.','Imported %(label)s'=>'Importowane %(etykieta)','Imported data will not be lost if the import is stopped.'=>'Zaimportowane dane nie zostaną utracone w przypadku zatrzymania importu.','Importing'=>'Importowanie','Importing Customers'=>'Importowanie klientów','Importing Orders'=>'Importowanie zamówień','Importing the file will overwrite the current configuration for the following items in WooCommerce Settings:'=>'Zaimportowanie pliku spowoduje nadpisanie bieżącej konfiguracji dla następujących elementów w Ustawieniach WooCommerce:','Importing the file will overwrite the current configuration in WooCommerce Settings.'=>'Zaimportowanie pliku spowoduje nadpisanie bieżącej konfiguracji w Ustawieniach WooCommerce.','Importing your file…'=>'Importowanie pliku..','Improve our store offerings'=>'Ulepszanie oferty sklepu','Improvements and security updates'=>'Ulepszenia i aktualizacje zabezpieczeń','in'=>'cale','In case you want to participate in further discussion and future user research.'=>'Na wypadek, gdybyś chciał wziąć udział w dalszej dyskusji i przyszłych badaniach użytkowników.','In just a few moments, you\'ll be ready to test payments on your store.'=>'W ciągu kilku chwil będziesz gotowy do przetestowania płatności w swoim sklepie.','In order for <strong>database caching</strong> to work with WooCommerce you must add %1$s to the "Ignored Query Strings" option in <a href="%2$s">W3 Total Cache settings</a>.'=>'Aby <strong>cachowanie bazy danych</strong> działało poprawnie z  WooCommerce, musisz dodać %1$s do opcji "Ignored Query Strings" w <a href="%2$s">ustawieniach W3 Total Cache</a>.','In order to install a product, you need to first connect your account.'=>'Aby zainstalować produkt, należy najpierw połączyć swoje konto.','In progress'=>'W trakcie','In reply to %s.'=>'W odpowiedzi do %s.','In stock'=>'Na stanie','in stock'=>'w magazynie','In stock?'=>'W magazynie?','In the WordPress editor, each paragraph, image, or video is presented as a distinct “block” of content.'=>'W edytorze WordPress każdy akapit, obraz lub wideo jest prezentowany jako odrębny "blok" treści.','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'W tej sekcji umieść listę podmiotów, którym udostępniasz dane i w jakim celu to robisz. Lista może zawierać w szczególności usługi analityczne, marketingowe, bramki płatności, kurierów oraz osadzone treści.','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'W tej sekcji umieść listę operatorów płatności, z których korzystasz, aby przyjmować płatności, ponieważ mogą oni przetwarzać dane klientów. Jako przykład podaliśmy PayPal, ale usuń te informacje, jeśli nie korzystasz z PayPala.','In-progress'=>'W toku','In-Progress <span class="count">(%s)</span>'=>'W trakcie <span class="count">(%s)</span>' . "\0" . 'W trakcie <span class="count">(%s)</span>' . "\0" . 'W trakcie <span class="count">(%s)</span>','Inactive'=>'Nieaktywne','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Nieaktywne konta to takie, na które nie było logowania lub zamówień przez określony czas. Zostaną one usunięte. Zamówienia zostaną skonwertowane na zamówienia gości.','Inactive plugins'=>'Wyłączone wtyczki','Inactive plugins.'=>'Wyłączone wtyczki.','Inbox'=>'Skrzynka odbiorcza','Inbox Notes Options'=>'Opcje notatek w skrzynce odbiorczej','Inbox notification has been deleted'=>'Powiadomienie ze skrzynki odbiorczej zostało usunięte','Inbox notification not found'=>'Nie znaleziono powiadomienia w skrzynce odbiorczej','Incentive illustration'=>'Ilustracja motywacyjna','Inches'=>'Cale','Include downloads'=>'Dołącz pliki do pobrania','Include this product in a featured section on your website with a widget or shortcode. <moreLink />'=>'Umieść ten produkt w wyróżnionej sekcji na swojej stronie internetowej za pomocą widżetu lub krótkiego kodu. <moreLink />','Includes all settings in WooCommerce | Settings | Account and Privacy.'=>'Obejmuje wszystkie ustawienia w WooCommerce | Ustawienia | Konto i prywatność.','Includes all settings in WooCommerce | Settings | Advanced.'=>'Zawiera wszystkie ustawienia w WooCommerce | Ustawienia | Zaawansowane.','Includes all settings in WooCommerce | Settings | Emails.'=>'Zawiera wszystkie ustawienia w WooCommerce | Ustawienia | E-maile.','Includes all settings in WooCommerce | Settings | General.'=>'Obejmuje wszystkie ustawienia w WooCommerce | Ustawienia | Ogólne.','Includes all settings in WooCommerce | Settings | Integrations.'=>'Zawiera wszystkie ustawienia w WooCommerce | Ustawienia | Integracje.','Includes all settings in WooCommerce | Settings | Payments.'=>'Obejmuje wszystkie ustawienia w WooCommerce | Ustawienia | Płatności.','Includes all settings in WooCommerce | Settings | Products.'=>'Zawiera wszystki