ation in your ticket when contacting support:'=>'Skopiuj i wklej poniższe informacje do swojego zgłoszenia, kontaktując się z pomocą techniczną:','Please create a password for your account.'=>'Utwórz hasło do swojego konta.','Please create a stronger password'=>'Prosimy o utworzenie silniejszego hasła','Please edit your cart and try again.'=>'Edytuj swój koszyk i spróbuj ponownie.','Please enabled Gutenberg for this feature'=>'Włącz Gutenberg dla tej funkcji','Please enter a city'=>'Wprowadź miasto','Please enter a coupon code.'=>'Proszę wpisać kod kuponu.','Please enter a post code'=>'Wprowadź kod pocztowy','Please enter a prefix for your invoice numbers. If you use your PayPal account for multiple stores ensure this prefix is unique as PayPal will not allow orders with the same invoice number.'=>'Wpisz prefiks do numerów faktur. Jeśli używasz konta PayPal dla wielu sklepów upewnij się, że prefiks jest unikalny, ponieważ PayPal nie pozwala na zamównienia z takim samym numerem faktury.','Please enter a product name shorter than 120 characters.'=>'Wprowadź nazwę produktu krótszą niż 120 znaków.','Please enter a stronger password.'=>'Proszę wpisać mocniejsze hasło.','Please enter a valid %s'=>'Wprowadź prawidłowy %s','Please enter a valid date.'=>'Wprowadź prawidłową datę.','Please enter a valid Eircode.'=>'Proszę wpisać poprawny kod Eircode.','Please enter a valid email address'=>'Proszę wpisać poprawny adres e-mail','Please enter a valid email address.'=>'Wpisz poprawny adres e-mail.','Please enter a valid email at checkout to use coupon code "%s".'=>'Wpisz poprawny adres e-mail na stronie zamówienia, aby użyć kuponu „%s”.','Please enter a valid email to use coupon code "%s".'=>'Wpisz poprawny adres e-mail, aby użyć kuponu „%s”.','Please enter a valid number.'=>'Wpisz poprawny numer.','Please enter a valid order ID'=>'Proszę wpisać poprawny numer zamówienia','Please enter a valid password'=>'Wprowadź prawidłowe hasło','Please enter a valid postcode'=>'Wprowadź prawi