low the main e-mail header.'=>'Tekst wyświetlany pod głównym nagłówkiem wiadomości e-mail.','Text to appear below the main email content.'=>'Tekst, który pojawi się poniżej głównej treści e-maila.','Text-only'=>'Tylko tekst','Thai baht'=>'Bat','Thailand'=>'Tajlandia','Thakurgaon'=>'Thakurgaon','Thank you for selling with WooCommerce.'=>'Dziękujemy za sprzedaż z WooCommerce.','Thank you for trying out our new email customization features. We’d love to hear your feedback on how we could improve the experience.'=>'Dziękujemy za wypróbowanie naszych nowych funkcji dostosowywania wiadomości e-mail. Chętnie poznamy Twoją opinię na temat tego, jak moglibyśmy ulepszyć nasze doświadczenie.','Thank you for your feedback!'=>'Dziękujemy za Twoją opinię!','Thank you for your in-store purchase'=>'Dziękujemy za zakup w sklepie','Thank you for your order'=>'Dziękujemy za złożenie zamówienia','Thank you for your patience! Unfortunately, the test account creation is taking a bit longer than we anticipated. But don\'t worry — we won\'t give up! Feel free to close this modal and check back later. We appreciate your understanding!'=>'Dziękujemy za cierpliwość! Niestety, tworzenie konta testowego trwa nieco dłużej niż przewidywaliśmy. Ale nie martw się - nie poddamy się! Zachęcamy do zamknięcia tego okna i sprawdzenia go później. Jesteśmy wdzięczni za zrozumienie!','Thank you for your payment. Your transaction has been completed, and a receipt for your purchase has been emailed to you. Log into your PayPal account to view transaction details.'=>'Dziękujemy za płatność. Twoja transakcja została zakończona, a potwierdzenie zostało wysłane na podany e-mail. Zaloguj się na swoje konto PayPal, aby zobaczyć szczegóły transakcji.','Thank you. Your order has been fulfilled.'=>'Dziękujemy. Twoje zamówienie zostało zrealizowane.','Thank you. Your order has been received.'=>'Dziękujemy. Otrzymaliśmy Twoje zamówienie.','Thanks :)'=>'Dzięki :)','Thanks again! If you need any help with your order, please contact us at %s,'=>'Jeszcze raz dziękujemy! Jeśli potrzebujesz pomocy z zamówieniem, skontaktuj się z nami pod adresem %s,','Thanks again! If you need any help with your order, please contact us at %s.'=>'Jeszcze raz dziękujemy! Jeśli potrzebujesz pomocy z zamówieniem, skontaktuj się z nami pod adresem %s.','Thanks again! If you need any help with your order, please contact us at {store_email}.'=>'Jeszcze raz dziękujemy! Jeśli potrzebujesz pomocy z zamówieniem, skontaktuj się z nami pod adresem {store_email}.','Thanks for creating an account on %1$s. Your username is %2$s. You can access your account area to view orders, change your password, and more at: %3$s'=>'Dziękujemy za założenie konta na %1$s. Twoja nazwa użytkownika to %2$s. Możesz uzyskać dostęp do swojego konta, aby przejrzeć zamówienia, zmienić hasło i nie tylko tutaj: %3$s','Thanks for creating an account on %s. Here’s a copy of your user details.'=>'Dziękujemy za utworzenie konta na %s. Oto kopia twoich danych użytkownika.','Thanks for joining the waitlist! You will hear from us again when "{product_name}" is back in stock.'=>'Dziękujemy za dołączenie do listy oczekujących! Otrzymasz od nas wiadomość, gdy produkt "{product_name}" będzie ponownie dostępny.','Thanks for reading.'=>'Dziękujemy za przeczytanie.','Thanks for shopping with us'=>'Dziękujemy za zakupy u nas','Thanks for shopping with us.'=>'Dziękujemy za zakupy u nas.','Thanks for signing up! An account has been created for you. Please complete the sign-up process by following the verification link sent to your e-mail.'=>'Dziękujemy za rejestrację! Twoje konto zostało utworzone. Dokończ proces rejestracji, korzystając z odnośnika weryfikacyjnego wysłanego na twój adres e-mail.','Thanks for signing up! Please complete the sign-up process by following the verification link sent to your e-mail.'=>'Dziękujemy za rejestrację! Zakończ proces rejestracji, korzystając z odnośnika weryfikacyjnego wysłanego na twój adres e-mail.','Thanks for the feedback — we\'ll put it to good use!'=>'Dziękujemy za opinie - wykorzystamy je w praktyce!','Thanks for the feedback. We\'ll put it to good use!'=>'Dziękujemy za opinię. Dobrze je wykorzystamy!','Thanks for trying out the new product editor!'=>'Dziękujemy za wypróbowanie nowego edytora produktów!','Thanks for using Jetpack! Your store is almost ready: to activate services like %s, just connect your store.'=>'Dziękujemy za używanie Jetpacka! Twój sklep jest prawie gotowy: aby włączyć usługi takie jak %s, połącz swój sklep.','Thanks for using {site_url}!'=>'Dziękujemy za korzystanie z {site_url}!','Thanks for your order. It’s on-hold until we confirm that payment has been received.'=>'Dziękujemy za zamówienie. Jest ono wstrzymane do czasu potwierdzenia otrzymania płatności.','Thanks!'=>'Dziękujemy!','Tharaka-Nithi'=>'Tharaka-Nithi','the'=>'ten','The "%1$s" coupon has been removed from your cart: %2$s'=>'Kupon "%1$s" został usunięty z koszyka: %2$s','The "from" email address is invalid. Please enter a valid email address that will appear as the sender in outgoing WooCommerce emails.'=>'Adres e-mail "od" jest nieprawidłowy. Wprowadź prawidłowy adres e-mail, który będzie wyświetlany jako nadawca w wychodzących wiadomościach e-mail WooCommerce.','The "locations not covered by your other zones" zone cannot be updated.'=>'"Lokalizacje nie objęte innymi strefami" nie mogą być edytowane.','The "WooCommerce Admin" plugin will be installed and activated'=>'Wtyczka "WooCommerce Admin" zostanie zainstalowana i włączona','The %1$s plugin has been deactivated as the latest improvements are now included with the %2$s plugin.'=>'Wtyczka %1$s została wyłączona, ponieważ najnowsze usprawniania są od teraz zawarte we wtyczce %2$s.','The %1$sApproved Product Download Directories list%2$s has been updated. To protect your site, please review the list and make any changes that might be required. For more information, please refer to %3$sthis guide%2$s.'=>'%1$sLista dozwolonych katalogów pobierania produktów%2$s została zaktualizowana. Proszę zweryfikować listę i dokonać w niej ewentualnych zmian, które mogą być konieczne w celu ochrony twojej witryny. Więcej informacji można znaleźć w %3$stym przewodniku%2$s.','The %s block requires a product context. When used in a Query Loop, the Query Loop must be configured to display products.'=>'Blok %s wymaga kontekstu produktu. W przypadku użycia w pętli zapytań, pętla zapytań musi być skonfigurowana do wyświetlania produktów.','The %s cannot be deleted.'=>'Nie można usunąć: %s.','The %s class can only be run within WP CLI.'=>'Klasa %s może być uruchomiona tylko w ramach WP CLI.','The %s does not support trashing.'=>'Nie ma obsługi kosza: %s.','The %s extension is not active.'=>'Rozszerzenie %s nie jest włączone.','The %s extension is not up-to-date. Please update to the latest version and try again.'=>'Rozszerzenie %s nie jest aktualne. Zaktualizuj do najnowszej wersji i spróbuj ponownie.','The %s has already been deleted.'=>'Już usunięto: %s.','The %s hook has a filter set, so some log files may have different retention settings.'=>'Ustawiony jest filtr %s, więc niektóre pliki dziennika zdarzeń mogą mieć inne ustawienia okresu przechowywania.','The %s is not a valid URL'=>'%s nie jest prawidłowym adresem URL','The %s payment gateway is not available.'=>'Bramka płatności %s jest niedostępna.','The <article> element should represent a self-contained, syndicatable portion of the document.'=>'Element <article> powinien reprezentować samodzielną, dającą się syndykować część dokumentu.','The <aside> element should represent a portion of a document whose content is only indirectly related to the document\'s main content.'=>'Element <aside> powinien reprezentować część dokumentu, którego zawartość jest tylko pośrednio związana z główną treścią dokumentu.','The <div> element should only be used if the block is a design element with no semantic meaning.'=>'Element <div> powinien być używany tylko wtedy, gdy blok jest elementem projektu bez znaczenia semantycznego.','The <footer> element should represent a footer for its nearest sectioning element (e.g.: <section>, <article>, <main> etc.).'=>'Element <footer> powinien reprezentować stopkę dla najbliższego elementu sekcji (np. <section>, <article>, <main> itp.).','The <header> element should represent introductory content, typically a group of introductory or navigational aids.'=>'Element <header> powinien reprezentować treść wprowadzającą, zazwyczaj grupę pomocy wprowadzających lub nawigacyjnych.','The <main> element should be used for the primary content of your document only.'=>'Element <main> powinien być używany tylko dla głównej zawartości dokumentu.','The <nav> element should be used to identify groups of links that are intended to be used for website or page content navigation.'=>'Element <nav> powinien być używany do identyfikowania grup linków, które są przeznaczone do nawigacji w witrynie lub treści strony.','The <section> element should represent a standalone portion of the document that can\'t be better represented by another element.'=>'Element <section> powinien reprezentować samodzielną część dokumentu, która nie może być lepiej reprezentowana przez inny element.','The action type to determine how to use the URL.'=>'Typ akcji określający sposób użycia adresu URL.','The action\'s schedule frequency.'=>'Częstotliwość harmonogramu akcji.','The active incentive for the provider.'=>'Aktywna zachęta dla dostawcy.','The active version of WooCommerce does not support template cache clearing.'=>'Włączona wersja WooCommerce nie obsługuje czyszczenia pamięci podręcznej szablonów.','The Add to Cart + Options templates allow defining a different layout for each product type.'=>'Szablony "Dodaj do koszyka + opcje" umożliwiają zdefiniowanie innego układu dla każdego rodzaju produktu.','The address from which your business operates'=>'Adres, pod którym prowadzona jest działalność','The admin note action label prop cannot be empty.'=>'Etykieta akcji notatki administratora nie może być pusta.','The admin note action name prop cannot be empty.'=>'Nazwa akcji notatki administratora nie może być pusta.','The admin note content prop cannot be empty.'=>'Treść notatki administratora nie może być pusta.','The admin note content_data prop must be an instance of stdClass.'=>'Wartość pola content_data notatki administratora musi być instancją stdClass.','The admin note date prop cannot be empty.'=>'Data notatki administratora nie może być pusta.','The admin note layout has a wrong prop value.'=>'Układ notatki administratora ma błędną wartość.','The admin note locale prop cannot be empty.'=>'Ustawienia regionalne notatki administratora nie mogą być puste.','The admin note name prop cannot be empty.'=>'Nazwa notatki administratora nie może być pusta.','The admin note source prop cannot be empty.'=>'Źródło notatki administratora nie może być puste.','The admin note status prop (%s) is not one of the supported statuses.'=>'Wybrany status notatki administratora (%s) nie jest wspierany.','The admin note status prop cannot be empty.'=>'Status notatki administratora nie może być pusty.','The admin note title prop cannot be empty.'=>'Tytuł notatki administratora nie może być pusty.','The admin note type prop (%s) is not one of the supported types.'=>'Wybrany typ notatki administratora (%s) nie jest wspierany.','The admin note type prop cannot be empty.'=>'Typ notatki administratora nie może być pusty.','The admin note type prop is deprecated.'=>'Właściwość typu notatki administratora jest przestarzała.','The affected WooCommerce webhooks will <b>not</b> be deleted and will be attributed to user id 0.<br/>'=>'Dotknięte webhooki WooCommerce <b>nie</b> zostaną usunięte i zostaną przypisane do identyfikatora użytkownika 0.<br/>','The amount of discount. Should always be numeric, even if setting a percentage.'=>'Kwota zniżki. Zawsze powinna być wartością numeryczną, nawet jeśli ustawiona jest wartość procentowa.','The amount of tax charged.'=>'Wysokość naliczonego podatku.','The amount of time (in seconds) that your site will spend on a single operation before timing out (to avoid server lockups)'=>'Czas (w sekundach), który twoja witryna będzie wykonywać pojedynczą operację, zanim zostanie osiągnięty limit czasu (w celu uniknięcia zawieszenia się serwera)','The amount that quantities increment by. Quantity must be an multiple of this value.'=>'Wielkość o jaką będą zwiększane ilości. Ilość musi być wielokrotnością tej wartości.','The API key provided does not have read permissions.'=>'Podany klucz aplikacji nie posiada praw odczytu.','The API key provided does not have write permissions.'=>'Wprowadzony klucz API nie ma uprawnień do zapisu.','The API version responding to the ping.'=>'Wersja API odpowiadająca na ping.','The app version needs to be 15.7 or above to sign in with this link.'=>'Wersja aplikacji musi być 15.7 lub wyższa, aby zalogować się za pomocą tego linku.','The Approved Product Download Directories list is currently being synchronized with the product catalog (%d%% complete). If you need to, you can cancel it.'=>'Lista dozwolonych katalogów pobierania produktów jest obecnie synchronizowana z katalogiem produktów (ukończono %d%%). Możesz anulować synchronizację, jeśli jest taka potrzeba.','The assigned attribute.'=>'Przypisany atrybut.','The attribute ID, or 0 if the attribute is not taxonomy based.'=>'Identyfikator atrybutu lub 0, jeśli atrybut nie bazuje na taksonomii.','The attribute name.'=>'Nazwa atrybutu.','The attribute taxonomy name.'=>'Nazwa taksonomii atrybutu.','The attribute taxonomy, or null if the attribute is not taxonomy based.'=>'Atrybut taksonomii lub NULL jeśli atrybut nie bazuje na taksonomii.','The attribute term name is required.'=>'Nazwa terminu atrybutu jest wymagana.','The available actions for the step.'=>'Dostępne akcje dla kroku.','The backup datastore does not support updating orders.'=>'Zapasowy magazyn danych nie obsługuje aktualizacji zleceń.','The badge label for the incentive.'=>'Etykieta identyfikatora dla zachęty.','The base page can also be used in your <a href="%s">product permalinks</a>.'=>'Strona bazowa może być także użyta w <a href="%s">bezpośrednich odnośnikach</a>.','The call to action label for the incentive.'=>'Etykieta wezwania do działania dla zachęty.','The callback_url needs to be over SSL'=>'Callback_url musi być przez SSL','The cart has been filled with the items from your previous order.'=>'Koszyk został wypełniony produktami z Twojego poprzedniego zamówienia.','The cart has encountered an unexpected error. If the error persists, please get in touch with us for help.'=>'Koszyk napotkał nieoczekiwany błąd. Jeśli błąd nadal występuje, skontaktuj się z nami w celu uzyskania pomocy.','The cart item product or variation ID.'=>'Identyfikator produktu lub wariantu w koszyku.','The Cart template displays the items selected by the user for purchase, including quantities, prices, and discounts. It allows users to review their choices before proceeding to checkout.'=>'Szablon koszyka wyświetla wybrane przez klienta produkty wraz z ich ilościami, cenami i rabatami. Pozwala klientom na przejrzenie ich wyborów przed przejściem do kasy.','The category of the suggestion.'=>'Kategoria sugestii.','The changes you made will be lost if you navigate away from this page.'=>'Niezapisane zmiany zostaną utracone, jeśli opuścisz tę stronę.','The checkout has encountered an unexpected error. <button>Try reloading the page</button>. If the error persists, please get in touch with us so we can assist.'=>'Kasa napotkała nieoczekiwany błąd. <button>Spróbuj ponownie załadować stronę</button>. Jeśli błąd nadal występuje, skontaktuj się z nami, abyśmy mogli pomóc.','The Checkout template guides users through the final steps of the purchase process. It enables users to enter shipping and billing information, select a payment method, and review order details.'=>'Szablon zamówienia prowadzi użytkowników przez ostatnie kroki procesu zakupu. Pozwala wpisać im dane o wysyłce i dane rozliczeniowe, wybrać metodę płatności i zweryfikować szczegóły zamówienia.','The chosen rate ID for the package.'=>'Wybrany identyfikator stawki dla paczki.','The city in which your business is located.'=>'Miasto, w którym siedzibę ma twoja firma.','The claim has been lost. Aborting current batch.'=>'Żądanie zostało utracone. Przerywanie bieżącej partii.','The class %1$s provided by %2$s filter must implement %3$s.'=>'Klasa %1$s zapewniana przez filtr %2$s musi zawierać %3$s.','The class attached to the "woocommerce_queue_class" does not implement the WC_Queue_Interface interface. The default %s class will be used instead.'=>'Klasa dołączona do "woocommerce_queue_class" nie implementuje interfejsu WC_Queue_Interface. Zamiast tego użyta zostanie domyślna klasa %s.','The comment has already been trashed.'=>'Komentarz został już usunięty.','The comparison operator to use for total filtering.'=>'Operator porównania używany do filtrowania całkowitego.','The content for this block is hidden due to block settings.'=>'Zawartość tego bloku jest ukryta ze względu na ustawienia bloku.','The content of the review.'=>'Treść opinii.','The context ID for which to dismiss the incentive. If not provided, will dismiss the incentive for all contexts.'=>'Identyfikator kontekstu, dla którego ma zostać odrzucona zachęta. Jeśli nie zostanie podany, zachęta zostanie odrzucona dla wszystkich kontekstów.','The Core Profiler step to mark as complete.'=>'Krok programu Core Profiler do oznaczenia jako ukończony.','The corresponding plugin details of the provider.'=>'Odpowiednie szczegóły wtyczki dostawcy.','The country and state or province, if any, in which your business is located.'=>'Kraj, w którym siedzibę ma twoja firma.','The coupon code already exists'=>'Kupon został już użyty','The coupon code cannot be empty.'=>'Kod kuponu nie może być pusty.','The coupon will expire at 00:00:00 of this date.'=>'Kupon wygasa o godzinie 00:00:00 tego dnia.','The coupon\'s unique code.'=>'Unikalny kod kuponu.','The coupons unique code.'=>'Unikatowy kod kuponu.','The CSV is invalid.'=>'Plik CSV jest błędny.','The current language used by WordPress. Default = English'=>'Aktualny język używany przez WordPressa. Domyślnie: angielski','The current status of the step.'=>'Bieżący status kroku.','The custom cost of goods sold values will revert back to their defaults for all the variations. Would you like to continue?'=>'Własne wartości kosztu sprzedanych towarów zostaną przywrócone do wartości domyślnych dla wszystkich wariantów. Czy chcesz kontynuować?','The customer’s payment failed or was declined, and no payment has been successfully made.'=>'Płatność klienta nie powiodła się lub została odrzucona, a żadna płatność nie została pomyślnie zrealizowana.','The database update process runs in the background and may take a little while, so please be patient. Advanced users can alternatively update via %1$sWP CLI%2$s.'=>'Proces aktualizacji bazy danych przebiega w tle i może zająć trochę czasu, więc prosimy o cierpliwość. Zaawansowani użytkownicy mogą alternatywnie aktualizować poprzez %1$sWP CLI%2$s.','The database version for WooCommerce. This should be the same as your WooCommerce version.'=>'Wersja bazy danych WooCommerce. Powinna być taka sama jak twoja wersja WooCommerce.','The date of the customer last order, as GMT.'=>'Data ostatniego zamówienia klienta (GMT).','The date of the download, as GMT.'=>'Data pobrania (GMT).','The date of the download, in the site\'s timezone.'=>'Data pobrania w strefie czasowej witryny.','The date the coupon expires, as GMT.'=>'Data ważności kuponu (GMT).','The date the coupon expires, in the site\'s timezone.'=>'Data wygaśnięcia kuponu, w strefie czasowej witryny.','The date the coupon was created, as GMT.'=>'Data utworzenia kuponu (GMT).','The date the coupon was created, in the site\'s timezone.'=>'Data utworzenia kuponu w strefie czasowej witryny.','The date the coupon was last modified, as GMT.'=>'Data ostatniej modyfikacji kuponu (GMT).','The date the coupon was last modified, in the site\'s timezone.'=>'Data ostatniej modyfikacji kuponu w strefie czasowej witryny.','The date the customer was created, as GMT.'=>'Data utworzenia klienta (GMT).','The date the customer was created, in the site\'s timezone.'=>'Data utworzenia klienta w strefie czasowej witryny.','The date the customer was last modified, as GMT.'=>'Data ostatniej modyfikacji klienta (GMT).','The date the customer was last modified, in the site\'s timezone.'=>'Data ostatniej aktualizacji klienta w strefie czasowej witryny.','The date the fulfillment was deleted.'=>'Data usunięcia realizacji.','The date the fulfillment was last updated.'=>'Data utworzenia realizacji.','The date the image was created, as GMT.'=>'Data utworzenia obrazka (GMT).','The date the image was created, in the site\'s timezone.'=>'Data utworzenia obrazka na podstawie strefy czasowej witryny.','The date the image was last modified, as GMT.'=>'Data ostatniej modyfikacji obrazka (GMT).','The date the image was last modified, in the site\'s timezone.'=>'Data ostatniej modyfikacji obrazka na podstawie strefy czasowej witryny.','The date the last order for this product was placed, in the site\'s timezone.'=>'Data złożenia ostatniego zamówienia w strefie czasowej witryny.','The date the order note was created, as GMT.'=>'Data utworzenia zamówienia (GMT).','The date the order note was created, in the site\'s timezone.'=>'Data kiedy notatka do zamówienia została dodana w strefie czasowej witryny.','The date the order refund was created, as GMT.'=>'Data zwrotu zamówienia (GMT).','The date the order refund was created, in the site\'s timezone.'=>'Data zwrotu zamówienia w strefie czasowej witryny.','The date the order was completed, as GMT.'=>'Data zrealizowania zamówienia (GMT).','The date the order was completed, in the site\'s timezone.'=>'Data zrealizowania zamówienia w strefie czasowej witryny.','The date the order was created, as GMT.'=>'Data utworzenia zamówienia (GMT).','The date the order was created, in the site\'s timezone.'=>'Data złożenia zamówienia z uwzględnieniem strefy czasowej strony witryny.','The date the order was last modified, as GMT.'=>'Data ostatniej modyfikacji zamówienia (GMT).','The date the order was last modified, in the site\'s timezone.'=>'Data ostatniej modyfikacji zamówienia z uwzględnieniem strefy czasowej witryny.','The date the order was paid, as GMT.'=>'Data płatności za zamówienie (GMT).','The date the order was paid, in the site\'s timezone.'=>'Data opłacenia zamówienia w strefie czasowej witryny.','The date the product was created, as GMT.'=>'Data utworzenia produktu (GMT).','The date the product was created, in the site\'s timezone.'=>'Data dodania produktu została utworzona w strefie czasowej witryny.','The date the product was last modified, as GMT.'=>'Data ostatniej modyfikacji produktu (GMT).','The date the product was last modified, in the site\'s timezone.'=>'Data ostatniej modyfikacji produktu została utworzona w strefie czasowej witryny.','The date the report end, as GMT.'=>'Data zakończenia raportu GMT.','The date the report end, in the site\'s timezone.'=>'Data zakończenia raportu w strefie czasowej witryny.','The date the report start, as GMT.'=>'Data rozpoczęcia raportu, jako GMT.','The date the report start, in the site\'s timezone.'=>'Data rozpoczęcia raportu w strefie czasowej witryny.','The date the review was created, as GMT.'=>'Data utworzenia opinii (GMT).','The date the review was created, in the site\'s timezone in human-readable format.'=>'Data utworzenia opinii, w strefie czasowej witryny, w formacie czytelnym dla człowieka.','The date the review was created, in the site\'s timezone.'=>'Data dodania oceny została utworzona w strefie czasowej witryny.','The date the variation was created, in the site\'s timezone.'=>'Data dodania wariantu została utworzona w strefie czasowej witryny.','The date the variation was last modified, in the site\'s timezone.'=>'Data ostatniej modyfikacji wariantu, z uwzględnieniem strefy czasowej witryny.','The date the webhook delivery was logged, as GMT.'=>'Data dostarczenia webhooka (GMT).','The date the webhook delivery was logged, in the site\'s timezone.'=>'Data dostarczenia webhooka w strefie czasowej witryny.','The date the webhook was created, as GMT.'=>'Data utworzenia webhooka (GMT).','The date the webhook was created, in the site\'s timezone.'=>'Data stworzenia webhooka w strefie czasowej witryny.','The date the webhook was last modified, as GMT.'=>'Data ostatniej modyfikacji webhooka (GMT).','The date the webhook was last modified, in the site\'s timezone.'=>'Data modyfikacji webhooka w strefie czasowej witryny.','The date when download access expires, as GMT.'=>'Data wygaśnięcia linku do pobrania (GMT).','The date when download access expires, in the site\'s timezone.'=>'Data wygaśnięcia linku do pobrania w strefie czasowej witryny.','The date you provided is invalid.'=>'Wprowadzona data nie jest poprawna.','The date/time the action is/was scheduled to run.'=>'Data/godzina uruchomienia zaplanowanego działania.','The decimal separator of displayed prices.'=>'Separator dziesiętny w wyświetlanych cen.','The default timezone for your server.'=>'Domyślna strefa czasowa serwera.','The delivery duration, in seconds.'=>'Czas dostawy w sekundach.','The description of the category.'=>'Opis kategorii.','The description of the payment method. It can contain basic HTML.'=>'Opis metody płatności. Może zawierać podstawowy kod HTML.','The description of the provider.'=>'Opis dostawcy.','The description of the suggestion.'=>'Opis sugestii.','The details for a recommended payment method.'=>'Szczegóły dotyczące zalecanej metody płatności.','The discount type for the coupon (e.g. percentage or fixed amount)'=>'Typ rabatu kuponu (np. procentowy lub kwotowy rabat)','The dismissals list for the incentive. Each dismissal entry includes a context and a timestamp. The `all` entry means the incentive was dismissed for all contexts.'=>'Lista zwolnień dla danej zachęty. Każdy wpis zwolnienia zawiera kontekst i znacznik czasu. Wpis `all` oznacza, że zachęta została odrzucona dla wszystkich kontekstów.','The display name of the email template.'=>'Wyświetlana nazwa szablonu wiadomości e-mail.','The downloadable file %1$s cannot be used as it does not have an allowed file type. Allowed types include: %2$s'=>'Plik %1$s nie może być użyty do pobrania, bo ma niedozwolone rozszerzenie. Dozwolone rozszerzenia to: %2$s','The downloadable file %s cannot be used as it does not exist on the server, or is not located within an approved directory. Please contact a site administrator for help. %2$sLearn more.%3$s'=>'Nie można użyć pliku %s do pobrania, ponieważ nie istnieje on na serwerze lub nie znajduje się w zatwierdzonym katalogu. Skontaktuj się z administratorem witryny, aby uzyskać pomoc. %2$sDowiedz się więcej.%3$s','The downloadable file %s cannot be used as it has been disabled.'=>'Plik do pobrania %s nie może być użyty, ponieważ został usunięty.','The editor does not display the real count value, but a placeholder to indicate how it will look on the front-end.'=>'Edytor nie wyświetla rzeczywistej wartości licznika, ale symbol zastępczy, aby wskazać, jak będzie wyglądać na interfejsie użytkownika.','The email address for the customer.'=>'Adres e-mail zamawiającego.','The email address provided does not match the email address on this order.'=>'Podany adres e-mail nie jest zgodny z adresem e-mail podanym w zamówieniu.','The email ID to recreate the post for.'=>'Identyfikator adresu e-mail, na który ma zostać wysłana wiadomość.','The email type to get subject for.'=>'Rodzaj wiadomości e-mail, dla której chcesz uzyskać temat.','The email type to preview.'=>'Rodzaj wiadomości e-mail do podglądu.','The end date of the sale must be after the start date.'=>'Data zakończenia sprzedaży musi być późniejsza niż data rozpoczęcia.','The entity ID is required.'=>'Identyfikator podmiotu jest wymagany.','The entity type must be "order".'=>'Typem podmiotu musi być "order".','The Eway extension for WooCommerce allows you to take credit card payments directly on your store without redirecting your customers to a third party site to make payment.'=>'Rozszerzenie Eway dla WooCommerce pozwala na przyjmowanie płatności kartą kredytową bezpośrednio w sklepie bez przekierowywania klientów na zewnętrzną stronę w celu dokonania płatności.','The eWAY extension for WooCommerce allows you to take credit card payments directly on your store without redirecting your customers to a third party site to make payment.'=>'Rozszerzenie eWAY dla WooCommerce pozwala przyjmować płatności kartą płatniczą bezpośrednio w sklepie bez przekierowywania klientów na zewnętrzne strony operatorów płatności.','The extension %s has been deactivated successfully.'=>'Rozszerzenie %s zostało pomyślnie wyłączone.','The extension has been successfully activated.'=>'Rozszerzenie zostało pomyślnie aktywowane.','The field %1$s is invalid for the location %2$s.'=>'Pole „%1$s” jest nieprawidłowe dla lokalizacji „%2$s”.','The field %s is invalid.'=>'Pole „%s” jest nieprawidłowe.','The field %s is required.'=>'Pole „%s” jest wymagane.','The file does not exist, please try again.'=>'Plik nie istnieje, spróbuj ponownie.','The file is empty or using a different encoding than UTF-8, please try again with a new file.'=>'Plik jest pusty lub nie używa kodowania znaków UTF-8, spróbuj ponownie z innym plikiem.','The filters in the analytics screen are easy to use.'=>'Filtry na ekranie analitycznym są łatwe w użyciu.','The filters\' functionality meets my needs.'=>'Funkcjonalność filtrów spełnia moje potrzeby.','The following active plugin(s) have not declared compatibility with WooCommerce %s yet and should be updated and examined further before you proceed:'=>'Poniższe włączone wtyczki nie potwierdzają kompatybilności z WooCommerce %s i powinny być zaktualizowane i przetestowane przed kontynuacją:','The following addresses will be used on the checkout page by default.'=>'Następujące adresy zostaną domyślnie użyte na stronie zamówienia.','The following error was returned'=>'Zwrócony został następujący błąd','The following error was returned from the API'=>'Interfejs API zwrócił następujący błąd','The following note has been added to your order:'=>'Do zamówienia dodano notatkę:','The following options affect how prices are displayed on the frontend.'=>'Poniższe ustawienia dotyczą wyświetlania cen w sklepie.','The following plugins will be installed and activated for you:'=>'Poniższe wtyczki zostaną zainstalowane i włączone:','The following problems were found:'=>'Znaleziono następujące problemy:','The following shipping integrations are active on your store.'=>'Następujące integracje wysyłki są aktywne w Twoim sklepie.','The following wizard will help you configure your store and get you started quickly.'=>'Ten kreator pomoże ci skonfigurować sklep i rozpocząć sprzedaż.','The font face family name is required.'=>'Nazwa rodziny kroju pisma jest wymagana.','The font face font style is required.'=>'Wymagany jest styl kroju pisma.','The font face src is required.'=>'Wymagane jest src kroju pisma.','The font face weight is required.'=>'Wymagana jest grubość kroju pisma.','The font family name is required.'=>'Nazwa rodziny kroju pisma jest wymagana.','The font family preview is required.'=>'Wymagany jest podgląd rodziny kroju pisma.','The fulfillment items should be an array.'=>'Elementy realizacji powinny być tablicą.','The fulfillment should contain at least one item.'=>'Realizacja powinna zawierać co najmniej jedną pozycję (element).','The fulfillment status of the order.'=>'Status realizacji zamówienia.','The general state of the onboarding process.'=>'Ogólny stan procesu wdrażania.','The general state of the provider with regards to it\'s payments processing.'=>'Ogólny stan dostawcy w odniesieniu do przetwarzania płatności.','The group "%s" does not exist.'=>'Grupa "%s" nie istnieje.' . "\0" . 'Grupy "%s" nie istnieją.' . "\0" . 'Grupy "%s" nie istnieją.','The homepage is one of the most important entry points in your store. When done right it can lead to higher conversions and engagement. Don\'t forget to personalize the homepage that we created for your store during the onboarding.'=>'Strona główna jest jednym z najważniejszych punktów w witrynie. Dobrze wykonana może zwiększyć konwersje i zaangażowanie. Nie zapomnij o spersonalizowaniu strony głównej, którą stworzyliśmy dla twojego sklepu podczas procesu instalacji.','The homepage URL of your site.'=>'Adres URL strony głównej witryny.','The HTTP response code from the receiving server.'=>'Kod HTTP odpowiedzi z serwera odbiorczego.','The HTTP response message from the receiving server.'=>'Komunikat HTTP odpowiedzi z serwera odbiorczego.','The ID for the parent of the resource.'=>'Identyfikator zasobu nadrzędnego.','The ID for the resource.'=>'Identyfikator zasobu.','The id for the resource.'=>'Identyfikator zasobu.','The ID of the package being shipped. Leave blank to apply to all packages.'=>'Identyfikator wysyłanej paczki. Pozostaw puste, aby zastosować do wszystkich paczek.','The ID of the package the shipping rates belong to.'=>'Identyfikator paczki, do której mają zastosowanie stawki za wysyłkę.','The ID of the payment method being used to process the payment.'=>'Identyfikator metody płatności używanej do dokonania zapłaty.','The ID of the template to use for sending the email.'=>'Identyfikator szablonu używanego do wysyłania wiadomości e-mail.','The image of the note, if any.'=>'Obrazek notatki, jeśli istnieje.','The image upload failed: "%s", creating the product without image'=>'Przesyłanie obrazku nie powiodło się: "%s", tworzenie produktu bez obrazku','The incentive description. It can contain stylistic HTML.'=>'Opis zachęty. Może zawierać stylistyczny HTML.','The incentive promo ID. This ID need to be fed into the onboarding flow.'=>'Identyfikator promocji motywacyjnej. Ten identyfikator musi zostać wprowadzony do procesu wdrażania.','The incentive title. It can contain stylistic HTML.'=>'Tytuł zachęty. Może zawierać stylistyczny kod HTML.','The incentive unique ID. This ID needs to be used for incentive dismissals.'=>'Unikalny identyfikator zachęty. Ten identyfikator musi być używany do zwolnień motywacyjnych.','The indicated downloads have been disabled (invalid location or filetype&mdash;%1$slearn more%2$s).'=>'Wskazane pliki do pobrania zostały wyłączone (nieprawidłowa lokalizacja lub typ pliku&mdash;%1$sdowiedz się więcej%2$s)','The installed version of the current active theme.'=>'Zainstalowana wersja aktualnie włączonego motywu.','The installed version of the parent theme.'=>'Zainstalowana wersja motywu nadrzędnego.','The ISO3166 alpha-2 country code to save for the current user.'=>'Kod kraju ISO3166 alpha-2 do zapisania dla bieżącego użytkownika.','The item product or variation ID.'=>'Identyfikator produktu lub wariantu.','The item type.'=>'Rodzaj przedmiotu.','The items were permanently deleted.'=>'Elementy zostały trwale usunięte.','The key of the meta data.'=>'Klucz metadanych.','The key that will be used when dealing with MaxMind Geolocation services. You can read how to generate one in <a href="%1$s">MaxMind Geolocation Integration documentation</a>.'=>'Klucz, który zostanie użyty do integracji z usługami lokalizacji MaxMind. Dowiedz się jak go wygenerować z <a href="%1$s">dokumentacji integracji MaxMind</a>.','The largest filesize that can be contained in one post.'=>'Największy rozmiar pliku, który może być zawarty w poleceniu post.','The largest filesize that can be uploaded to your WordPress installation.'=>'Największy rozmiar pliku, który może być przesłany do WordPressa.','The last inner block will follow other content.'=>'Ostatni blok wewnętrzny będzie następował po innych treściach.','The layout of the note (e.g. banner, thumbnail, plain).'=>'Układ notatki (np. baner, ikona, zwykły).','The legacy REST API is enabled'=>'Przestarzałe REST API jest włączone','The legacy REST API is NOT enabled'=>'Przestarzałe REST API NIE jest włączone','The Legacy REST API plugin is not installed on this site.'=>'Wtyczka przestarzałego REST API nie jest zainstalowana w tej witrynie.','The link to disable the test account for the payment gateway.'=>'Odnośnik do wyłączenia konta testowego dla bramki płatności.','The link to dismiss the incentive.'=>'Odnośnik do odrzucenia zachęty.','The link to hide the suggestion.'=>'Odnośnik do ukrycia sugestii.','The link to mark the suggestion as attached. This should be called when an extension is installed.'=>'Odnośnik do oznaczenia sugestii jako załączonej. Powinien być wywoływany po zainstalowaniu rozszerzenia.','The link to reset the provider state/account and restart the onboarding.'=>'Odnośnik do zresetowania stanu/konta dostawcy i ponownego uruchomienia wdrażania (onboardingu).','The link to the settings page for the payment gateway.'=>'Odnośnik do strony ustawień bramki płatności.','The list of recommended payment methods details for the payment gateway.'=>'Lista zalecanych metod płatności dla bramki płatności.','The list of suggestions, excluding the ones part of the providers list.'=>'Lista sugestii, z wyłączeniem sugestii należących do listy dostawców.','The location argument must be a string.'=>'Argument lokalizacji musi być ciągiem znaków.','The location argument must be a valid ISO3166 alpha-2 country code.'=>'Argument lokalizacji musi być prawidłowym kodem kraju ISO3166 alpha-2.','The location that the MaxMind database should be stored. By default, the integration will automatically save the database here.'=>'Lokalizacja, w której będzie przechowywana baza danych MaxMind. Domyślnie integracja zapisze bazę tutaj.','The logging handler class.'=>'Klasa obsługująca logowanie.','The logical relationship between attributes when filtering across multiple at once.'=>'Logiczny związek pomiędzy atrybutami podczas filtrowania wielu jednocześnie.','The management details of the provider.'=>'Szczegóły dotyczące zarządzania dostawcą.','The marketing channel that this campaign type belongs to.'=>'Kanał marketingowy, do którego należy ten rodzaj kampanii.','The maximum allowed setting is %d'=>'Maksymalna dozwolona wartość to %d','The maximum amount of memory (RAM) that your site can use at one time.'=>'Maksymalny rozmiar pamięci (RAM), z którego może korzystać witryna w czasie zapytania.','The maximum length of the field is %d'=>'Maksymalna długość pola wynosi %d','The maximum number of individual items this coupon can apply to when using product discounts. Leave blank to apply to all qualifying items in cart.'=>'Maksymalna liczba poszczególnych elementów, do których ten kupon można stosować w czasie korzystania ze zniżek produktów. Pozostaw puste, aby zastosować do wszystkich pasujących przedmiotów w koszyku.','The maximum number of variables your server can use for a single function to avoid overloads.'=>'Maksymalna liczba zmiennych, których serwer może użyć do pojedynczej funkcji, aby uniknąć przeciążenia.','The maximum quantity allowed for this line item.'=>'Maksymalna ilość dozwolona dla tej pozycji.','The maximum quantity of &quot;%1$s&quot; allowed in the cart is %2$s'=>'Maksymalna ilość &quot;%1$s&quot; dozwolona w koszyku wynosi %2$s','The maximum quantity that can be added to the cart.'=>'Maksymalna ilość, którą można dodać do koszyka.','The maximum spend for coupon "%1$s" is %2$s.'=>'Maksymalny kwota wydatków dla kuponu "%1$s" wynosi %2$s.','The maximum value of the field is %d'=>'Maksymalna wartość pola wynosi %d','The MaxMind license key is invalid. If you have recently created this key, you may need to wait for it to become active.'=>'Nieprawidłowy klucz licencyjny MaxMind. Jeśli stworzyłeś klucz niedawno, może minąć trochę czasu, zanim zostanie aktywowany.','The meta data array.'=>'Tablica metadanych.','The meta data object.'=>'Obiekt metadanych.','The meta key to delete.'=>'Klucz meta do usunięcia.','The metaboxhidden_product meta from the user metas.'=>'Meta metaboxhidden_product z meta użytkownika.','The Mini-Cart template allows shoppers to see their cart items and provides access to the Cart and Checkout pages.'=>'Szablon minikoszyka pozwala klientom zobaczyć produkty w koszyku i umożliwia dostęp do stron koszyka i zamówienia.','The minimum allowed setting is %d'=>'Minimalna dozwolona wartość to %d','The minimum length of the field is %d'=>'Minimalna długość pola wynosi %d','The minimum quantity allowed for this line item.'=>'Minimalna ilość dozwolona dla tej pozycji.','The minimum quantity of &quot;%1$s&quot; allowed in the cart is %2$s'=>'Minimalna ilość &quot;%1$s&quot; dozwolona w koszyku wynosi %2$s','The minimum quantity that can be added to the cart.'=>'Minimalna ilość, którą można dodać do koszyka.','The minimum severity level of logs that will be stored.'=>'Minimalny poziom ważności logów, które będą przechowywane.','The minimum spend for coupon "%1$s" is %2$s.'=>'Minimalna kwota wydatków dla kuponu "%1$s" wynosi %2$s.','The minimum value of the field is %d'=>'Minimalna wartość pola wynosi %d','The name cannot begin with the underscore (_) character.'=>'Nazwa nie może zaczynać się od znaku podkreślenia (_).','The name is required.'=>'Nazwa jest wymagana.','The name must be unique.'=>'Nazwa musi być unikalna.','The name of the current active theme.'=>'Nazwa aktualnie włączonego motywu.','The name of the marketing channel that this campaign type belongs to.'=>'Nazwa kanału marketingowego, do którego należy ten rodzaj kampanii.','The name of the parent theme.'=>'Nazwa motywu nadrzędnego.','The name of the tax.'=>'Nazwa podatku.','The name of your physical store.'=>'Nazwa Twojego sklepu stacjonarnego.','The next queue will begin processing in approximately %d seconds.'=>'Następna kolejka rozpocznie przetwarzanie za około %d sekund.','The number of days log entries are retained.'=>'Liczba dni, przez które logi są przechowywane.','The number of decimal points shown in displayed prices.'=>'Liczba punktów dziesiętnych w wyświetlanych cenach.','The number of search results has reached the limit of %s. Try refining your search.'=>'Liczba wyników wyszukiwania osiągnęła limit %s. Spróbuj uściślić swoje wyszukiwanie.','The number of unique pages viewed by the customer prior to this order.'=>'Liczba unikatowych stron wyświetlonych przez klienta przed tym zamówieniem.','The object cannot be deleted.'=>'Tego obiektu nie można usunąć.','The object does not support trashing. Set \'%s\' to delete.'=>'Obiekt nie obsługuje przenoszenia do kosza. Ustaw \'%s\' na usunięcie.','The object has already been trashed.'=>'Obiekt został już dodany do kosza.','The official Razorpay extension for WooCommerce allows you to accept credit cards, debit cards, netbanking, wallet, and UPI payments.'=>'Oficjalne rozszerzenie Razorpay dla WooCommerce pozwala akceptować karty kredytowe i debetowe, netbanking, portfele oraz płatności UPI.','The onboarding preload link for the payment gateway.'=>'Wstępny odnośnik do wdrożenia bramki płatności.','The onboarding step ID is invalid: %s'=>'Identyfikator etapu wdrożenia jest nieprawidłowy: %s','The onboarding step is missing required entries: %s'=>'W kroku rejestracji (wdrożenia) brakuje wymaganych wpisów: %s','The onboarding steps.'=>'Etapy wdrażania.','The options are &quot;Active&quot; (delivers payload), &quot;Paused&quot; (does not deliver), or &quot;Disabled&quot; (does not deliver due delivery failures).'=>'Dostępne opcje: &quot;Aktywny&quot; (dostarcza), &quot;Wstrzymany&quot; (nie dostarcza) lub &quot;Wyłączony&quot; (nie dostarcza z powodu awarii).','The Order Confirmation template serves as a receipt and confirmation of a successful purchase. It includes a summary of the ordered items, shipping, billing, and totals.'=>'Szablon potwierdzenia zamówienia służy jako pokwitowanie i potwierdzenie udanego zakupu. Zawiera podsumowanie zamówionych pozycji, wysyłki, rozliczenia i sumy.','The order details screen is easy to use.'=>'Ekran szczegółów zamówienia jest łatwy w użyciu.','The order details screen\'s functionality meets my needs'=>'Funkcjonalność ekranu szczegółów zamówienia spełnia moje potrzeby','The order details screen\'s functionality meets my needs.'=>'Funkcjonalność ekranu szczegółów zamówienia spełnia moje oczekiwania.','The order editing screen is easy to use'=>'Ekran edycji zamówienia jest łatwy w użyciu','The order has been received, but no payment has been made. Pending payment orders are generally awaiting customer action.'=>'Zamówienie zostało odebrane, ale nie dokonano płatności. Zamówienia oczekujące na płatność zazwyczaj oczekują na działanie klienta.','The order ID is required.'=>'Identyfikator zamówienia jest wymagany.','The order ID that notes belong to.'=>'Identyfikator zamówienia, do którego należą notatki.','The order ID to process during checkout.'=>'Identyfikator zamówienia do przetworzenia podczas zamówienia.','The order ID.'=>'Identyfikator zamówienia.','The order is awaiting payment confirmation. Stock is reduced, but you need to confirm payment.'=>'Zamówienie oczekuje na potwierdzenie płatności. Zapasy zostały zmniejszone, ale musisz potwierdzić płatność.','The order totals have been updated. Please confirm your order by pressing the "Place order" button at the bottom of the page.'=>'Zamówienie zostało zaktualizowane. Potwierdź zamówienie klikając w przycisk "Kupuję i płacę" na dole strony.','The order value must be an integer.'=>'Wartość zamówienia musi być liczbą całkowitą.','The order was canceled by an admin or the customer.'=>'Zamówienie zostało anulowane przez administratora lub klienta.','The ordered offline payment methods providers list.'=>'Lista dostawców zamówionych metod płatności offline.','The ordered providers list. This includes registered payment gateways, suggestions, and offline payment methods group entry. The individual offline payment methods are separate.'=>'Lista zamówionych dostawców. Obejmuje ona zarejestrowane bramki płatności, sugestie i wpis grupy metod płatności offline. Poszczególne metody płatności offline są oddzielne.','The ordering argument must be an object with provider IDs as keys and numeric values as values.'=>'Argument zamawiania musi być obiektem z identyfikatorami dostawców jako kluczami i wartościami numerycznymi jako wartościami.','The ordering argument must be an object.'=>'Argument zamawiania musi być obiektem.','The organic coffee beans are a revelation. Each sip feels like a journey. Beautifully crafted accessories add a touch of elegance to my home.'=>'Organiczne ziarna kawy to rewelacja. Każdy łyk jest jak podróż. Pięknie wykonane akcesoria dodają elegancji mojemu domowi.','The parent theme developers URL.'=>'Adres URL autorów motywu nadrzędnego.','The Payfast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa\'s most popular payment gateways. No setup fees or monthly subscription costs. Selecting this extension will configure your store to use South African rands as the selected currency.'=>'Rozszerzenie Payfast dla WooCommerce umożliwia przyjmowanie płatności kartą kredytową i EFT za pośrednictwem jednej z najpopularniejszych bramek płatniczych w RPA. Nie ponosisz żadnych opłat instalacyjnych ani miesięcznych kosztów subskrypcji. Wybranie tego rozszerzenia skonfiguruje twój sklep do używania randa południowoafrykańskiego jako wybranej waluty.','The PayFast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa’s most popular payment gateways. No setup fees or monthly subscription costs.'=>'Rozszerzenie PayFast dla WooCommerce pozwala przyjmować płatności kartą płatniczą oraz EFT za pomocą jednej z najbardziej popularnych w Afryce Południowej bramek płatności. Bez opłaty aktywacyjnej oraz miesięcznych opłat za subskrypcję.','The Payfast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa’s most popular payment gateways. No setup fees or monthly subscription costs. Selecting this extension will configure your store to use South African rands as the selected currency.'=>'Rozszerzenie Payfast dla WooCommerce umożliwia przyjmowanie płatności kartą kredytową i EFT za pośrednictwem jednej z najpopularniejszych bramek płatniczych w RPA. Brak opłat aktywacyjnych czy miesięcznych kosztów subskrypcji. Wybranie tego rozszerzenia ustawi w twoim sklepie randów południowoafrykańskich jako wybraną walutę.','The payment gateway for this order does not exist.'=>'Bramka płatności użyta w tym zamówieniu nie istnieje.','The payment gateway for this order does not support automatic refunds.'=>'Bramka płatności użyta w tym zamówieniu nie umożliwia automatycznych zwrotów.','The ping response message.'=>'Komunikat odpowiedzi ping.','The plugin could not be activated.'=>'Nie można włączyć wtyczki.','The plugin for your subscription couldn\'t be activated.'=>'Nie udało się włączyć wtyczki dla twojej subskrypcji.','The plugin for your subscription has been activated.'=>'Wtyczka dla twojej subskrypcji została włączona.','The plugin main file. This is a relative path to the plugins directory.'=>'Główny plik wtyczki. Jest to względna ścieżka do katalogu wtyczek.','The position of the currency symbol.'=>'Pozycja symbolu waluty.','The post ID of the generated email post.'=>'Identyfikator wygenerowanej wiadomości e-mail.','The postal code, if any, in which your business is located.'=>'Kod pocztowy siedziby twojej firmy.','The previous status of order %1$d ("%2$s") is invalid. It could not be restored.'=>'Poprzedni status zamówienia %1$d ("%2$s") jest nieprawidłowy. Nie można było go przywrócić.','The previous status of order %1$d ("%2$s") is invalid. It has been restored to "pending" status instead.'=>'Poprzedni status zamówienia %1$d ("%2$s") jest nieprawidłowy. Zamiast tego przywrócono je do statusu "oczekujące".','The priority of the category.'=>'Priorytet kategorii.','The priority of the suggestion.'=>'Priorytet sugestii.','The product category details screen is easy to use.'=>'Ekran szczegółów kategorii produktu jest łatwy w użyciu.','The product category details screen\'s functionality meets my needs.'=>'Funkcjonalność ekranu szczegółów kategorii produktu spełnia moje oczekiwania.','The product creation screen is easy to use'=>'Ekran tworzenia produktu jest łatwy w użyciu','The product creation screen is easy to use.'=>'Ekran tworzenia produktu jest łatwy w użyciu.','The product creation screen\'s functionality meets my needs'=>'Funkcjonalność ekranu tworzenia produktu spełnia moje potrzeby','The product creation screen\'s functionality meets my needs.'=>'Funkcjonalność ekranu tworzenia produktu spełnia moje oczekiwania.','The Product Details block requires a product context. When used in a Query Loop, the Query Loop must be configured to display products.'=>'Blok Szczegóły produktu wymaga kontekstu produktu. W przypadku użycia w pętli zapytań, pętla zapytań musi być skonfigurowana do wyświetlania produktów.','The product editing screen is easy to use'=>'Ekran edycji produktu jest łatwy w użyciu','The product editing screen\'s functionality meets my needs'=>'Funkcjonalność ekranu edycji produktu spełnia moje potrzeby','The product import process is easy to complete.'=>'Proces importowania produktów jest łatwy do wykonania.','The product import process meets my needs.'=>'Proces importu produktów spełnia moje oczekiwania.','The product import screen is easy to use'=>'Ekran importu produktów jest łatwy w użyciu','The product import screen\'s functionality meets my needs'=>'Funkcjonalność ekranu importu produktów spełnia moje potrzeby','The product key is invalid. Please contact support for assistance.'=>'Klucz produktu jest nieprawidłowy. Prosimy o kontakt z pomocą techniczną w celu uzyskania pomocy.','The product review cannot be deleted.'=>'Opinie o produkcie nie może zostać usunięta.','The product review does not support trashing.'=>'Opinii o produkcie nie można przenieść do kosza.','The product tag details screen is easy to use.'=>'Ekran szczegółów tagu produktu jest łatwy w użyciu.','The product tag details screen\'s functionality meets my needs.'=>'Funkcjonalność ekranu szczegółów tagu produktu spełnia moje oczekiwania.','The product update process is easy to complete.'=>'Proces aktualizowania produktu jest łatwy do wykonania.','The product update process meets my needs.'=>'Proces aktualizowania produktów spełnia moje oczekiwania.','The product with SKU (%1$s) you are trying to insert is already present in the lookup table'=>'Produkt o jednostce SKU (%1$s), który próbujesz wstawić, jest już obecny w tabeli wyszukiwania','The provided checkout link was out of date or invalid. No products were added to the cart.'=>'Podany odnośnik do kasy był nieaktualny lub nieprawidłowy. Do koszyka nie dodano żadnych produktów.','The provided email address (%s) is not valid—please provide a valid email address'=>'Podany adres e-mail (%s) jest nieprawidłowy - proszę podać prawidłowy adres e-mail','The provided email address is not valid'=>'Podany adres e-mail jest nieprawidłowy','The provided handler %1$s does not implement %2$s.'=>'Podana metoda %1$s nie zawiera %2$s.','The provided phone number is not valid'=>'Podany numer telefonu jest nieprawidłowy','The provided postcode / ZIP is not valid'=>'Podany kod pocztowy jest nieprawidłowy','The provided state (%1$s) is not valid. Must be one of: %2$s'=>'Podany stan (%1$s) jest nieprawidłowy. Musi być jednym z: %2$s','The provider could not be enabled. Check the Manage page for details.'=>'Nie można włączyć dostawcy. Sprawdź stronę Zarządzaj, aby uzyskać szczegółowe informacje.','The provider ID must be a string with only ASCII letters, digits, underscores, and dashes.'=>'Identyfikator dostawcy musi być ciągiem znaków zawierającym wyłącznie litery ASCII, cyfry, podkreślenia i myślniki.','The provider plugin was successfully deactivated.'=>'Wtyczka dostawcy została pomyślnie dezaktywowana.','The quantity of "%1$s" was changed to %2$s.'=>'Ilość "%1$s" została zmieniona na %2$s.','The quantity of &quot;%1$s&quot; cannot be changed'=>'Ilość &quot;%1$s&quot; nie może zostać zmieniona','The quantity of &quot;%1$s&quot; must be a multiple of %2$s'=>'Ilość &quot;%1$s&quot; musi być wielokrotnością %2$s','The rate at which tax is applied.'=>'Stawka, wg której obliczany jest podatek.','The relative path of the step to use for frontend navigation.'=>'Względna ścieżka kroku używana do nawigacji w interfejsie użytkownika.','The requested plugin `%s` could not be activated.'=>'Nie można włączyć wtyczki `%s`.','The requested plugin `%s` could not be installed.'=>'Nie można zainstalować żądanej wtyczki `%s`.','The requested plugin `%s` could not be installed. Plugin API call failed.'=>'Nie można zainstalować żądanej wtyczki `%s`. Nieudane wywołanie API.','The requested plugin `%s` could not be installed. Upgrader install failed.'=>'Żądana wtyczka `%s` nie mogła być zainstalowana. Instalacja uaktualnienia nie powiodła się.','The requested plugin `%s`. is not yet installed.'=>'Żądana wtyczka `%s`. nie jest jeszcze zainstalowana.','The requested theme `%s` could not be installed.'=>'Nie można zainstalować żądanego motywu `%s`.','The requested theme `%s` could not be installed. Theme API call failed.'=>'Nie można zainstalować żądanego motywu `%s`. Nieudane wywołanie API.','The requested theme could not be activated.'=>'Nie można włączyć żądanego motywu.','The resource cannot be deleted.'=>'Zasób nie może zostać usunięty.','The response body from the receiving server.'=>'Treść odpowiedzi serwera odbiorczego.','The response is not a valid JSON response.'=>'Odpowiedź nie jest prawidłową odpowiedzią JSON.','The response message.'=>'Wiadomość zwrotna.','The Retro Glass Jug\'s classic silhouette effortlessly complements any setting, making it the ideal choice for serving beverages with style and flair.'=>'Klasyczna sylwetka szklanego dzbanka Retro bez trudu uzupełni każdą aranżację, dzięki czemu jest idealnym wyborem do serwowania napojów ze stylem i polotem.','The root URL of your site.'=>'Bazowy adres URL witryny.','The sale will start at 00:00:00 of "From" date and end at 23:59:59 of "To" date.'=>'Promocja rozpocznie się o godzinie 00:00:00 w dniu "Od" i zakończy o godzinie 23:59:59 w dniu "Do".','The search feature in WooCommerce is easy to use.'=>'Funkcja wyszukiwania w WooCommerce jest łatwa w użyciu.','The search\'s functionality meets my needs.'=>'Funkcjonalność wyszukiwania spełnia moje oczekiwania.','The secret key is used to generate a hash of the delivered webhook and provided in the request headers.'=>'Klucz prywatny jest używany do generowania hash dostarczonego webhooka i znajduje się w nagłówku żądania.','The selected product is invalid.'=>'Wybrany produkt jest nieprawidłowy.','The selected product isn\'t a variation of %2$s, please choose product options by visiting <a href="%1$s" title="%2$s">%2$s</a>.'=>'Wybrany produkt nie jest wariantem %2$s. Proszę wybrać opcje produktu przechodząc na stronę <a href="%1$s" title="%2$s">%2$s</a>.','The settings of this image size have been disabled because its values are being overwritten by a filter.'=>'Ustawienia rozmiaru tej grafiki zostały wyłączone ponieważ wartości zostały nadpisane przez filter.','The settings screen is easy to use'=>'Ekran ustawień jest łatwy w użyciu','The settings screen is easy to use.'=>'Ekran ustawień jest łatwy w użyciu.','The settings screen\'s functionality meets my needs'=>'Funkcjonalność ekranu ustawień spełnia moje potrzeby','The settings screen\'s functionality meets my needs.'=>'Funkcjonalność ekranu ustawień spełnia moje oczekiwania.','The shipping class name is required.'=>'Nazwa klasy wysyłki jest wymagana.','The shipping provider.'=>'Dostawca usług wysyłkowych.','The short description of the incentive. It can contain stylistic HTML.'=>'Krótki opis zachęty. Może zawierać stylistyczny HTML.','The size of the log directory.'=>'Rozmiar katalogu dziennika.','The slug for the resource.'=>'Uproszczona nazwa zasobu.','The slug of the containing entity.'=>'Uproszczona nazwa jednostki zawierającej.','The slug of the plugin.'=>'Uproszczona nazwa wtyczki.','The sort order of the payment method.'=>'Kolejność sortowania metody płatności.','The sort order of the provider.'=>'Kolejność sortowania dostawcy.','The specific chart this stat referrers to.'=>'Konkretny wykres do którego odnoszą się te dane.','The specified category for recommendations is invalid. Allowed values: "channels", "extensions".'=>'Określona kategoria rekomendacji jest nieprawidłowa. Dozwolone wartości: "kanały", "rozszerzenia".','The start date of the sale must be before the end date.'=>'Data rozpoczęcia sprzedaży musi być wcześniejsza niż data zakończenia.','The start/continue onboarding link for the payment gateway.'=>'Łącze rozpoczęcia/kontynuowania procesu wdrażania dla bramki płatności.','The state of the onboarding process.'=>'Stan procesu wdrażania.','The status of the containing entity.'=>'Status podmiotu zawierającego.','The status of the coupon. Should always be draft, published, or pending review'=>'Status kuponu. Zawsze powinien być: szkic, opublikowany lub oczekuje na przegląd','The status of the fulfillment.'=>'Status realizacji.','The status of the note (e.g. unactioned, actioned).'=>'Status notatki (np. bez akcji, z akcją).','The status of the plugin.'=>'Status wtyczki.','The step definition to import'=>'Definicja kroku do zaimportowania','The steps that are required to be completed before this step.'=>'Kroki, które należy wykonać przed tym krokiem.','The stock has not been updated because the value has changed since editing. Product %1$d has %2$d units in stock.'=>'Stan magazynowy nie został zaktualizowany, ponieważ stan się zmienił. Stan magazynowy produktu %1$d to %2$d.','The Store Designer will create a new store design for you, and you\'ll lose any changes you\'ve made to your active theme. If you\'d prefer to continue editing your theme, you can do so via the <EditorLink>Editor</EditorLink>.'=>'Kreator sklepów utworzy nowy projekt sklepu, a wszelkie zmiany wprowadzone w aktywnym szablonie zostaną utracone. Jeśli wolisz kontynuować edycję szablonu, możesz to zrobić za pomocą <EditorLink>Editor</EditorLink>.','The store setup is easy to complete.'=>'Konfiguracja sklepu jest łatwa do przeprowadzenia.','The store setup process meets my needs.'=>'Proces konfiguracji sklepu spełnia moje potrzeby.','The street address for your business location.'=>'Adres siedziby twojej firmy.','The suggestion categories.'=>'Kategorie sugestii.','The suggestion ID matching this provider.'=>'Identyfikator sugestii pasujący do tego dostawcy.','The tags associated with the provider.'=>'Tagi powiązane z dostawcą.','The tags associated with the suggestion.'=>'Znaczniki powiązane z sugestią.','The term ID, or 0 if the attribute is not a global attribute.'=>'Identyfikator taksonomii lub 0, gdy atrybut nie jest globalny.','The term name.'=>'Nazwa taksonomii.','The term slug.'=>'Uproszczona nazwa taksonomii.','The test account creation is taking a bit longer than expected, but don\'t worry — we\'re on it! Please bear with us for a few seconds more as we set everything up for your store.'=>'Tworzenie konta testowego trwa nieco dłużej niż oczekiwano, ale nie martw się - pracujemy nad tym! Wytrzymaj z nami jeszcze kilka sekund, ponieważ konfigurujemy wszystko dla Twojego sklepu.','The theme developers URL.'=>'Adres URL twórców motywu.','The theme you are currently using is not compatible.'=>'Motyw, którego obecnie używasz, nie jest zgodny.','The thousand separator of displayed prices.'=>'Separator tysięcy w wyświetlanych cen.','The title of the category.'=>'Tytuł kategorii.','The title of the payment method. Does not include HTML tags.'=>'Tytuł metody płatności. Nie zawiera znaczników HTML.','The title of the provider.'=>'Tytuł dostawcy.','The title of the suggestion.'=>'Tytuł sugestii.','The total size of the files in the log directory.'=>'Całkowity rozmiar plików w katalogu dziennika zdarzeń.','The tracking number details response.'=>'Odpowiedź zawierająca szczegóły numeru śledzenia.','The tracking number to look up.'=>'Numer śledzenia do wyszukania.','The tracking number.'=>'Numer śledzenia.','The tracking URL.'=>'Adres URL śledzenia.','The type of entity for which the fulfillment is created.'=>'Rodzaj podmiotu, dla którego tworzona jest realizacja.','The type of entity for which the fulfillment is created. Must be "order".'=>'Typ podmiotu, dla którego tworzona jest realizacja. Musi to być "zamówienie".','The type of onboarding process the provider supports.'=>'Rodzaj procesu wdrażania obsługiwanego przez dostawcę.','The type of payment provider. Use this to differentiate between the various items in the list and determine their intended use.'=>'Rodzaj dostawcy płatności. Użyj tego, aby rozróżnić różne pozycje na liście i określić ich przeznaczenie.','The type of the containing entity. Generally this is a regular plugin but it can also be a non-standard entity like a theme or a must-user plugin.'=>'Rodzaj jednostki zawierającej. Zwykle jest to zwykła wtyczka, ale może to być również niestandardowa jednostka, taka jak motyw lub wtyczka obowiązkowa dla użytkownika.','The type of the link.'=>'Rodzaj odnośnika.','The type of the note (e.g. error, warning, etc.).'=>'Typ notatki (np. błąd, ostrzeżenie itp.).','The type of the plugin.'=>'Rodzaj wtyczki.','The type of the suggestion.'=>'Rodzaj sugestii.','The type returned by checkout filters must be the same as the type they receive. The function received %1$s but returned %2$s.'=>'Typ zwracany przez filtry kasowe musi być taki sam jak typ, który otrzymują. Funkcja otrzymała %1$s, ale zwróciła %2$s.','The unique identifier for the category.'=>'Unikatowy identyfikator kategorii.','The unique identifier for the marketing campaign type.'=>'Unikatowy identyfikator rodzaju kampanii marketingowej.','The unique identifier for the marketing campaign.'=>'Unikatowy identyfikator kampanii marketingowej.','The unique identifier for the marketing channel that this campaign belongs to.'=>'Unikatowy identyfikator kanału marketingowego, do którego należy ta kampania.','The unique identifier for the meta data. Set `0` for new records.'=>'Unikalny identyfikator dla metadanych. Ustaw `0` dla nowych rekordów.','The unique identifier for the payment method.'=>'Unikatowy identyfikator metody płatności.','The unique identifier for the provider.'=>'Unikatowy identyfikator dostawcy.','The unique identifier for the step.'=>'Unikatowy identyfikator kroku.','The unique identifier for the suggestion.'=>'Unikatowy identyfikator sugestii.','The unique identifier of the marketing channel that this campaign type belongs to.'=>'Unikatowy identyfikator kanału marketingowego, do którego należy ten rodzaj kampanii.','The unit lengths are defined in for this country.'=>'Jednostki długości zdefiniowane dla tego kraju.','The unit weights are defined in for this country.'=>'Jednostki wagi zdefiniowane dla tego kraju.','The upmost entry point from where the merchant entered the onboarding flow.'=>'Najwyższy punkt wejścia, z którego sprzedawca wszedł do przepływu procesu wdrożenia (onboardingu).','The URL is required'=>'Adres URL jest wymagany','The URL of the icon (square aspect ratio).'=>'Adres URL ikonki (kwadratowy współczynnik proporcji).','The URL of the image.'=>'Adres URL obrazka.','The URL of the link.'=>'Adres URL odnośnika.','The URL of the payment method icon or a base64-encoded SVG image.'=>'Adres URL ikonki metody płatności lub obrazek SVG zakodowany w base64.','The URL of the provider icon (square aspect ratio - 72px by 72px).'=>'Adres URL ikonki dostawcy (kwadratowe proporcje - 72px na 72px).','The URL of the provider image.'=>'Adres URL obrazka dostawcy.','The URL of your %s page (along with the Page ID).'=>'Adres URL strony %s (wraz z identyfikatorem strony)','The URL to attach the suggestion.'=>'Adres URL do załączenia sugestii.','The URL to dismiss the incentive.'=>'Adres URL do odrzucenia zachęty.','The URL to do onboarding preload for the payment gateway.'=>'Adres URL do wstępnego załadowania procesu wdrażania dla bramki płatności.','The URL to hide the suggestion.'=>'Adres URL do ukrycia sugestii.','The URL to POST to disable the test account for the payment gateway.'=>'Adres URL do POST, aby wyłączyć konto testowe dla bramki płatności.','The URL to POST to for resetting the provider onboarding.'=>'Adres URL do POST w celu zresetowania wdrażania (onboardingu) dostawcy.','The URL to start/continue onboarding for the payment gateway.'=>'Adres URL do rozpoczęcia/kontynuowania procesu wdrażania dla bramki płatności.','The URL to the settings page for the payment gateway.'=>'Adres URL strony ustawień bramki płatności.','The URL to the terms and conditions for the incentive.'=>'Adres URL do zasad i warunków zachęty.','The URL to use for the action.'=>'Adres URL do użycia dla akcji.','The URL where the webhook payload is delivered.'=>'Adres URL do którego podpina się webhook.','The URL where the webhook was delivered.'=>'Adres URL gdzie webhook został dostarczony.','The user associated with this API key no longer exists.'=>'Użytkownik powiązany z tym kluczem API już nie istnieje.','The value is required.'=>'Wartość jest wymagana.','The value of the meta data.'=>'Wartość metadanych.','The value type for the JSON partial matching is not supported. Must be either integer, boolean, double or string. %s type provided.'=>'Typ wartości dla częściowego dopasowania JSON nie jest obsługiwany. Musi być liczbą całkowitą, wartością logiczną, wartością podwójną lub ciągiem znaków. Podano typ %s.','The version of cURL installed on your server.'=>'Wersja cURL zainstalowana na twoim serwerze.','The version of MySQL installed on your hosting server.'=>'Wersja MySQL zainstalowana na serwerze.','The version of PHP installed on your hosting server.'=>'Wersja PHP używana na serwerze.','The version of the Gutenberg plugin installed causes a crash in the full editor. To prevent this, the full editor has been disabled.'=>'Zainstalowana wersja wtyczki Gutenberg powoduje awarię pełnego edytora. Aby temu zapobiec, pełny edytor został wyłączony.','The version of the Gutenberg plugin installed causes a crash in the full editor. You are proceeding at your own risk and may experience crashes.'=>'Zainstalowana wersja wtyczki Gutenberg powoduje awarię pełnego edytora. Korzystasz z niej na własne ryzyko i mogą wystąpić awarie.','The version of WooCommerce installed on your site.'=>'Wersja WordPressa zainstalowana w twojej witrynie.','The version of WordPress installed on your site.'=>'Wersja WordPressa zainstalowana w twojej witrynie.','The Woo team is made up of over 350 talented individuals, distributed across 30+ countries.'=>'Zespół Woo składa się z ponad 350 utalentowanych osób, rozmieszczonych w ponad 30 krajach.','The WooCommerce Helper plugin is no longer needed. <a href="%s">Manage subscriptions</a> from the extensions tab instead.'=>'Wtyczka WooCommerce Helper nie jest już potrzebna. <a href="%s">Zarządzaj subskrypcjami</a> z poziomu zakładki rozszerzeń.','The WooCommerce Legacy REST API plugin running on this site.'=>'Wtyczka przestarzałego REST API WooCommerce uruchomiona w tej witrynie.','The WooCommerce Marketplace'=>'WooCommerce Marketplace','The WooCommerce Mobile App is available on iOS and Android'=>'Aplikacja mobilna WooCommerce jest dostępna na iOS i Androida','The WooCommerce REST API allows external apps to view and manage store data. Access is granted only to those with valid API keys.'=>'REST API WooCommerce pozwala zewnętrznym aplikacjom przeglądać i zarządzać danymi sklepu. Dostęp jest możliwy tylko przy użyciu ważnych kluczy API.','The world’s favorite buy now, pay later options and many more are right at your fingertips with WooPayments — all from one dashboard, without needing multiple extensions and logins.'=>'Ulubione na świecie opcje kup teraz, zapłać później i wiele innych są na wyciągnięcie ręki dzięki WooPayments - wszystko z jednego kokpitu bez konieczności korzystania z wielu rozszerzeń i loginów.','The “slug” is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.'=>'"Slug" to przyjazna dla adresów URL wersja nazwy. Zazwyczaj jest ona pisana małymi literami i zawiera tylko litery, cyfry i myślniki.','Theme'=>'Motyw','theme'=>'temat','Theme author URL.'=>'Adres URL autora motywu.','Theme installation message.'=>'Komunikat instalacyjny motywu.','Theme installation status.'=>'Status instalacji motywu.','Theme name.'=>'Nazwa motywu.','Theme slug.'=>'Uproszczona nazwa motywu.','Theme status.'=>'Status motywu.','Theme type'=>'Rodzaj motywu','Theme version.'=>'Wersja motywu.','Theme.'=>'Motyw.','Themes'=>'Motywy','themes'=>'tematy','Themes for every industry'=>'Motywy dla każdej branży','There are currently no logs to view.'=>'Brak logów do wyświetlenia.','There are currently no products available to display.'=>'Obecnie nie ma dostępnych produktów do wyświetlenia.','There are environment or store setup issues which are blocking progress. Please resolve them to proceed.'=>'Istnieją problemy ze środowiskiem lub konfiguracją sklepu, które blokują postęp. Rozwiąż je, aby kontynuować.','There are no currencies matching these parameters.'=>'Nie ma walut odpowiadających tym parametrom.','There are no locations matching these parameters.'=>'Nie ma lokalizacji odpowiadających tym parametrom.','There are no notes yet.'=>'Nie ma jeszcze żadnej notatki.','There are no orders to sync, aborting.'=>'Nie ma zamówień do zsynchronizowania, przerywanie.','There are no orders to verify, aborting.'=>'Nie ma zamówień do zweryfikowania, przerywanie.','There are no payment methods available. Please contact us for help placing your order.'=>'Nie są dostępne żadne metody płatności. Prosimy o kontakt w celu uzyskania pomocy przy składaniu zamówienia.','There are no product reviews yet.'=>'Na razie nie ma opinii o produktach.','There are no products associated with %s.'=>'Nie ma produktów powiązanych z %s.','There are no products with the selected attributes.'=>'Nie ma produktów z wybranymi atrybutami.','There are no reviews yet.'=>'Na razie nie ma opinii o produkcie.','There are no shipping options available. Please ensure that your address has been entered correctly, or contact us if you need any help.'=>'Brak dostępnych metod wysyłki. Sprawdź swój adres lub skontaktuj się z nami, jeżeli potrzebujesz pomocy.','There are not enough %s in stock. Please reduce the quantities in your cart.'=>'W magazynie nie ma wystarczającej liczby sztuk %s. Proszę zmniejszyć ich liczby w koszyku.','There are orders pending sync.'=>'Istnieją zamówienia oczekujące na synchronizację.','There are some issues with the items in your cart. Please go back to the cart page and resolve these issues before checking out.'=>'Wystąpiły problemy w Twoim koszyku. Przejdź do koszyka i rozwiąż problemy przed złożeniem zamówienia.','There are too many %s in the cart. Only 1 can be purchased. Please reduce the quantity in your cart.'=>'W koszyku znajduje się zbyt dużo %s. Można zakupić tylko jedną sztukę. Proszę zmniejszyć jego liczbę w koszyku.','There are too many %s in the cart. Only 1 of each can be purchased. Please reduce the quantities in your cart.'=>'W koszyku znajduje się zbyt dużo %s. Można zakupić tylko po jednym z nich. Proszę zmniejszyć ich liczby w koszyku.','There are too many concurrent batches, but the run is forced to continue.'=>'Jest zbyt wiele równoległych partii, ale kontynuowanie zostało wymuszone.','There are too many concurrent batches.'=>'Jest zbyt wiele równoległych partii.','There is %1$d order to be synced.'=>'Jest %1$d zamówienie do zsynchronizowania.' . "\0" . 'Są %1$d zamówienia do zsynchronizowania.' . "\0" . 'Jest %1$d zamówień do zsynchronizowania.','There is %1$d order to be verified.'=>'Jest %1$d zamówienie do zweryfikowania.' . "\0" . 'Są %1$d zamówienia do zweryfikowania.' . "\0" . 'Jest %1$d zamówień do zweryfikowania.','There is a problem with your cart'=>'Wystąpił problem z koszykiem','There is no data to export for the given request.'=>'Brak danych do eksportu wybranego żądania.','There is not enough %s in stock. Please reduce the quantity in your cart.'=>'W magazynie nie ma wystarczającej liczby sztuk %s. Proszę zmniejszyć jego liczbę w koszyku.','There was a failure fetching this action'=>'Wystąpił błąd pobierania działania','There was a failure fetching this action: %s'=>'Wystąpił błąd pobierania tego działania: %s','There was a failure scheduling the next instance of this action: %s'=>'Wystąpił błąd podczas planowania następnego wykonania akcji: %s','There was a problem activating some of the requested plugins.'=>'Wystąpił błąd podczas włączania niektórych żądanych wtyczek.','There was a problem checking out. Please try again. If the problem persists, please get in touch with us so we can assist.'=>'Wystąpił problem ze sprawdzeniem. Spróbuj ponownie. Jeśli problem nadal występuje, skontaktuj się z nami, abyśmy mogli pomóc.','There was a problem deleting your previous data.'=>'Wystąpił problem z usunięciem poprzednich danych.','There was a problem exporting your %s Report. Please try again.'=>'Wystąpił problem z eksportem raportu %s. Spróbuj ponownie.','There was a problem installing some of the requested plugins.'=>'Pojawił się problem z zainstalowaniem niektórych potrzebnych wtyczek.','There was a problem marking the shipping tour as completed.'=>'Wystąpił problem z oznaczeniem trasy wysyłki jako zakończonej.','There was a problem rebuilding your report data.'=>'Wystąpił problem z odbudowaniem danych raportu.','There was a problem saving your payment settings'=>'Wystąpił problem z zapisaniem ustawień płatności','There was a problem saving your store location'=>'Wystąpił problem z zapisaniem lokalizacji sklepu','There was a problem setting up automated taxes. Please try again.'=>'Wystąpił problem z konfiguracją automatycznych podatków. Spróbuj ponownie.','There was a problem stopping your current import.'=>'Wystąpił problem z zatrzymaniem bieżącego importu.','There was a problem updating your settings.'=>'Wystąpił problem z aktualizacją ustawień.','There was a problem with the provided %s:'=>'Wystąpił problem w podanych danych (%s):','There was a problem with the provided billing address: %s'=>'Wystąpił problem z podanym adresem rozliczeniowym: %s','There was a problem with the provided shipping address: %s'=>'Wystąpił problem z podanym adresem wysyłki: %s','There was a problem with your payment option.'=>'Wystąpił problem z opcją płatności.','There was a problem with your shipping option.'=>'Wystąpił problem z opcją wysyłki.','There was an error activating this plugin.'=>'Wystąpił błąd podczas włączania tej wtyczki.','There was an error activating this theme.'=>'Wystąpił błąd podczas włączania tego motywu.','There was an error calling %1$s: %2$s'=>'Wystąpił błąd przy próbie połączenia %1$s: %2$s','There was an error calling %s'=>'Wystąpił błąd przy próbie połączenia %s','There was an error calling this tool. There is no callback present.'=>'Podczas wywołania tego narzędzia wystąpił błąd. Nie ma funkcji zwrotnej.','There was an error cancelling the %1$s: %2$s'=>'Wystąpił błąd anulowania %1$s: %2$s','There was an error communicating with the WooPayments plugin.'=>'Wystąpił błąd w komunikacji z wtyczką WooPayments.','There was an error connecting to Square.'=>'Wystąpił błąd w połączeniu ze Square.','There was an error connecting to WooCommerce.com. Please try again.'=>'Wystąpił błąd w połączeniu z WooCommerce.com. Spróbuj ponownie.','There was an error connecting to WooPayments. Please try again or connect later in store settings.'=>'Wystąpił błąd podczas łączenia z WooPayments. Spróbuj ponownie lub połącz się później w ustawieniach sklepu.','There was an error connecting your subscription. Please try again.'=>'Wystąpił błąd podczas łączenia twojej subskrypcji. Spróbuj ponownie.','There was an error creating the scheduled action: %s'=>'Wystąpił błąd podczas tworzenia zaplanowanej akcji: %s','There was an error deleting an action: %s'=>'Wystąpił błąd podczas usuwania akcji: %s','There was an error disconnecting your subscription. Please try again.'=>'Wystąpił błąd podczas rozłączania twojej subskrypcji. Spróbuj ponownie.','There was an error generating your API Key.'=>'Wystąpił błąd podczas generowania klucza API.','There was an error getting the install URL for this product.'=>'Wystąpił błąd podczas pobierania adresu URL instalacji dla tego produktu.','There was an error getting your inbox. Please try again.'=>'Wystąpił błąd podczas pobierania skrzynki odbiorczej. Spróbuj ponownie.','There was an error getting your low stock products.'=>'Wystąpił błąd podczas pobierania produktów o niskim stanie magazynowym.','There was an error getting your orders.'=>'Wystąpił błąd podczas pobierania zamówień.','There was an error getting your reviews.'=>'Wystąpił błąd podczas pobierania recenzji.','There was an error getting your stats. Please try again.'=>'Wystąpił błąd podczas pobierania statystyk. Spróbuj ponownie.','There was an error importing the sample products'=>'Wystąpił błąd podczas importowania przykładowych produktów','There was an error loading installed extensions.'=>'Wystąpił błąd podczas ładowania zainstalowanych rozszerzeń.','There was an error loading misc recommendations'=>'Wystąpił błąd podczas ładowania różnych zaleceń','There was an error loading recommended extensions.'=>'Wystąpił błąd podczas ładowania zalecanych rozszerzeń.','There was an error loading the content.'=>'Wystąpił błąd podczas ładowania zawartości.','There was an error loading the reviews.'=>'Wystąpił błąd podczas ładowania recenzji.','There was an error loading the WooCommerce.com Helper API.'=>'Wystąpił błąd podczas wczytywania interfejsu API WooCommerce.com.','There was an error processing your order. Please check for any charges in your payment method and review your <a href="%s">order history</a> before placing the order again.'=>'Wystąpił błąd podczas przetwarzania twojego zamówienia. Przed ponownym złożeniem zamówienia sprawdź, czy w twojej metodzie płatności nie ma żadnych opłat i przejrzyj <a href="%s">historię zamówień</a>.','There was an error registering the payment method with id \'%s\': '=>'Wystąpił błąd rejestracji metody płatności o identyfikatorze "%s":','There was an error rendering an email preview.'=>'Wystąpił błąd renderowania podglądu wiadomości e-mail.','There was an error rendering the email editor placeholder content.'=>'Wystąpił błąd renderowania treści zastępczej edytora wiadomości e-mail.','There was an error rendering the email preview.'=>'Wystąpił błąd renderowania podglądu wiadomości e-mail.','There was an error rendering the email preview. This doesn\'t affect actual email delivery. Please contact the extension author for assistance.'=>'Wystąpił błąd renderowania podglądu wiadomości e-mail. Nie ma to wpływu na rzeczywiste dostarczanie wiadomości e-mail. Skontaktuj się z autorem rozszerzenia, aby uzyskać pomoc.','There was an error running the action scheduler: %s'=>'Wystąpił błąd w zaplanowanej akcji: %s','There was an error saving your settings. Please try again.'=>'Wystąpił błąd podczas zapisywania ustawień. Spróbuj ponownie.','There was an error trying to activate the extension.'=>'Wystąpił błąd podczas próby aktywacji rozszerzenia.','There was an error trying to create the attribute term "%s".'=>'Wystąpił błąd podczas próby utworzenia atrybutu "%s".','There was an error whilst rendering the cart block. If this problem continues, try re-creating the block.'=>'Wystąpił błąd podczas renderowania bloku koszyka. Jeśli problem będzie się powtarzał, spróbuj ponownie utworzyć blok.','There was an error with an item in your cart.'=>'Wystąpił błąd produktu w twoim koszyku.','There was an error with this payment method. Please verify it\'s configured correctly.'=>'Wystąpił błąd tej metody płatności. Sprawdź, czy jest poprawnie skonfigurowana.','There was an issue loading the report endpoints'=>'Wystąpił problem podczas wczytywania punktów końcowych raportu','There\'s %d webhook that is configured to be delivered using the Legacy REST API, which has been removed from WooCommerce. This webhook will fail to be sent.'=>'Istnieje %d webhook, który jest skonfigurowany do dostarczania za pomocą  starszego interfejsu API REST, który został usunięty z WooCommerce. Ten webhook nie zostanie wysłany.' . "\0" . 'Istnieje %d webhooków, które są skonfigurowane do dostarczania przy użyciu starszego interfejsu API REST, który został usunięty z WooCommerce. Te webhooki nie zostaną wysłane.' . "\0" . 'Istnieje %d webhooków, które są skonfigurowane do dostarczania przy użyciu starszego interfejsu API REST, który został usunięty z WooCommerce. Te webhooki nie zostaną wysłane.','There\'s <strongText /> with important fixes and brand new features.'=>'Jest <strongText /> z ważnymi poprawkami i zupełnie nowymi funkcjami.','These account details will be displayed within the order thank you page and confirmation email.'=>'Te dane zostaną wyświetlone na stronie z podziękowaniem za zamówienie oraz w e-mailu z potwierdzeniem.','These costs can optionally be added based on the <a href="%s">product shipping class</a>.'=>'Koszty te można opcjonalnie dodać w oparciu o <a href="%s">klasę wysyłkową produktu</a>.','These costs can optionally be added based on the <a target="_blank" href="%s">product shipping class</a>. Learn more about <a target="_blank" href="https://woocommerce.com/document/flat-rate-shipping/#shipping-classes">setting shipping class costs</a>.'=>'Koszty te można opcjonalnie dodać w oparciu o <a target="_blank" href="%s">klasę wysyłkową produktu</a>. Dowiedz się więcej o <a target="_blank" href="https://woocommerce.com/document/flat-rate-shipping/#shipping-classes">ustawianiu kosztów klasy wysyłkowych</a>.','These details are required to receive payments via bank transfer'=>'Te dane są wymagane do otrzymywania płatności przelewem bankowym','These features are either experimental or incomplete, enable them at your own risk!'=>'Te funkcje są eksperymentalne, bądź nie w pełni ukończone. Włączasz je na własne ryzyko!','These options let you change the appearance of the WooCommerce checkout.'=>'Te opcje pozwalają dostosować wygląd formularza zamówienia WooCommerce.','These pages need to be set so that WooCommerce knows where to send users to checkout.'=>'Te strony powinny zostać ustawione aby WooCommerce odpowiednio skierował użytkowników do strony płatności.','These products will vary depending on the main product in the page'=>'Produkty te będą się różnić w zależności od głównego produktu na stronie','These rates are extra shipping options with additional costs (based on the flat rate).'=>'Te stawki umożliwiają dodanie nowych sposobów wysyłki (oparte na płaskiej stawce).','These settings are not available while the lookup table regeneration is in progress.'=>'Te opcje nie są dostępne w trakcie procesu odnawiania tabeli.','Thessaly'=>'Tesalia','Things to do next'=>'Następne kroki','This action appears to be consistently failing. A new instance will not be scheduled.'=>'Wydaje się, że to działanie stale kończy się niepowodzeniem. Nowa instancja nie zostanie zaplanowana.','This action cannot be reversed. Are you sure you wish to erase personal data from the selected orders?'=>'Tej akcji nie można cofnąć. Czy na pewno chcesz usunąć dane osobowe z wybranych zamówień?','This block displays products from selected tags. Select at least one tag to display its products.'=>'Ten blok wyświetla produkty z wybranych tagów. Wybierz co najmniej jeden tag, aby wyświetlić jego produkty.','This block displays products from selected tags. To use it you first need to create products and assign tags to them.'=>'Ten blok wyświetla produkty z wybranych tagów. Aby z niego skorzystać, należy najpierw utworzyć produkty i przypisać do nich tagi.','This block displays the product categories for your store. To use it you first need to create a product and assign it to a category.'=>'Ten blok wyświetla kategorie produktów dla Twojego sklepu. Aby z niego skorzystać, należy najpierw utworzyć produkt i przypisać go do kategorii.','This block displays the product description. When viewing a product page, the description content will automatically appear here.'=>'Ten blok wyświetla opis produktu. Podczas przeglądania strony produktu treść opisu pojawi się tutaj automatycznie.','This block displays the product summary and all its customizations.'=>'Ten blok wyświetla podsumowanie produktu i wszystkie jego dostosowania.','This block displays the variation description. When the shopper selects a variation, the description content will automatically appear here.'=>'Ten blok wyświetla opis wariantu. Gdy kupujący wybierze wariant, treść opisu pojawi się tutaj automatycznie.','This block lists description, attributes and reviews for a single product.'=>'Ten blok zawiera opis, atrybuty i recenzje pojedynczego produktu.','This block lists reviews for a selected product. %s doesn\'t have any reviews yet, but they will show up here when it does.'=>'Ten blok wyświetla recenzje wybranego produktu. %s nie ma jeszcze żadnych recenzji, ale pojawią się one tutaj, gdy tylko się pojawią.','This block lists reviews for products from selected categories. The selected categories do not have any reviews yet, but they will show up here when they do.'=>'W tym bloku wyświetlane są recenzje produktów z wybranych kategorii. Wybrane kategorie nie mają jeszcze żadnych recenzji, ale pojawią się tutaj, gdy zostaną dodane.','This block represents the classic template used to display the order confirmation. The actual rendered template may appear different from this placeholder.'=>'Ten blok reprezentuje klasyczny szablon używany do wyświetlania potwierdzenia zamówienia. Rzeczywisty renderowany szablon może różnić się od tego symbolu zastępczego.','This block shows a list of all product reviews. Your store does not have any reviews yet, but they will show up here when it does.'=>'Ten blok pokazuje listę wszystkich recenzji produktów. Twój sklep nie ma jeszcze żadnych recenzji, ale pojawią się one tutaj, gdy zostaną dodane.','This block shows on-sale products. There are currently no discounted products in your store.'=>'W tym bloku wyświetlane są produkty objęte wyprzedażą. Obecnie w sklepie nie ma produktów objętych zniżką.','This block will render the classic cart shortcode. You can optionally transform it into blocks for more control over the cart experience.'=>'Ten blok renderuje klasyczny shortcode koszyka. Opcjonalnie można przekształcić go w bloki, aby uzyskać większą kontrolę nad koszykiem.','This block will render the classic checkout shortcode. You can optionally transform it into blocks for more control over the checkout experience.'=>'Ten blok wyrenderuje klasyczny shortcode kasy. Opcjonalnie można przekształcić go w bloki, aby uzyskać większą kontrolę nad procesem realizacji zakupu.','This content is password protected.'=>'Ta zawartość jest chroniona hasłem.','This controls how stock quantities are displayed on the frontend.'=>'Odpowiada ze sposób pokazywania stanów magazynowych w sklepie.','This controls the description which the user sees during checkout.'=>'Opis, który użytkownik widzi podczas składania zamówienia.','This controls the position of the currency symbol.'=>'Kontroluje położenie symbolu waluty.','This controls the title which the user sees during checkout.'=>'Tytuł, który widzi użytkownik podczas składania zamówienia.','This controls what currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'W jakiej walucie są wyswietlane ceny i która waluta będzie akceptowana w bramkach płatności.','This controls what unit you will define lengths in.'=>'Tutaj możesz ustawić jednostkę wymiarów.','This controls what unit you will define weights in.'=>'Tutaj możesz ustawić jednostkę wagi.','This controls which shipping address is used by default.'=>'Wybierz adres, który adres będzie domyślnie stosowany.','This coupon is password protected. WooCommerce does not support password protection for coupons. You can temporarily hide a coupon by making it private. Alternatively, usage limits and restrictions can be configured below.'=>'Ten kupon jest chroniony hasłem. WooCommerce nie obsługuje ochrony kuponów hasłem. Możesz tymczasowo ukryć kupon, ustawiając go jako prywatny. Alternatywnie, limity i ograniczenia użytkowania można skonfigurować poniżej.','This data will be deleted in %s.'=>'Te dane zostaną usunięte: %s.','This determines where log entries are saved.'=>'Określa gdzie logi są zapisywane.','This email address is already registered.'=>'Podany adres email jest już zarejestrowany.','This email is not valid.'=>'Ten e-mail jest nieprawidłowy.','This email is sent to Customer.'=>'Ta wiadomość e-mail jest wysyłana do klienta.','This feature is not available when using the <a href="%s">Cart and checkout blocks</a>. Shipping will be calculated at checkout.'=>'Ta funkcja nie jest dostępna podczas korzystania z <a href="%s">bloków koszyka i kasy</a>. Koszty wysyłki zostaną obliczone podczas realizacji transakcji.','This feature is only available with the Cart & Checkout blocks. %1$sLearn more%2$s.'=>'Ta funkcja jest dostępna tylko z blokami koszyk & zamówienie. %1$sDowiedz się więcej%2$s.','This field allows you to set the maximum spend (subtotal) allowed when using the coupon.'=>'To pole umożliwia ustawienie maksymalnej wartości zamówienia, aby użyć kupon.','This field allows you to set the minimum spend (subtotal) allowed to use the coupon.'=>'To pole umożliwia ustawienie minimalnej wartości zamówienia pozwalającej na użycie kuponu.','This field is required.'=>'To pole jest wymagane.','This field must be a positive number.'=>'To pole musi być liczbą dodatnią.','This file does not exist.'=>'Plik nie istnieje.','This file has already been added'=>'Ten plik został już dodany','This function should not be called before plugins_loaded.'=>'Funkcja ta nie powinna być wywoływana przed plugins_loaded.','This function should not be called before woocommerce_init.'=>'Funkcja nie powinna być wywołana przed woocommerce_init.','This info will be displayed on the product page, category pages, social media, and search results.'=>'Te informacje zostaną wyświetlone na stronie produktu, stronach kategorii, a także w mediach społecznościowych i wynikach wyszukiwania.','This info will help us speed up the set up process.'=>'Te informacje pomogą nam przyspieszyć proces konfiguracji.','This info will verify your account'=>'Informacje te pozwolą zweryfikować konto','This is a <ProductTemplate />.'=>'To jest <ProductTemplate />.','This is a customer note. Customers can add a note to their order on checkout.

It can be multiple lines. If there\'s no note, this section is hidden.'=>'To jest notatka klienta. Klienci mogą dodać notatkę do swojego zamówienia podczas realizacji transakcji.

Może zawierać wiele wierszy. Jeśli nie ma notatki, ta sekcja jest ukryta.','This is a demo store for testing purposes &mdash; no orders shall be fulfilled.'=>'Wersja demonstracyjna sklepu do celów testowych &mdash; zamówienia nie będą realizowane.','This is a featured product'=>'To jest wyróżniony produkt','This is an Official WooCommerce payment extension. <learnMoreLink />'=>'To jest oficjalne rozszerzenie płatności WooCommerce. <learnMoreLink />','This is an order notification sent to customers containing order details after an order is placed on-hold from Pending, Cancelled or Failed order status.'=>'To jest powiadomienie zawierające szczegóły zamówienia, wysyłane do klienta po zmianie statusu zamówienia ze statusów „Oczekujące na płatność”, „Anulowane” lub „Nieudane” na „Wstrzymane (oczekujące na płatność)”.','This is an order notification sent to customers containing order details after payment.'=>'To jest powiadomienie wysyłane do klienta po płatności, zawiera szczegóły zamówienia.','This is how your sender name and email address would appear in outgoing emails.'=>'W ten sposób nazwa nadawcy i adres e-mail będą wyświetlane w wychodzących wiadomościach e-mail.','This is how your sender name and email address would appear in outgoing WooCommerce emails.'=>'W ten sposób nazwa nadawcy i adres e-mail będą wyświetlane w wychodzących wiadomościach e-mail WooCommerce.','This is not your download link.'=>'To nie jest twój odnośnik pobierania.','This is the attachment ID, or image URL, used for placeholder images in the product catalog. Products with no image will use this.'=>'Jest to identyfikator załącznika lub adres URL obrazka, używany dla zastępczych obrazków w katalogu produktów. Produkty bez obrazków będą z tego korzystać.','This is the Content block.'=>'To jest blok Treść.','This is the Customer Lifetime Value, or the total amount you have earned from this customer\'s orders.'=>'To jest Customer Lifetime Value, czyli całkowita kwota, którą zarobiono na zamówieniach tego klienta.','This is the default category and it cannot be deleted. It will be automatically assigned to products with no category.'=>'To jest domyślna kategoria i nie można jej usunąć. Produkty bez wybranej kategorii zostaną do niej przypisane automatycznie.','This is the name of the download shown to the customer.'=>'Nazwa pobrania (pokazywana na stronie sklepu).','This is the shipping method title shown to customers.'=>'Jest to tytuł metody wysyłki wyświetlany klientom.','This is the sum of the "Tax rows" shipping tax amount within your orders.'=>'To jest suma kwoty podatku wysyłki w zamówieniach.','This is the sum of the "Tax rows" tax amount within your orders.'=>'To jest suma kwoty podatku w zamówieniach.','This is the sum of the \'Order total\' field within your orders.'=>'To jest suma pola \'Suma zamówienia\' twoich zamówień.','This is the sum of the \'Shipping total\' field within your orders.'=>'To jest suma pola \'Wysyłka\' twoich zamówień.','This is the sum of the order totals after any refunds and excluding shipping and taxes.'=>'To jest końcowa wartość zamówienia po uwzględnieniu zwrotów, bez uwzględnienia kosztów wysyłki i podatków.','This is the sum of the order totals after any refunds and including shipping and taxes.'=>'To jest suma wszystkich zamówień po uwzględnieniu zwrotów, kosztów dostawy i podatków.','This is the total tax for the rate (shipping tax + product tax).'=>'To jest całkowity koszt podatku dla stawki (podatek wysyłki + podatek produktu)','This is the URL or absolute path to the file which customers will get access to. URLs entered here should already be encoded.'=>'To jest adres URL lub ścieżka bezwzględna do pliku, do którego klienci otrzymają dostęp. Adresy URL wpisane tutaj powinny już być zakodowane.','This is the WooCommerce shop page. The shop page is a special archive that lists your products. <a href="%s">You can read more about this here</a>.'=>'To jest strona sklepu WooCommerce. Strona sklepu jest specjalnym archiwum, która wyświetla produkty. <a href="%s">Możesz przeczytać więcej na ten temat tutaj</a>.','This is where store orders are stored.'=>'Tutaj przechowywane są zamówienia.','This is where you can add new coupons that customers can use in your store.'=>'Tutaj możesz dodać nowe kupony, których klienci mogą używać w twoim sklepie.','This is where you can browse products in this store.'=>'Tutaj możesz przeglądać produkty w sklepie.','This is where you can set up product forms for various product types in your dashboard.'=>'W tym miejscu możesz skonfigurować formularze produktów dla różnych typów produktów na swoim kokpicie.','This is where your business is located. Tax rates and shipping rates will use this address.'=>'Lokalizacja siedziby twojej firmy. Ten adres będzie używany do obliczania podatków i wysyłki.','This item is locked and cannot be edited.'=>'Ten element jest zablokowany i nie można go edytować.','This item is not available for purchase.'=>'Ten przedmiot nie jest dostępny w sprzedaży.','This key is invalid or has already been used. Please reset your password again if needed.'=>'Klucz jest nieprawidłowy lub został już użyty. W razie potrzeby proszę zresetować hasło ponownie.','This lets you choose which products are part of this group.'=>'Możesz wybrać, które produkty będą częścią tej grupy.','This link will remain active for %s.'=>'Ten odnośnik pozostanie aktywny przez %s.','This may affect your ability to freely move the focal point of the image.'=>'Może to wpłynąć na możliwość swobodnego przesuwania punktu centralnego obrazu.','This means that the table is probably in an inconsistent state. It\'s recommended to run a new regeneration process or to resume the aborted process (Status - Tools - Regenerate the product attributes lookup table/Resume the product attributes lookup table regeneration) before enabling the table usage.'=>'Prawdopodobnie oznacza to, że tabela jest obecnie niespójna. Zalecamy uruchomienie nowego lub wznowienia wcześniej wstrzymanego odnawiania (Status - Narzędzia - Odnów tabelę do wyszukiwania atrybutów produktu/Wznów odnawianie tabeli do wyszukiwania atrybutów produktu) przed włączeniem użycia tabeli.','This method has been deprecated and will be removed soon. Use Automattic\\WooCommerce\\Utilities\\DiscountsUtil::is_coupon_emails_allowed instead.'=>'Ta metoda jest przestarzała i wkrótce zostanie usunięta. Zamiast niej użyj Automattic\\WooCommerce\\Utilities\\DiscountsUtil::is_coupon_emails_allowed.','This method is deprecated in 2.6.0 and will be removed in future versions - we recommend disabling it and instead setting up a new rate within your <a href="%s">Shipping zones</a>.'=>'Ta metoda jest przestarzała w 2.6.0 i zostanie usunięta w przyszłych wersjach - zalecamy jej wyłączenie i skonfigurowanie nowej metody w ramach <a href="%s">stref wysyłki</a>.','This method should not be called before plugins_loaded.'=>'Ta metoda nie powinna być używana przed plugins_loaded.','This month'=>'Bieżący miesiąc','This option determines a customers default location. The MaxMind GeoLite Database will be periodically downloaded to your wp-content directory if using geolocation.'=>'Ta opcja określa domyślną lokalizację klientów. Baza danych MaxMind GeoLite będzie okresowo pobierana do twojego katalogu wp-content jeśli używasz geolokalizacji.','This option determines which address is used to calculate tax.'=>'To ustawienie definiuje który adres będzie używany do obliczenia podatku.','This option is important as it will affect how you input prices. Changing it will not update existing products.'=>'To ustawienie jest ważne ze względu na wpływ na ceny. Zmiana tego ustawienia nie zaktualizuje już istniejących produktów.','This option lets you limit which countries you are willing to sell to.'=>'Ta opcja pozwala na ograniczenie sprzedaży do wybranych państw.','This option will delete ALL of your tax rates, use with caution. This action cannot be reversed.'=>'To usunie WSZYSTKIE stawki podatkowe, proszę używaj ostrożnie. Tej akcji nie można cofnąć.','This order belongs to a different customer.'=>'To zamówienie należy do innego klienta.','This order cannot be paid for.'=>'Nie można opłacić tego zamówienia.','This order cannot be paid for. Please contact us if you need assistance.'=>'Nie możesz zapłacić za to zamówienie. Proszę skontaktuj się z nami jeżeli potrzebujesz pomocy.','This order is already linked to a user account.'=>'To zamówienie jest już powiązane z kontem użytkownika.','This order is no longer editable.'=>'Tego zamówienia nie można już edytować.','This order&rsquo;s status is &ldquo;%s&rdquo;&mdash;it cannot be paid for. Please contact us if you need assistance.'=>'Status tego zamówienia to &bdquo;%s&rdquo;&mdash;nie może być opłacone. Skontaktuj się z nami, jeśli potrzebujesz pomocy.','This page\'s content is overridden by custom template content'=>'Treść tej strony jest zastępowana przez własną treść szablonu','This password reset key is for a different user account. Please log out and try again.'=>'Klucz do zresetowania hasła należy do innego użytkownika. Wyloguj się i spróbuj ponownie.','This payment method was successfully set as your default.'=>'Ta metoda płatności została ustawiona jako domyślna.','This plugin can no longer be activated because its functionality is now included in <strong>WooCommerce</strong>. It is recommended to <strong>delete</strong> it.'=>'Ta wtyczka nie może być już aktywowana, ponieważ jej funkcjonalność jest teraz zawarta w <strong>WooCommerce</strong>. Zaleca się jej <strong>usunięcie</strong>.','This plugin cannot be activated because its functionality is now included in WooCommerce core.'=>'Ta wtyczka nie może być aktywowana, ponieważ jej funkcjonalność jest teraz zawarta w rdzeniu WooCommerce.','This product cannot be added to the cart.'=>'Ten produkt nie może być dodawany do koszyka.','This product has been activated.'=>'Ten produkt został włączony.','This product has multiple variants. The options may be chosen on the product page'=>'Ten produkt ma wiele wariantów. Opcje można wybrać na stronie produktu','This product has options, such as size or color. You can manage each variation\'s images, downloads, and other details individually.'=>'Ten produkt ma opcje, takie jak rozmiar lub kolor. Możesz zarządzać obrazkami, plikami do pobrania i innymi szczegółami każdego wariantu indywidualnie.','This product has options, such as size or color. You can now manage each variation\'s inventory and other details individually.'=>'Ten produkt ma opcje, takie jak rozmiar lub kolor. Możesz teraz indywidualnie zarządzać zapasami i innymi szczegółami każdego wariantu.','This product has options, such as size or color. You can now manage each variation\'s shipping settings and other details individually.'=>'Ten produkt ma opcje, takie jak rozmiar lub kolor. Możesz teraz indywidualnie zarządzać ustawieniami wysyłki i innymi szczegółami każdego wariantu.','This product has produced sales and may be linked to existing orders. Are you sure you want to delete it?'=>'Ten produkt został sprzedany i może być powiązany z istniejącymi zamówieniami. Czy na pewno chcesz go usunąć?','This product is already active.'=>'Ten produkt jest już aktywny.','This product is already installed.'=>'Ten produkt jest już zainstalowany.','This product is awesome, I love it!'=>'Ten produkt jest niesamowity, uwielbiam go!','This product is currently out of stock and unavailable.'=>'Tego produktu nie ma na stanie i nie jest dostępny.','This product is not installed.'=>'Ten produkt nie jest zainstalowany.','This product is protected and cannot be purchased.'=>'Ten produkt jest chroniony i nie może być zakupiony.','This product requires shipping or pickup'=>'Ten produkt wymaga wysyłki lub odbioru','This product type isn’t supported by the updated product editing experience yet.'=>'Ten typ produktu nie jest jeszcze obsługiwany przez zaktualizowane środowisko edycji produktu.','This product will not trigger your customer\'s shipping calculator in cart or at checkout. This product also won\'t require your customers to enter their shipping details at checkout. <a href="https://woocommerce.com/document/managing-products/#adding-a-virtual-product" target="_blank" rel="noreferrer">Read more about virtual products</a>.'=>'Ten produkt nie spowoduje uruchomienia kalkulatora wysyłki w koszyku ani na stronie zamówienia. Twoi klienci nie będą również musieli wpisywać szczegółów wysyłki podczas składania zamówienia. <a href="https://woocommerce.com/document/managing-products/#adding-a-virtual-product" target="_blank" rel="noreferrer">Dowiedz się więcej o produktach wirtualnych</a>.','This report link has expired. %1$sClick here to view the filtered report%2$s.'=>'Ten odnośnik do raportu wygasł. %1$sKliknij tutaj, aby wyświetlić przefiltrowany raport%2$s.','This resource cannot be created.'=>'Ten zasób nie może zostać utworzony.','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Ten przykładowy tekst zawiera podstawowe informacje o zbieraniu, przechowywaniu i udostępnianiu danych oraz kto może mieć do nich dostęp. Te informacje mogą się zmienić w zależności od ustawień lub dodatkowych wtyczek. Rekomendujemy zasięgnięcie opinii prawnika w sprawie polityki prywatności.','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'Ta sekcja odpowiada za wyświetlanie polityki prywatności twojej witryny. Komunikaty dotyczące prywatności nie będą wyświetlane dopóki %s nie zostanie utworzona.','This section shows any files that are overriding the default WooCommerce template pages.'=>'Ta sekcja pokazuje wszystkie pliki, które nadpisują domyśle szablony WooCommerce.','This section shows details of Action Scheduler.'=>'Ta sekcja pokazuje szczegóły Harmonogramu akcji.','This section shows details of WC Admin.'=>'Ta sekcja pokazuje szczegóły WC Admin.','This section shows information about this status report.'=>'W tej sekcji przedstawiono informacje dotyczące tego raportu.','This sets how many days log entries will be kept before being auto-deleted.'=>'Ustala po ilu dniach logi zostaną automatycznie usunięte.','This sets the base page of your shop - this is where your product archive will be.'=>'Ustawia bazową stronę sklepu - tutaj będą wyświetlane wszystkie produkty.','This sets the decimal separator of displayed prices.'=>'Ustawia separator dziesiętny w wyświetlanych cenach.','This sets the minimum severity level of logs that will be stored. Lower severity levels will be ignored. "None" means all logs will be stored.'=>'Określa minimalny poziom ważności logów, które będą przechowywane. Niższe poziomy ważności zostaną zignorowanie. "Brak" oznacza, że wszystkie logi będą przechowywane.','This sets the number of decimal points shown in displayed prices.'=>'Ustawia liczbę miejsc dziesiętnych wyświetlanych w cenach.','This sets the thousand separator of displayed prices.'=>'Pozwala ustawić separator tysięcy w cenach.','This setting cannot be changed here because it is being set by a filter on the %s hook.'=>'To ustawienie nie może być tutaj zmienione, ponieważ jest ustawiane przez filtr %s.','This setting cannot be changed here because it is defined in the %1$s constant, probably in your %2$s file.'=>'To ustawienie nie może być tutaj zmienione, ponieważ jest zdefiniowane w stałej %1$s, prawdopodobnie w pliku %2$s.','This setting cannot be changed here because it is defined in the %s constant.'=>'To ustawienie nie może być tutaj zmienione, ponieważ jest zdefiniowane w stałej %s.','This setting determines which shop pages products will be listed on.'=>'To ustawienie określa, na których stronach sklepu będzie wyświetlany produkt.','This setting does not apply to guest purchases.'=>'To ustawienie nie dotyczy pobrań dla gości.','This setting only works when product data is stored in the posts table.'=>'To ustawienie działa tylko wtedy, gdy dane produktu są przechowywane w tabeli wpisów.','This shipping method does not have any settings to configure.'=>'Ta metoda wysyłki nie ma żadnych ustawień do skonfigurowania.','This subscription has expired. Contact the owner to <strong>renew</strong> the subscription to receive updates and support.'=>'Ta subskrypcja wygasła. Aby <strong>odnowić</strong> subskrypcję, skontaktuj się z właścicielem, aby otrzymywać aktualizacje i wsparcie.','This subscription has expired. Please <strong>renew</strong> to receive updates and support.'=>'Ta subskrypcja wygasła. Proszę <strong>odnów ją</strong>, aby nadal otrzymywać aktualizacje i wsparcie.','This subscription is expiring soon. Please <strong>renew</strong> to continue receiving updates and support.'=>'Ta subskrypcja wkrótce wygaśnie. Proszę <strong>odnów ją</strong>, aby nadal otrzymywać aktualizacje i wsparcie.','This subscription is maxed out as it\'s connected to %1$s and %2$s.'=>'Ta subskrypcja jest wyczerpana, ponieważ jest połączona z %1$s i %2$s.','This subscription is maxed out as it\'s connected to %1$s, %2$s, and %3$d other site.'=>'Ta subskrypcja jest wyczerpana, ponieważ jest połączona z %1$s, %2$s i %3$d innymi witrynami.' . "\0" . 'Ta subskrypcja jest wyczerpana, ponieważ jest połączona z %1$s, %2$s i %3$d innymi witrynami.' . "\0" . 'Ta subskrypcja jest wyczerpana, ponieważ jest połączona z %1$s, %2$s i %3$d innymi witrynami.','This subscription was shared by <email>%s</email>. <link>Learn more</link>.'=>'Ta subskrypcja została udostępniona przez <email>%s</email>. <link>Dowiedz się więcej</link>.','This task is required to keep your store running'=>'To zadanie jest wymagane do utrzymania sklepu w ruchu','This task is required to set up your extension'=>'To zadanie jest wymagane do skonfigurowania rozszerzenia','This template has been overridden by your theme and can be found in: %s.'=>'Ten szablon jest nadpisywany przez twój motyw i można go znaleźć tu: %s.','This template is used by multiple emails. Any changes made would affect other emails on the site. Are you sure you want to edit the template?'=>'Ten szablon jest używany przez wiele wiadomości e-mail. Wszelkie wprowadzone zmiany będą miały wpływ na inne wiadomości e-mail w witrynie. Czy na pewno chcesz edytować szablon?','This text will appear in the footer of all of your WooCommerce emails.'=>'Ten tekst pojawi się w stopce wszystkich twoich e-maili WooCommerce.','This text will be shown on the button linking to the external product.'=>'Ten tekst będzie pokazany na przycisku prowadzącym do zewnętrznego produktu.','This tool allows you to generate and download a CSV file containing a list of all products.'=>'To narzędzie umożliwia generowanie i pobieranie pliku CSV zawierającego listę wszystkich produktów.','This tool allows you to generate and download a CSV file containing the selected products.'=>'Narzędzie to umożliwia wygenerowanie i pobranie pliku CSV zawierającego wybrane produkty.','This tool allows you to import (or merge) product data to your store from a CSV or TXT file.'=>'To narzędzie pozwoli ci zaimportować (lub połączyć) dane produktów z pliku CSV lub TXT do twojego sklepu.','This tool populates historical analytics data by processing customers and orders created prior to activating WooCommerce Admin.'=>'To narzędzie wypełnia historyczne dane analityczne, przetwarzając klientów i zamówienia utworzone przed aktywacją WooCommerce Admin.','This tool will abort the regenerate product attributes lookup table regeneration. After this is done the process can be either started over, or resumed to continue where it stopped.'=>'To narzędzie przerwie odnawianie tabeli do wyszukiwania atrybutów produktu. Proces ten będzie można potem zacząć od początku lub wznowić w punkcie, w którym zostanie przerwane.','This tool will clear ALL expired transients from WordPress.'=>'To narzędzie umożliwia usunięcie całej przedawnionej pamięci podręcznej z WordPressa.','This tool will clear the data from legacy order tables in WooCommerce.'=>'To narzędzie wyczyści dane z przestarzałych tabel zamówień WooCommerce.','This tool will clear the product/shop transients cache.'=>'To narzędzie wyczyści pamięć podręczną produktów/sklepu.','This tool will delete all customer session data from the database, including current carts and saved carts in the database.'=>'To narzędzie usunie wszystkie sesje użytkownika z bazy danych, włącznie z aktualnymi koszykami i koszykami zapisanymi w bazie danych.','This tool will delete all variations which have no parent.'=>'To narzędzie usunie wszystkie warianty bez produktów nadrzędnych.','This tool will delete expired download permissions and permissions with 0 remaining downloads.'=>'To narzędzie usunie wygasłe uprawnienia do pobierania oraz uprawnienia z zerową liczbą pozostałych pobrań.','This tool will empty the system status theme info cache.'=>'To narzędzie opróżni pamięć podręczną informacji motywu stanu systemu.','This tool will empty the template cache.'=>'To narzędzie usunie pamięć podręczną szablonów.','This tool will empty the WooCommerce.com data cache, used in WooCommerce Extensions.'=>'To narzędzie wyczyści pamięć podręczną danych WooCommerce.com używaną w rozszerzeniach WooCommerce.','This tool will generate the necessary Cost of Goods Sold (COGS) related columns in the product meta lookup table, and populate them from existing product data.'=>'Narzędzie to wygeneruje niezbędne kolumny związane z kosztem sprzedanych towarów (COGS) w meta tabeli odnośników produktów i wypełni je na podstawie istniejących danych produktu.','This tool will install all the missing WooCommerce pages. Pages already defined and set up will not be replaced.'=>'To narzędzie zainstaluje wszystkie brakujące strony WooCommerce. Strony już stworzone i skonfigurowane nie zostaną nadpisane.','This tool will recount product terms - useful when changing your settings in a way which hides products from the catalog.'=>'To narzędzie przeliczy wartości taksonomii produktów - przydatne podczas zmiany ustawień w sposób, który ukrywa produkty z katalogu.','This tool will recreate the full text search index for order addresses. If the index does not exist, it will try to create it.'=>'To narzędzie odtworzy indeks wyszukiwania pełnotekstowego dla adresów zamówień. Jeśli indeks nie istnieje, spróbuje go utworzyć.','This tool will regenerate product lookup table data. This process may take a while.'=>'To narzędzie wygeneruje dane produktów do tabel do wyszukiwania. Ten proces może chwilę potrwać.','This tool will regenerate the product attributes lookup table data from existing product(s) data. This process may take a while.'=>'To narzędzie wygeneruje dane atrybutów produktu do tabeli do wyszukiwania na podstawie danych istniejących produktów. Ten proces może chwilę potrwać.','This tool will remove the Cost of Goods Sold (COGS) related columns from the product meta lookup table. COGS will continue working (if the feature is enabled) but some functionality will not be available.'=>'To narzędzie usunie kolumny związane z kosztem sprzedanych towarów (COGS) z tabeli wyszukiwania meta produktów. COGS będzie nadal działać (jeśli funkcja jest włączona), ale niektóre funkcje nie będą dostępne.','This tool will repair the coupons lookup table data with missing discount amounts. This process may take a while.'=>'To narzędzie naprawi dane tabeli wyszukiwania kuponów z brakującymi kwotami rabatów. Proces ten może chwilę potrwać.','This tool will reset the admin, customer and shop_manager roles to default. Use this if your users cannot access all of the WooCommerce admin pages.'=>'To narzedzie zresetuje role: admin, customer i shop_manager do ustawień domyślnych. Użyj tego, jeśli użytkownicy nie mają dostępu do stron administracyjnych WooCommerce.','This tool will reset the cached values used in WooCommerce Analytics. If numbers still look off, try %1$sReimporting Historical Data%2$s.'=>'To narzędzie wyczyści pamięć podręczną wartości używanych w statystykach WooCommerce. Jeśli liczby nadal wyglądają na niepoprawne, spróbuj %1$sponownie zaimportować historyczne dane%2$s.','This tool will resume the product attributes lookup table regeneration at the point in which it was aborted (%1$s products were already processed).'=>'To narzędzie wznowi odnawianie tabeli do wyszukiwania atrybutów produktu w punkcie, w którym zostało przerwane (produkty, które zostały już przetworzone: %1$s).','This tool will update your WooCommerce database to the latest version. Please ensure you make sufficient backups before proceeding.'=>'To narzędzie uaktualni bazę danych WooCommerce do najnowszej wersji. Upewnij się, że masz kopię zapasową bazy danych przed kontynuowaniem.','This variation requires shipping or pickup'=>'Ten wariant wymaga wysyłki lub odbioru','This variation will not trigger your customer\'s shipping calculator in cart or at checkout. This product also won\'t require your customers to enter their shipping details at checkout. <a href="https://woocommerce.com/document/managing-products/#adding-a-virtual-product" target="_blank" rel="noreferrer">Read more about virtual products</a>.'=>'Ten wariant nie spowoduje uruchomienia kalkulatora wysyłki w koszyku ani na stronie zamówienia. Twoi klienci nie będą również musieli wpisywać szczegółów wysyłki podczas składania zamówienia. <a href="https://woocommerce.com/document/managing-products/#adding-a-virtual-product" target="_blank" rel="noreferrer">Dowiedz się więcej o produktach wirtualnych</a>.','This version of the Product Search block is outdated. Upgrade to continue using.'=>'Ta wersja bloku wyszukiwania produktów jest nieaktualna. Uaktualnij, aby kontynuować korzystanie.','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Ten samouczek z filmem pomoże ci przejść przez proces dodawania pierwszego produktu w WooCommerce.','This webhook has the ⚠️ symbol in front of its name in the list below. Please either edit the webhook to use a different delivery format, or install and activate <a href="%s" target="_blank">the WooCommerce Legacy REST API extension</a>.'=>'Ten webhook ma symbol ⚠️ przed swoją nazwą na poniższej liście. Należy albo edytować webhooki, aby użyć innego formatu dostarczania, albo zainstalować i aktywować <a href="%s" target="_blank">rozszerzenie WooCommerce Legacy REST API</a>.' . "\0" . 'Te webhooki mają symbol ⚠️ przed ich nazwami na poniższej liście. Należy albo edytować webhooki, aby użyć innego formatu dostarczania, albo zainstalować i aktywować <a href="%s" target="_blank">rozszerzenie WooCommerce Legacy REST API</a>.' . "\0" . 'Ten webhook ma symbol ⚠️ przed swoją nazwą na poniższej liście. Należy albo edytować webhooki, aby użyć innego formatu dostarczania, albo zainstalować i aktywować <a href="%s" target="_blank">rozszerzenie WooCommerce Legacy REST API</a>.','This webhook is configured to be delivered using the Legacy REST API, but the Legacy REST API plugin is not installed on this site.'=>'Ten webhook jest skonfigurowany do dostarczania za pomocą starszego interfejsu API REST, ale wtyczka Legacy REST API nie jest zainstalowana na tej stronie.','This will affect product category pages'=>'Będzie to miało wpływ na strony kategorii produktów','This will be how your name will be displayed in the account section and in reviews'=>'W taki sposób twoja nazwa zostanie wyświetlona w sekcji Moje konto i w twoich opiniach','This will change the stock status of all variations.'=>'Stan magazynowy wszystkich wariantów zostanie zmieniony.','This will convert <code>coupon_data</code> order item meta entries to simplified <code>coupon_info</code> entries. The conversion will happen overtime in the background (via Action Scheduler). There are currently %d entries that can be converted.'=>'To narzędzie przekonwertuje wpisy metadanych <code>coupon_data</code> pozycji zamówień na uproszczone wpisy <code>coupon_info</code>. Konwersja będzie miała miejsce stopniowo w tle (za pomocą zaplanowanych działań). Liczba elementów możliwych do przekierowania: %d.','This will convert <code>coupon_data</code> order item meta entries to simplified <code>coupon_info</code> entries. The conversion will happen overtime in the background (via Action Scheduler). There are currently no entries to convert.'=>'To narzędzie przekonwertuje wpisy metadanych <code>coupon_data</code> pozycji zamówień na uproszczone wpisy <code>coupon_info</code>. Konwersja będzie miała miejsce stopniowo w tle (za pomocą zaplanowanych działań). Obecnie nie ma żadnych wpisów do przekonwertowania.','This will delete an inbox notification by slug'=>'Spowoduje to usunięcie powiadomienia ze skrzynki odbiorczej według uproszczonej nazwy (slug)','This will delete the custom orders tables. The tables can be deleted only if the "High-Performance order storage" is not authoritative and sync is disabled (via Settings > Advanced > Features).'=>'To usunie własne tabele zamówień. Tabele mogą być usunięte tylko jeśli "Wydajne przechowywanie zamówień" oraz synchronizacja są wyłączone (na stronie Ustawienia > Zaawansowane > Funkcje).','This will delete the custom orders tables. To create them again enable the "High-Performance order storage" feature (via Settings > Advanced > Features).'=>'To usunie własne tabele zamówień. Aby utworzyć je ponownie, włącz funkcję "Wydajne przechowywanie zamówień" (na stronie Ustawienia > Zaawansowane > Funkcje).','This will give "%1$s" %2$s access which will allow it to:'=>'To umożliwi "%1$s" dostęp "%2$s" do:','This will refresh the remote inbox notifications'=>'Spowoduje to odświeżenie powiadomień zdalnej skrzynki odbiorczej','This will regenerate all shop thumbnails to match your theme and/or image settings.'=>'To spowoduje odnowienie wszystkich miniaturek, aby pasowały do motywu i/lub ustawień obrazków.','This will stop the background process that converts <code>coupon_data</code> order item meta entries to simplified <code>coupon_info</code> entries. There are currently %d entries that can be converted.'=>'To narzędzie zatrzyma proces konwersji wpisów metadanych <code>coupon_data</code> pozycji zamówień w tle na uproszczone wpisy <code>coupon_info</code>. Liczba elementów możliwych do przekierowania: %d.','This will take place in a secure environment through our partner. Once your business details are verified, you’ll be redirected back to your store dashboard.'=>'Odbędzie się to w bezpiecznym środowisku za pośrednictwem naszego partnera. Po zweryfikowaniu danych Twojej firmy zostaniesz przekierowany z powrotem do panelu sklepu.','Thiès'=>'Thiès','Thousand separator'=>'Separator tysięczny','Thousand separator for the currency which can be used to format returned prices.'=>'Separator tysięczny dla waluty, który może być używany do formatowania zwracanych cen.','Thousand separator.'=>'Separator tysięcy.','Thousands separator for displayed prices in this country.'=>'Separator tysięcy dla wyświetlanych cen w tym kraju.','Three stars and up'=>'Od trzech gwiazdek wzwyż','Thumbnail'=>'Miniatura','Thumbnail cropping'=>'Przycinanie miniaturki','Thumbnail image'=>'Miniatura','Thumbnail regeneration has been scheduled to run in the background.'=>'Odnowienie miniatur zostało zaplanowane w tle.','Thumbnail regeneration is running in the background. Depending on the amount of images in your store this may take a while.'=>'Odnawianie miniatur działa w tle. W zależności od liczby zdjęć w sklepie może to chwilę potrwać.','Thumbnail Size'=>'Rozmiar miniatury','Thumbnail sizes for responsive images.'=>'Rozmiary ikon dla responsywnych obrazków.','Thumbnail srcset for responsive images.'=>'Srcset ikony dla responsywnych obrazków.','Thumbnail URL.'=>'Adres URL ikony.','Thumbnail width'=>'Szerokość miniatury','Thurgau'=>'Thurgau','Thuringia'=>'Turyngia','Tianjin / 天津'=>'Tianjin / 天津','Tiaret'=>'Tiaret','Tibet / 西藏'=>'Tibet / 西藏','Ticino'=>'Ticino','Tierra del Fuego'=>'Tierra del Fuego','TikTok'=>'TikTok','TikTok for WooCommerce'=>'TikTok dla WooCommerce','Tilopay'=>'Tilopay','Time interval to use for buckets in the returned data.'=>'Interwały czasowe które zostaną użyte w danych.','Time of payment:'=>'Termin płatności:','Time period to snooze the task.'=>'Okres, na jaki uśpić zadanie.','Timeless elegance'=>'Ponadczasowa elegancja','times'=>'czasy','Timestamp'=>'Znacznik czasu','Timiș'=>'Timiș','Timor-Leste'=>'Timor Wschodni','Tindouf'=>'Tindouf','Tinghir'=>'Tinghir','Tip: By suggesting complementary products in the cart using cross-sells, you can significantly increase the average order value.'=>'Wskazówka: Sugerując w koszyku produkty uzupełniające za pomocą cross-sell, możesz znacząco zwiększyć średnią wartość zamówienia.','Tip: Group together items that have a clear relationship or compliment each other well, e.g., garment bundles, camera kits, or skincare product sets.'=>'Wskazówka: Grupuj przedmioty, które mają wyraźny związek lub dobrze się uzupełniają, np. zestawy odzieży, zestawy aparatów fotograficznych lub zestawy produktów do pielęgnacji skóry.','Tip: Upsells are products that are extra profitable or better quality or more expensive. Experiment with combinations to boost sales.'=>'Wskazówka: Upsells to produkty, które są bardziej opłacalne, lepszej jakości lub droższe. Eksperymentuj z kombinacjami, aby zwiększyć sprzedaż.','Tipasa'=>'Tipasa','Tipperary'=>'Tipperary','Tirana'=>'Tirana','Tissemsilt'=>'Tissemsilt','Title'=>'Tytuł','Title - alphabetical'=>'Tytuł - alfabetycznie','Title of the marketing campaign.'=>'Tytuł kampanii marketingowej.','Title of the note.'=>'Tytuł notatki.','Title:'=>'Nazwa:','Tizi Ouzou'=>'Tizi Ouzou','Tiznit'=>'Tiznit','Tlaxcala'=>'Tlaxcala','Tlemcen'=>'Tlemcen','To'=>'Do','to'=>'do','To allow logging, make %s writable.'=>'Aby zezwolić na rejestrowanie, ustaw %s jako zapisywalne.','To collect email and notify your subscribers, set up MailPoet.'=>'Aby zbierać wiadomości e-mail i powiadamiać subskrybentów, skonfiguruj MailPoet.','To complete the sign-up process, customers must follow a verification link sent to their e-mail after submitting the sign-up form.'=>'Aby zakończyć proces rejestracji, klienci muszą kliknąć link weryfikacyjny wysłany na ich adres e-mail po przesłaniu formularza rejestracyjnego.','To connect to %1$s you need to be logged in. Log in to your store below, or <a href="%2$s">cancel and return to %1$s</a>'=>'Aby połączyć się z %1$s musisz się zalogować. Zaloguj się do swojego sklepu poniżej, lub <a href="%2$s">anuluj i wróć do %1$s</a>','To continue, please update your %s plugin to the latest version. This update includes critical security enhancements and new features.'=>'Aby kontynuować, zaktualizuj wtyczkę %s do najnowszej wersji. Ta aktualizacja zawiera krytyczne ulepszenia bezpieczeństwa i nowe funkcje.','To edit this order change the status back to "Pending payment"'=>'Aby edytować to zamówienie zmień jego status na "Oczekujące na płatność"','To enable this update you need to <strong>activate</strong> this subscription.'=>'Aby zainstalować tę aktualizację, musisz <strong>aktywować</strong> tę subskrypcję.','To enable this update you need to <strong>purchase</strong> a new subscription.'=>'Aby zainstalować tę aktualizację, musisz <strong>kupić</strong> nową subskrypcję.','To ensure your store&rsquo;s notifications arrive in your and your customers&rsquo; inboxes, we recommend connecting your email address to your domain and setting up a dedicated SMTP server. If something doesn&rsquo;t seem to be sending correctly, install the <a href="%1$s">WP Mail Logging Plugin</a> or check the <a href="%2$s">Email FAQ page</a>.'=>'Aby mieć pewność, że powiadomienia ze sklepu dotrą do skrzynek pocztowych klientów, zalecamy połączenie adresu e-mail z domeną i skonfigurowanie dedykowanego serwera SMTP. Jeśli coś wydaje się nie wysyłać poprawnie, zainstaluj <a href="%1$s">wtyczkę WP Mail Logging</a> lub sprawdź <a href="%2$s">stronę E-mail FAQ</a>.','To filter your products by price you first need to assign prices to your products.'=>'Aby filtrować produkty według ceny, należy najpierw przypisać ceny do produktów.','To make sure you never get that sinking "what did I forget" feeling, we\'ve put together the essential pre-launch checklist.'=>'Aby upewnić się, że nigdy niczego nie zapomnisz, przygotowaliśmy listę kontrolną przed startem.','To manage your notifications, %s to log in to your account.'=>'Aby zarządzać powiadomieniami, %s zaloguj się na swoje konto.','To manipulate product variations you should use the /products/&lt;product_id&gt;/variations/&lt;id&gt; endpoint.'=>'Aby zmieniać warianty produktów powinieneś używać punktu końcowego: /products/&lt;product_id&gt;/variations/&lt;id&gt;.','To offer local pickup, configure your pickup locations in the <a href=\'%s\'>local pickup settings</a>.'=>'Aby oferować odbiór lokalny, skonfiguruj lokalizacje odbioru w <a href=\'%s\'>>ustawieniach odbioru lokalnego</a>.','To opt out, leave this box unticked. Your store remains untracked, and no data will be collected. Read about what usage data is tracked at: %s.'=>'Aby zrezygnować, zostaw to pole nie zaznaczone. Twój sklep pozostaje nieśledzony, a żadne dane nie będą zbierane. Przeczytaj o tym, jakie dane użytkowe są śledzone: %s.','To override and edit this email template copy %1$s to your theme folder: %2$s.'=>'Aby nadpisać i edytować szablon skopiuj %1$s do katalogu motywu: %2$s.','To proceed, please consent to the creation of a new account with your e-mail.'=>'Aby kontynuować, wyraź zgodę na utworzenie nowego konta, podając swój adres e-mail.','To receive updates and support for this extension, you need to <strong>purchase</strong> a new subscription or consolidate your extensions to one connected account by <strong><a href="%1$s" title="Sharing Docs">sharing</a> or <a href="%2$s" title="Transferring Docs">transferring</a></strong> this extension to this connected account.'=>'Aby otrzymywać aktualizacje i pomoc techniczną dla tego rozszerzenia, musisz <strong>kupić</strong> nową subskrypcję lub połączyć swoje rozszerzenia w jedno konto poprzez <strong><a href="%1$s" title="Dokumentacja udostępniania">udostępnienie</a> lub <a href="%2$s" title="Dokumentacja przenoszenia">przeniesienie</a></strong> tego rozszerzenia na to konto.','To receive updates and support, please <purchase>purchase</purchase> a subscription or use a subscription from another account by <sharing>sharing</sharing> or <transferring>transferring</transferring>.'=>'Aby otrzymywać aktualizacje i wsparcie, należy <zakupić>zakupić</zakupić> subskrypcję lub użyć subskrypcji z innego konta poprzez <udostępnienie>udostępnienie<udostępnienie> lub <przekazanie>przekazanie</przekazanie>.','To receive updates and support, please <renew>renew</renew> this subscription before it expires or use a subscription from another account by <sharing>sharing</sharing> or <transferring>transferring</transferring>.'=>'Aby otrzymywać aktualizacje i pomoc techniczną, należy <odnowić>odnowić</odnowić> tę subskrypcję przed jej wygaśnięciem lub użyć subskrypcji z innego konta poprzez <udostępnienie>udostępnienie</udostępnienie> lub <przekazanie>przekazanie/przekazanie>.','To receive updates and support, please <renew>renew</renew> this subscription or use a subscription from another account by <sharing>sharing</sharing> or <transferring>transferring</transferring>.'=>'Aby otrzymywać aktualizacje i wsparcie, należy <odnowić>odnowić</odnowić> tę subskrypcję lub użyć subskrypcji z innego konta poprzez <udostępnienie>udostępnienie</udostępnienie> lub <przekazanie>przekazanie</przekazanie>.','To receive updates and support, please connect your subscription to this store.'=>'Aby otrzymywać aktualizacje i wsparcie, należy połączyć subskrypcję z tym sklepem.','To select existing items, type its exact label and separate with commas or the Enter key.'=>'Aby wybrać istniejące elementy, wpisz ich dokładną etykietę i oddziel przecinkami lub klawiszem Enter.','To set your password, visit the following address: '=>'Aby ustawić hasło, przejdź tutaj: ','To start accepting online payments'=>'Aby zacząć akceptować płatności online','To stop receiving these messages, %s to unsubscribe.'=>'Aby przestać otrzymywać te wiadomości, wpisz %s, aby zrezygnować z subskrypcji.','To track your order please enter your Order ID in the box below and press the "Track" button. This was given to you on your receipt and in the confirmation email you should have received.'=>'Aby śledzić swoje zamówienie wpisz jego numer w polu poniżej i naciśnij przycisk "Śledź". Numer zamówienia znajdziesz na paragonie oraz w mailu potwierdzającym zamówienie, który do ciebie wysłaliśmy.','To view this page, you must either %1$slogin%2$s or verify the email address associated with the order.'=>'Aby zobaczyć tę stronę, musisz %1$ssię zalogować%2$s lub zweryfikować adres e-mail powiązany z tym zamówieniem.','To-dos, tips, and insights for your business'=>'Zadania do wykonania, wskazówki i spostrzeżenia dla Twojej firmy','To:'=>'Do:','Tocantins'=>'Tocantins','Tochigi'=>'Tochigi','Today'=>'Dzisiaj','Today at %s'=>'Dzisiaj w %s','Toggle "track quantity"'=>'Przełącz "ilość śledzenia"','Toggle &quot;Downloadable&quot;'=>'Przełącz &quot;Do pobrania&quot;','Toggle &quot;Enabled&quot;'=>'Przełącz &quot;Włączone&quot;','Toggle &quot;Manage stock&quot;'=>'Przełącz &quot;Zarządzaj stanem magazynowym&quot;','Toggle &quot;Virtual&quot;'=>'Przełącz &quot;Wirtualny&quot;','Toggle block inserter'=>'Toggle block inserter','Toggle category dropdown'=>'Przełączanie listy rozwijanej kategorii','Toggle details panel'=>'Przełącz panel szczegółów','Toggle featured'=>'Przełącz wyróżnienie','Toggle fullscreen'=>'Przełącz tryb pełnoekranowy','Toggle navigation'=>'Przełącz nawigację','Toggle