utions.'=>'Odwiedź {{Link}}Rynek WooCommerce{{/Link}}, aby znaleźć więcej rozwiązań w zakresie wysyłki, dostawy i realizacji zamówień.','Visit {{Link}}the WooCommerce Marketplace{{/Link}} to find more tax solutions.'=>'Odwiedź {{Link}}Rynek WooCommerce{{/Link}}, aby znaleźć więcej rozwiązań podatkowych.','Visitors'=>'Odwiedzający','Visually highlight a product category and encourage prompt action.'=>'Wizualnie wyróżnij kategorię produktów i zachęć do szybkiego działania.','Viterbo'=>'Viterbo','Viva.com Smart Checkout'=>'Inteligentna płatność Viva.com','Vlorë'=>'Vlorë','Volta'=>'Volta','Volyn'=>'Obwód wołyński','Vrancea'=>'Vrancea','Vratsa'=>'Wraca','vs.'=>'vs.','Vukovar-Srijem County'=>'Okręg Vukovar-Srijem','Vâlcea'=>'Vâlcea','Waikato'=>'Waikato','Waiting'=>'Oczekuje','Wajir'=>'Wajir','Wakayama'=>'Wakayama','Wake Island'=>'Wyspa Wake','Wakiso'=>'Wakiso','Wallets & Express checkouts'=>'Portfele i kasy ekspresowe','Wallis and Futuna'=>'Wallis i Futuna','Want more font pairings?'=>'Chcesz więcej par czcionek?','Want more patterns?'=>'Chcesz więcej wzorów?','Want to be notified when this product is back in stock?'=>'Chcesz otrzymać powiadomienie, gdy ten produkt będzie ponownie dostępny?','Warm hat for winter'=>'Ciepła czapka na zimę','Warning'=>'Ostrzeżenie','Warning: Sale prices will be removed if they are not lower than regular prices.'=>'Ostrzeżenie: ceny wyprzedażowe zostaną usunięte, jeśli nie są niższe od cen regularnych.','WARNING: The product attributes lookup table regeneration process was aborted.'=>'UWAGA: Proces odnawiania tabeli do wyszukiwania atrybutów produktu został przerwany.','Was onboarding completed or skipped?'=>'Czy proces wdrażania został ukończony czy pominięty?','Washington'=>'Waszyngton','Watch on YouTube'=>'Oglądaj na YouTube','Watch tutorial'=>'Obejrzyj poradnik','Waterford'=>'Waterford','WC database version.'=>'Wersja bazy danych WC.','WC_Session is not available, customer data cannot be saved to session.'=>'Sesja WC_Session nie jest dostępna, dane klienta nie mogą zostać zapisane w sesji.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Akceptujemy płatności przez PayPal. Podczas przetwarzania płatności niektóre z twoich danych zostaną przekazane firmie PayPal, w tym informacje wymagane do przetworzenia lub obsługi płatności, takie jak wartość zamówienia i informacje rozliczeniowe.','We appreciate your feedback!'=>'Doceniamy Twoją opinię!','We are currently working on improving our cart and checkout blocks to provide merchants with the tools and customization options they need.'=>'Obecnie pracujemy nad ulepszeniem naszych bloków koszyka i kasy, aby zapewnić sprzedawcom narzędzia i opcje dostosowywania, których potrzebują.','We are experiencing difficulties with this payment method. Please contact us for assistance.'=>'Mamy trudności z tą metodą płatności. Prosimy o kontakt w celu uzyskania pomocy.','We are loading 9 sample products into your store'=>'Ładujemy 9 przykładowych produktów do sklepu','We are unable to activate the subscription at this time. Please try again later.'=>'W tej chwili nie możemy aktywować subskrypcji. Spróbuj ponownie później.','We are unable to process your PayPal payment at this time. Please try again or use a different payment method.'=>'W tej chwili nie możemy przetworzyć płatności PayPal. Spróbuj ponownie lub użyj innej metody płatności.','We collect information about you during the checkout process on our store.'=>'Zbieramy informacje o tobie podczas składania zamówienia w naszym sklepie.','We couldn\'t find a preview for this product.'=>'Nie mogliśmy znaleźć podglądu tego produktu.','We couldn\'t find a subscription for this product.'=>'Nie mogliśmy znaleźć subskrypcji dla tego produktu.','We couldn’t add this shipping class. Try again in a few seconds.'=>'Nie mogliśmy dodać tej klasy wysyłki. Spróbuj ponownie za kilka sekund.','We couldn’t load the variations'=>'Nie mogliśmy załadować odmian','We couldn’t send the link. Try again in a few seconds.'=>'Nie mogliśmy wysłać linku. Spróbuj ponownie za kilka sekund.','We encountered an SSL error. Please ensure your site supports TLS version 1.2 or above.'=>'Wystąpił błąd SSL. Proszę upewnić się, czy witryna wspiera TLS w wersji 1.2 lub wyższej.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Ogólnie informacje są przechowywane tak długo, jak potrzebujemy informacji dla celów, dla których je gromadzimy i wykorzystujemy, i nie jesteśmy prawnie zobowiązani do dalszego przechowywania. Na przykład przechowujemy informacje o zamówieniach przez XXX lat dla celów podatkowych i księgowych. Obejmuje to imię i nazwisko, adres e-mail oraz adresy.','We have created a sample draft Refund and Returns Policy page for you. Please have a look and update it to fit your store.'=>'Stworzyliśmy dla ciebie szkic przykładowej strony Polityki zwrotów. Dostosuj jej treść tak, aby pasowała do twojego sklepu.','We have finished processing your order.'=>'Zakończyliśmy realizację Twojego zamówienia.','We hope they’ll be back soon! Read more about <a href="https://woocommerce.com/document/managing-orders/">troubleshooting failed payments</a>.'=>'Mamy nadzieję, że wkrótce wrócą! Dowiedz się więcej o <a href="https://woocommerce.com/document/managing-orders/">rozwiązywaniu problemów z nieudanymi płatnościami</a>.','We hope to see you again soon.'=>'Mamy nadzieję, że wkrótce znów się zobaczymy.','We just sent you the magic link. Open it on your mobile device and follow the instructions.'=>'Właśnie wysłaliśmy Ci magiczny link. Otwórz go na swoim urządzeniu mobilnym i postępuj zgodnie z instrukcjami.','We look forward to fulfilling your order soon.'=>'Czekamy z niecierpliwością na realizację zamówienia.','We look forward to seeing you soon.'=>'Do zobaczenia wkrótce.','We need your address to complete installing this product. We will redirect you to WooCommerce.com checkout. Afterwards, you will be able to install the product.'=>'Potrzebujemy Twojego adresu, aby dokończyć instalację tego produktu. Przekierujemy Cię do kasy WooCommerce.com. Następnie będzie można zainstalować produkt.','We noticed that there was a problem during the Jetpack and WooCommerce Shipping & Tax install. Please try again and enjoy all the advantages of having the plugins connected to your store! Sorry for the inconvenience. The "Jetpack" and "WooCommerce Shipping & Tax" plugins will be installed & activated for free.'=>'Wykryliśmy problem podczas instalacji Jetpacka i WooCommerce Shipping & Tax. Proszę spróbować ponownie, aby skorzystać ze wszystkich zalet tych rozwiązań. Wtyczki "Jetpack" i "WooCommerce Shipping & Tax" zostaną zainstalowane i włączone za darmo.','We noticed you started changing store settings, then left. How was it? Your feedback will help create a better experience for thousands of merchants like you.'=>'Zauważyliśmy, że zacząłeś zmieniać ustawienia sklepu, a następnie odszedłeś. Jak to było? Twoja opinia pomoże stworzyć lepsze środowisko dla tysięcy sprzedawców takich jak Ty.','We noticed you started creating a product, then left. How was it? Your feedback will help create a better experience for thousands of merchants like you.'=>'Zauważyliśmy, że zacząłeś tworzyć produkt, a potem odszedłeś. Jak było? Twoja opinia pomoże stworzyć lepsze środowisko dla tysięcy sprzedawców takich jak Ty.','We noticed you started editing a product, then left. How was it? Your feedback will help create a better experience for thousands of merchants like you.'=>'Zauważyliśmy, że zacząłeś edytować produkt, a następnie odszedłeś. Jak było? Twoja opinia pomoże stworzyć lepsze środowisko dla tysięcy sprzedawców takich jak Ty.','We noticed you started editing an order, then left. How was it? Your feedback will help create a better experience for thousands of merchants like you.'=>'Zauważyliśmy, że zacząłeś edytować zamówienie, a następnie wyszedłeś. Jak było? Twoja opinia pomoże stworzyć lepsze środowisko dla tysięcy sprzedawców takich jak Ty.','We noticed you started importing products, then left. How was it? Your feedback will help create a better experience for thousands of merchants like you.'=>'Zauważyliśmy, że zacząłeś importować produkty, a następnie odszedłeś. Jak było? Twoja opinia pomoże stworzyć lepsze środowisko dla tysięcy sprzedawców takich jak Ty.','We now collect orders in this table based on when the payment went through, rather than when they were placed. You can change this in <link>settings</link>.'=>'Teraz gromadzimy zamówienia w tej tabeli w oparciu o datę dokonania płatności, a nie datę ich złożenia. Można to zmienić w <link>ustawienia</link>.','We recently asked you if you wanted more information about WooPayments. Run your business and manage your payments in one place with the solution built and supported by WooCommerce.'=>'Niedawno zapytaliśmy Cię, czy chcesz uzyskać więcej informacji na temat WooPayments. Prowadź swój biznes i zarządzaj płatnościami w jednym miejscu dzięki rozwiązaniu zbudowanemu i wspieranemu przez WooCommerce.','We recommend adding one of the following marketing tools for your store. The extension will be installed and activated for you when you click "Get started".'=>'Zalecamy dodanie jednego z poniższych narzędzi marketingowych dla Twojego sklepu. Rozszerzenie zostanie zainstalowane i aktywowane po kliknięciu przycisku "Rozpocznij".','We recommend adding one of the following shipping extensions to your store. The extension will be installed and activated for you when you click "Get started".'=>'Zalecamy dodanie do sklepu jednego z poniższych rozszerzeń wysyłki. Rozszerzenie zostanie zainstalowane i aktywowane po kliknięciu przycisku "Rozpocznij".','We recommend the following shipping options based on your location. You can manage your shipping options again at any time in WooCommerce Shipping settings.'=>'Zalecamy następujące opcje wysyłki w zależności od lokalizacji. Możesz ponownie zarządzać opcjami wysyłki w dowolnym momencie w ustawieniach wysyłki WooCommerce.','We recommend using ShipStation to save time at the post office by printing your shipping labels at home. Try ShipStation free for 30 days.'=>'Polecamy korzystanie z ShipStation, aby zaoszczędzić czas poprzez drukowanie etykiet wysyłkowych w domu. Wypróbuj ShipStation za darmo przez 30 dni.','We recommend using ShipStation to save time at the post office by printing your shipping labels at home. Try ShipStation free for 30 days. {{link}}Learn more{{/link}}.'=>'Zalecamy korzystanie z ShipStation, aby zaoszczędzić czas na poczcie, drukując etykiety wysyłkowe w domu. Wypróbuj ShipStation za darmo przez 30 dni. {{link}}Dowiedz się więcej{{/link}}.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Dzielimy się informacjami z podmiotami trzecimi, które pomagają nam w realizacji zamówień i świadczeniu usług sklepowych; na przykład --','We show contextual suggestions for official extensions that may be helpful to your store.'=>'Pokazujemy kontekstowe propozycje oficjalnych rozszerzeń, które mogą być pomocne dla twojego sklepu.','We strongly recommend creating a backup of your site before updating.'=>'Zaleca się utworzenie kopii zapasowej witryny przed aktualizacją.','We use only the highest-quality materials in our products, ensuring that they look great and last for years to come.'=>'W naszych produktach stosujemy wyłącznie materiały najwyższej jakości, dzięki czemu wyglądają one świetnie i są trwałe przez wiele lat.','We wanted to let you know that one of the previously fulfilled shipments from your order has been removed from our system. This may have been due to a correction or an update in our fulfillment records. Don’t worry — this won’t affect any items you’ve already received.'=>'Chcieliśmy poinformować cię, że jedna z wcześniej zrealizowanych przesyłek z twojego zamówienia została usunięta z naszego systemu. Mogło to być spowodowane korektą lub aktualizacją naszych rejestrów realizacji. Nie martw się - nie wpłynie to na żadne produkty, które już otrzymałeś.','We were unable to find any results based on your search.'=>'Nie mogliśmy znaleźć żadnych wyników wyszukiwania.','We were unable to process your order, please try again.'=>'Nie mogliśmy przetworzyć twojego zamówienia. Proszę spróbować później.','We were unable to verify the email address you provided. Please try again.'=>'Nie mogliśmy zweryfikować podanego adresu e-mail. Proszę spróbować później.','We will also store comments or reviews, if you choose to leave them.'=>'Będziemy również przechowywać komentarze i opinie, jeśli zdecydujesz się je napisać.','We\'ll use %1$s for product weight and %2$s for product dimensions.'=>'Wykorzystamy %1$s dla wagi produktu i %2$s dla wymiarów produktu.','We\'ll use this email to send you details and updates about your order.'=>'Będziemy używać tego adresu e-mail do wysyłania szczegółowych informacji i aktualizacji dotyczących zamówienia.','We\'re actively working on adding more features to the product form, including the ability to add digital products, variations, and more. Watch this space!'=>'Aktywnie pracujemy nad dodaniem kolejnych funkcji do formularza produktu, w tym możliwości dodawania produktów cyfrowych, odmian i nie tylko. Obserwuj to miejsce!','We\'re here for you — get tips, product updates, and inspiration straight to your mailbox.'=>'Jesteśmy tu dla Ciebie — otrzymuj porady, aktualizacje produktów i inspiracje bezpośrednio do swojej skrzynki pocztowej.','We\'ve created a test account for you so that you can begin testing payments on your store. {{break/}}Not sure what to test? Take a look at {{link}}how to test payments{{/link}}.'=>'Utworzyliśmy dla Ciebie konto testowe, abyś mógł rozpocząć testowanie płatności w swoim sklepie. {{break/}}Nie wiesz, co przetestować? Sprawdź {{link}}jak testować płatności{/link}}.','We\'ve created two Shipping Zones - for %s and for the rest of the world. Below you can set Flat Rate shipping costs for these Zones or offer Free Shipping.'=>'Stworzyliśmy dwie strefy wysyłki - %s i dla reszty świata. Poniżej możesz ustawić płaską stawkę kosztów wysyłki dla tych stref lub zaoferować bezpłatną wysyłkę.','We\'ve made things simpler and easier to manage moving forward. From now on you can manage all your WooCommerce purchases directly from the Extensions menu within the WooCommerce plugin itself. <a href="%s">View and manage</a> your extensions now.'=>'Uprościliśmy zarządzanie. Teraz możesz zarządzać swoimi rozszerzeniami WooCommerce z menu Rozszerzenia. <a href="%s">Zobacz i zarządzaj</a> swoimi rozszerzeniami.','Weak'=>'Słaby','Web admin'=>'Panel administratora','Webhook actions'=>'Akcje webhooka','Webhook created on %s'=>'Webhook utworzony: %s','Webhook created on date parsed by DateTime::formatM d, Y @ h:i A'=>'Y-m-d H:i','Webhook created successfully.'=>'Webhook został utworzony.','Webhook data'=>'Dane webhooka','Webhook delivery URL must be a valid URL starting with http:// or https://.'=>'Adres URL dostarczania webhooków musi być prawidłowym adresem URL zaczynającym się od http:// lub https://.','Webhook delivery URL.'=>'Adres URL dostarczania webhooków.','Webhook event.'=>'Zdarzenie webhook.','Webhook resource.'=>'Zasób webhook.','Webhook status must be valid.'=>'Status webhooka musi być prawidłowy.','Webhook status.'=>'Status webhook.','Webhook topic is required and must be valid.'=>'Wątek webhooka jest wymagany i musi być poprawny.','Webhook topic must be valid.'=>'Wątek webhooka musi być poprawny.','Webhook topic unknown. Please select a valid topic.'=>'Tytuł webhooka nieznany. Proszę wybrać poprawny tytuł.','Webhook topic.'=>'Temat webhook.','Webhook updated successfully.'=>'Webhook został zaktualizowany.','Webhooks'=>'Webhooki','Webhooks are event notifications sent to URLs of your choice. They can be used to integrate with third-party services which support them.'=>'Webhooki to powiadomienia o zdarzeniach wysyłane na wybrane adresy URL. Mogą być wykorzystane do integracji z usługami innych firm, które je wspierają.','Webhooks do not support trashing.'=>'Webhooki nie obsługują kosza.','Week of'=>'Tydzień','Week of %B %-d, %Y'=>'Tydzień %B %-d, %Y','Week to date'=>'Dotychczasowy tydzień','Week(s)'=>'Tydzień/tygodnie','weekly'=>'tygodnik','weeks'=>'tygodnie','Weight'=>'Waga','Weight (%s)'=>'Waga (%s)','Weight in decimal form'=>'Waga w systemie dziesiętnym','Weight must be greater than zero.'=>'Waga musi być większa od zera.','Weight unit'=>'Jednostka wagi','Welcome shoppers to your store with one of our introductory patterns.'=>'Powitaj kupujących w swoim sklepie jednym z naszych wzorów wprowadzających.','Welcome to'=>'Witamy w','Welcome to %s'=>'Witamy w %s','Welcome to the block editor'=>'Witamy w edytorze bloków','Welcome to the new product form!'=>'Witamy w nowym formularzu produktu!','Welcome to the store'=>'Witamy w sklepie','Welcome to the WooCommerce Marketplace'=>'Witamy na WooCommerce Marketplace','Welcome to Woo!'=>'Witamy w Woo!','Welcome to your store'=>'Witamy w sklepie','Welcome to {site_title}'=>'{site_title} - Witamy!','Wellington'=>'Wellington','West African CFA franc'=>'Frank CFA','West Azarbaijan (آذربایجان غربی)'=>'West Azarbaijan (آذربایجان غربی)','West Bengal'=>'West Bengal','West Coast'=>'West Coast','West Greece'=>'Grecja Zachodnia','West Macedonia'=>'Zachodnia Macedonia','West Panamá'=>'West Panamá','West Pokot'=>'West Pokot','West Virginia'=>'Wirginia Zachodnia','Western'=>'Zachodnia','Western Australia'=>'Australia Zachodnia','Western Cape'=>'Western Cape','Western North'=>'Western North','Western Sahara'=>'Sahara Zachodnia','Westmeath'=>'Westmeath','Westmoreland'=>'Westmoreland','Wexford'=>'Wexford','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Będziemy również używać plików cookie do śledzenia zawartości koszyka podczas przeglądania naszej witryny.','We’ll import images from WooCommerce.com to set up your sample products.'=>'Zaimportujemy obrazy z WooCommerce.com, aby skonfigurować przykładowe produkty.','We’ll send a magic link to %s. Open it on your smartphone or tablet to sign into your store instantly.'=>'Wyślemy magiczny link do %s. Otwórz go na smartfonie lub tablecie, aby natychmiast zalogować się do swojego sklepu.','We’ll use these details to enable payments for your store. This information can’t be changed after your account is created.'=>'Użyjemy tych danych, aby umożliwić płatności dla Twojego sklepu. Informacji tych nie można zmienić po utworzeniu konta.','We’ll use this information to help you set up payments, shipping, and taxes, as well as recommending the best theme for your store.'=>'Wykorzystamy te informacje, aby pomóc Ci skonfigurować płatności, wysyłkę i podatki, a także polecić najlepszy szablon dla Twojego sklepu.','We’ll use this information to help you set up payments, shipping, and taxes.'=>'Wykorzystamy te informacje, aby pomóc Ci skonfigurować płatności, wysyłkę i podatki.','We’re getting in touch to let you know that order #%1$s from %2$s has been cancelled.'=>'Kontaktujemy się z Tobą, aby poinformować, że zamówienie #%1$s z %2$s zostało anulowane.','We’re getting in touch to let you know that your order #%1$s has been cancelled.'=>'Kontaktujemy się z Tobą, aby poinformować, że Twoje zamówienie nr %1$s zostało anulowane.','We’re having trouble connecting to WooCommerce.com'=>'Mamy problemy z połączeniem z WooCommerce.com','We’re sorry for the inconvenience. Please try reloading the page, or you can get support from the community forums.'=>'Przepraszamy za niedogodności. Spróbuj ponownie załadować stronę lub uzyskaj wsparcie na forach społeczności.','We’re sorry to let you know that your order #%1$s has been cancelled.'=>'Z przykrością informujemy, że Twoje zamówienie nr %1$s zostało anulowane.','We’ve added some shipping zones to get you started — you can manage them by selecting Edit or Delete.'=>'Na początek dodaliśmy kilka stref wysyłki - możesz nimi zarządzać, wybierając opcję Edytuj lub Usuń.','We’ve made some exciting improvements to our email templates, including modern, shopper-friendly designs and new customization options. And if you’re using a block theme, you can automatically sync your theme styles! Head to your email settings to explore the new features.'=>'Wprowadziliśmy kilka ekscytujących ulepszeń do naszych szablonów wiadomości e-mail, w tym nowoczesne, przyjazne dla kupujących projekty i nowe opcje dostosowywania. A jeśli korzystasz z szablonu blokowego, możesz automatycznie synchronizować style szablonów! Przejdź do ustawień poczty e-mail, aby poznać nowe funkcje.','We’ve made some exciting improvements to our email templates, including modern, shopper-friendly designs and new customization options. Head to your email settings to explore the new features.'=>'Wprowadziliśmy kilka ekscytujących ulepszeń do naszych szablonów wiadomości e-mail, w tym nowoczesne, przyjazne dla kupujących projekty i nowe opcje dostosowywania. Przejdź do ustawień poczty e-mail, aby poznać nowe funkcje.','We’ve made some exciting improvements to your email templates, including modern, shopper-friendly designs and new customization options. And if you’re using a block theme, you can automatically sync your theme styles! Head to your email settings to explore the new changes.'=>'Wprowadziliśmy kilka ekscytujących ulepszeń do szablonów wiadomości e-mail, w tym nowoczesne, przyjazne dla kupujących projekty i nowe opcje dostosowywania. A jeśli korzystasz z szablonu blokowego, możesz automatycznie synchronizować style szablonów! Przejdź do ustawień poczty e-mail, aby zapoznać się z nowymi zmianami.','We’ve made some exciting improvements to your email templates, including modern, shopper-friendly designs and new customization options. Head to your email settings to explore the new changes.'=>'Wprowadziliśmy kilka ekscytujących ulepszeń w szablonach wiadomości e-mail, w tym nowoczesne, przyjazne dla kupujących projekty i nowe opcje dostosowywania. Przejdź do ustawień poczty e-mail, aby zapoznać się z nowymi zmianami.','We’ve received your order and it’s currently on hold until we can confirm your payment has been processed.'=>'Otrzymaliśmy twoje zamówienie i jest ono obecnie wstrzymane do czasu potwierdzenia przetworzenia płatności.','What category of legal entity identify your business?'=>'Jaka kategoria podmiotu prawnego identyfikuje Twoją firmę?','What currency do you accept payments in?'=>'W jakiej walucie przyjmujesz płatności?','What currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'Które waluty są używane w sklepie, i w których walutach są przyjmowane płatności przez bramki płatności.','What did you try to achieve with the customizer? What did and didn\'t work?'=>'Co próbowałeś osiągnąć za pomocą konfiguratora? Co zadziałało, a co nie?','What did you try to build using this block? What did and didn\'t work?'=>'Co próbowałeś zbudować przy użyciu tego bloku? Co zadziałało, a co nie?','What do you think of the new product editor?'=>'Co sądzisz o nowym edytorze produktów?','What do you think of the new product form?'=>'Co sądzisz o nowej formie produktu?','What fee do you want to charge for local delivery, disregarded if you choose free. Leave blank to disable.'=>'Opłata za dostawę, pomijana, jeśli wybierzesz darmową dostawę. Pozostaw puste, aby wyłączyć.','What is PayPal?'=>'Co to jest PayPal?','What made you turn off the new product editor?'=>'Co sprawiło, że wyłączyłeś nowy edytor produktów?','What makes this product unique? What are its most important features? Enrich the product page by adding rich content using blocks.'=>'Co sprawia, że ten produkt jest unikatowy? Jakie są jego najważniejsze funkcje? Wzbogać stronę produktu, dodając treść za pomocą bloków.','What our customers say'=>'Co mówią nasi klienci','What product do you want to add?'=>'Jaki produkt chcesz dodać?','What products do you want to show?'=>'Jakie produkty chcesz pokazać?','What running the tool will do.'=>'Co zrobi uruchomione narzędzie.','What type of goods or services does your business sell? '=>'Jakiego rodzaju towary lub usługi sprzedaje Twoja firma?','What type of legal entity is your business?'=>'Jakiego rodzaju podmiotem prawnym jest Twoja firma?','What type of products do you plan to sell?'=>'Jakie produkty zamierzasz sprzedawać?','What type of products or services do you plan to sell?'=>'Jaki rodzaj produktów lub usług planujesz sprzedawać?','What we collect and store'=>'Jakie informacje zbieramy i przechowujemy','What we share with others'=>'Co dzielimy z innymi','What would you like to charge for flat rate shipping?'=>'Ile chcesz pobierać za stałą opłatę za wysyłkę?','What ZIP/post codes are available for local delivery?'=>'Które kody pocztowe są dostępne dla lokalnej dostawy?','What ZIP/post codes are available for local pickup?'=>'Które kody pocztowe są dostępne dla odbioru osobistego?','What\'s next:'=>'Co dalej:','What\'s next?'=>'Co dalej?','What’s next?'=>'Co dalej?','When applying multiple coupons, apply the first coupon to the full price and the second coupon to the discounted price and so on.'=>'Przy użyciu wielu kuponów, zastosuj pierwszy kupon do wyjściowej ceny a następny kupon do obniżonej ceny i tak dalej.','When checked, customers will be able to purchase only 1 item in a single order. This is particularly useful for items that have limited quantity, like art or handmade goods.'=>'Po zaznaczeniu tej opcji klienci będą mogli kupić tylko 1 przedmiot w jednym zamówieniu. Jest to szczególnie przydatne w przypadku przedmiotów o ograniczonej ilości, takich jak dzieła sztuki lub wyroby ręcznie robione.','When enabled, guests will be redirected to a login page to complete the sign-up process.'=>'Po włączeniu tej opcji goście będą przekierowywani na stronę logowania w celu dokończenia procesu rejestracji.','When enabled, local pickup will appear as an option on the block based checkout.'=>'Po włączeniu tej opcji, lokalny odbiór pojawi się jako opcja w kasie opartej na blokach.','When enabled, PayPal will use the address provided by the checkout form, and prevent the buyer from changing it inside the PayPal payment page. Disable this to let buyers choose a shipping address from their PayPal account. PayPal verifies addresses therefore this setting can cause errors (we recommend keeping it disabled).'=>'Po włączeniu tej opcji PayPal użyje adresu podanego w formularzu płatności i uniemożliwi kupującemu jego zmianę na stronie płatności PayPal. Wyłącz tę opcję, aby umożliwić kupującym wybranie adresu wysyłki ze swojego konta PayPal. PayPal weryfikuje adresy, dlatego to ustawienie może powodować błędy (zalecamy pozostawienie go wyłączonego).','When handling an %s, should access to downloadable files be revoked and download logs cleared?'=>'Czy podczas obsługi %s odebrać dostęp do plików do pobrania i wyczyścić logi pobierania?','When handling an %s, should personal data within orders be retained or removed?'=>'Czy podczas obsługi %s, dane osobowe w zamówieniach powinny być zachowane czy usunięte?','When limiting response using after/before, which date column to compare against.'=>'Podczas ograniczania odpowiedzi użycie "po" i "przed", wskazuje kolumnę z datą do porównania.','When opened, the Mini-Cart drawer gives shoppers quick access to view their selected products and checkout.'=>'Po otwarciu szuflada Mini-Cart daje kupującym szybki dostęp do przeglądania wybranych produktów i realizacji transakcji.','When out of stock'=>'Gdy brak w magazynie','When product stock reaches this amount the stock status will change to "out of stock" and you will be notified via email. This setting does not affect existing "in stock" products.'=>'Gdy stan magazynowy osiągnie tę liczbę status zmieni się na "brak w magazynie" i dostaniesz powiadomienie e-mailem. To ustawienie nie ma wpływu na istniejące "dostępne" produkty.','When product stock reaches this amount you will be notified by email. It is possible to define different values for each variation individually. The shop default value can be set in Settings > Products > Inventory.'=>'Gdy stan magazynowy osiągnie tę liczbę dostaniesz powiadomienie e-mailem. Istnieje możliwość ustawienia różnych wartości dla każdego z wariantów z osobna. Domyślną wartość dla całego sklepu można ustawić w Ustawienia > Produkty > Magazyn.','When product stock reaches this amount you will be notified via email.'=>'Gdy stan magazynowy osiągnie wybraną liczbę, zostanie wysłane powiadomienie e-mail.','When true, email a link to download the export to the requesting user.'=>'Jeśli "true", wyślij mailem link do pobrania eksportu do użytkownika generującego eksport.','When true, refunded items are restocked.'=>'Jeśli "true", stan magazynowy zwróconych pozycji jest przywrócony.','When true, the payment gateway API is used to generate the refund.'=>'Jeśli "true", API bramki płatności jest używane do zwrotów.','When variation stock reaches this amount you will be notified by email. The default value for all variations can be set in the product Inventory tab. The shop default value can be set in Settings > Products > Inventory.'=>'Gdy stan magazynowy wariantu osiągnie tę liczbę dostaniesz powiadomienie e-mailem. Istnieje możliwość ustawienia domyślnej wartości dla wszystkich wariantów w zakładce Magazyn. Domyślną wartość dla całego sklepu można ustawić w Ustawienia > Produkty > Magazyn.','When viewing a brand archive, show the current brands description.'=>'Podczas przeglądania archiwum marek wyświetlaj opis bieżącej marki.','When you add a pickup location, it will appear here.'=>'Po dodaniu lokalizacji odbioru pojawi się ona w tym miejscu.','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Gdy kupujesz w naszym sklepie, poprosimy cię o podanie informacji zawierających imię i nazwisko, adresy płatności i wysyłki, e-mail, telefon, dane płatności lub karty i opcjonalne dane konta: nazwa użytkownika i hasło. Będziemy wykorzystywać te informacje w poniższych celach:','When you receive a new order, it will appear here.'=>'Nowe zamówienia pojawią się w tym miejscu.','When you reset the %s onboarding your progress and the provided data will be lost. This action cannot be undone, but you can restart the onboarding any time.'=>'Po zresetowaniu %s onboarding postępy i dostarczone dane zostaną utracone. Czynności tej nie można cofnąć, ale można ponownie uruchomić onboarding w dowolnym momencie.','When you reset your account, all payment data — including your %s account details, test transactions, and payouts history — will be lost. Your order history will remain. This action cannot be undone, but you can create a new test account at any time.'=>'Po zresetowaniu konta wszystkie dane dotyczące płatności - w tym dane konta %s, transakcje testowe i historia wypłat - zostaną utracone. Historia zamówień pozostanie. Czynności tej nie można cofnąć, ale w dowolnym momencie można utworzyć nowe konto testowe.','When you reset your test account, all payment data — including your %s account details, test transactions, and payouts history — will be lost. Your order history will remain. This action cannot be undone, but you can create a new test account at any time.'=>'Po zresetowaniu konta testowego wszystkie dane dotyczące płatności - w tym dane konta %s, transakcje testowe i historia wypłat - zostaną utracone. Historia zamówień pozostanie. Czynności tej nie można cofnąć, ale w dowolnym momencie można utworzyć nowe konto testowe.','Where from in the onboarding flow this request was triggered.'=>'W którym momencie procesu wdrażania to żądanie zostało wyzwolone.','Where is your business located?'=>'Gdzie znajduje się Twoja firma?','Where is your store based?'=>'W którym kraju jest twój sklep?','Where is your store located?'=>'Gdzie znajduje się Twój sklep?','Where would you like to promote your products?'=>'Gdzie chciałbyś promować swoje produkty?','Whether an order can be edited.'=>'Czy zamówienie może być edytowane.','Whether an order needs payment, based on status and order total.'=>'Czy zamówienie wymaga płatności, na podstawie statusu i sumy zamówienia.','Whether an order needs processing before it can be completed.'=>'Czy zamówienie wymaga przetworzenia przed zrealizowaniem.','Whether blueprint imports are currently allowed'=>'Czy importowanie schematów (blueprint) jest obecnie dozwolone','Whether or not a user can request to be reminded about the note.'=>'Czy użytkownik zażyczył sobie przypomnienia o notatce.','Whether or not plugins step in core profiler was skipped.'=>'Czy krok wtyczek w profilerze rdzenia został pominięty.','Whether or not the marketing channel is set up.'=>'Czy kanał marketingowy jest skonfigurowany.','Whether or not the profile was completed.'=>'Czy profilowanie zostało ukończone.','Whether or not the profile was skipped.'=>'Czy profilowanie zostało pominięte.','Whether or not this is a compound rate.'=>'Czy to jest złożona stawka.','Whether or not this store agreed to receiving marketing contents from WooCommerce.com.'=>'Czy sklep wyraził zgodę na otrzymywanie treści marketingowych od WooCommerce.com.','Whether or not this store country is set via onboarding profiler.'=>'Czy kraj sklepu został ustawiony przez proces instalacji.','Whether or not this tax rate also gets applied to shipping.'=>'Czy stawka jest stosowana do wysyłki.','Whether or not you have WordPress Multisite enabled.'=>'Czy masz włączoną instalację WordPress Multisite.','Whether the coupon grants free shipping or not.'=>'Czy kupon zapewnia darmową wysyłkę.','Whether the fulfillment is fulfilled.'=>'Czy realizacja została zrealizowana.','Whether the onboarding process is completed.'=>'Czy proces wdrażania został zakończony.','Whether the onboarding process is in test mode.'=>'Czy proces wdrażania jest w trybie testowym.','Whether the onboarding process is started.'=>'Czy proces wdrażania został rozpoczęty.','Whether the payment method should be recommended as enabled or not.'=>'Określa, czy metoda płatności powinna być zalecana jako włączona, czy nie.','Whether the payment method should be required (and force-enabled) or not.'=>'Określa, czy metoda płatności powinna być wymagana (i wymuszona), czy nie.','Whether the plugin can only be activated network-wide.'=>'Czy wtyczka może być włączona tylko w sieci.','Whether the product is visible in the catalog'=>'Określa, czy produkt jest widoczny w katalogu','Whether the provider has a payments processing account connected.'=>'Określa, czy dostawca ma podłączone konto przetwarzania płatności.','Whether the provider is enabled for use on checkout.'=>'Określa, czy dostawca jest włączony do użytku przy finalizacji zamówienia (kasie).','Whether the provider is in dev mode. Having this true usually leads to forcing test payments. '=>'Określa, czy dostawca jest w trybie deweloperskim. Posiadanie tej informacji zazwyczaj prowadzi do wymuszenia płatności testowych. ','Whether the provider is in test mode for payments processing.'=>'Określa, czy dostawca jest w trybie testowym przetwarzania płatności.','Whether the provider needs setup.'=>'Określa, czy dostawca wymaga konfiguracji.','Whether the shipping method is enabled.'=>'Czy metoda wysyłki jest włączona.','Whether to bypass trash and force deletion.'=>'Określa, czy pominąć kosz i wymusić usunięcie.','Whether to consider GMT post dates when limiting response by published or modified date.'=>'Czy brać pod uwagę daty GMT publikacji lub modyfikacji podczas ograniczania odpowiedzi.','Whether to create a new user account as part of order processing.'=>'Określa, czy tworzyć nowe konta użytkownikom w procesie przetwarzania zamówienia.','Whether to hide resources not assigned to any products.'=>'Czy ukryć zasoby nieprzypisane do żadnego produktu.','Whether to notify the customer about the fulfillment update.'=>'Czy powiadomić klienta o aktualizacji realizacji.','Whether to update the billing email of the order, even if it already has one.'=>'Czy zaktualizować e-mail rozliczeniowy zamówienia, nawet jeśli już go ma.','Whether WooPayments is in dev mode.'=>'Czy WooPayments jest w trybie deweloperskim.','Which columns should be exported?'=>'Które kolumny powinny zostać wyeksportowane?','Which features are disabled?'=>'Które funkcje są wyłączone?','Which features are enabled?'=>'Które funkcje są włączone?','Which industry is your business in?'=>'W jakiej branży działa Twoja firma?','Which industry is your client’s business in?'=>'W jakiej branży działa Twój klient?','Which one of these best describes you?'=>'Które z nich najlepiej Cię opisuje?','Which Payment Option is Right for Me?'=>'Która opcja płatności jest dla mnie odpowiednia?','Which platform(s) are you currently using?'=>'Z jakich platform obecnie korzystasz?','Which product category should be exported?'=>'Którą kategorię produktów wyeksportować?','Which product types should be exported?'=>'Które typy produktów powinny zostać wyeksportowane?','While hovering the large image will zoom in by 30%.'=>'Po najechaniu kursorem duży obraz zostanie powiększony o 30%.','While you visit our site, we’ll track:'=>'Podczas przeglądania naszej witryny, będziemy zbierać następujące informacje:','Who on our team has access'=>'Kto w naszym zespole ma dostęp','Why do you feel that way? <smallText>(optional)</smallText>'=>'Dlaczego tak się czujesz? <smallText>(opcjonalnie)</smallText>','Why would you like to dismiss the new payments experience?'=>'Dlaczego chciałbyś zrezygnować z nowych płatności?','Wicklow'=>'Wicklow','Wide - 16:9'=>'Szeroki - 16:9','Width'=>'Szerokość','Width (%s)'=>'Szerokość (%s)','Width <Side />'=>'Szerokość <Bok />','Width must be greater than zero.'=>'Szerokość musi być większa od zera.','Width settings'=>'Ustawienia szerokości','Wisconsin'=>'Wisconsin','With a wide range of designer chairs to elevate your living space.'=>'Z szeroką gamą designerskich krzeseł, które podniosą jakość twojej przestrzeni życiowej.','With detailed documentation and a global support team, help is always available if you need it.'=>'Dzięki szczegółowej dokumentacji i globalnemu zespołowi wsparcia, pomoc jest zawsze dostępna w razie potrzeby.','with first and last resultShowing %1$d&ndash;%2$d of %3$d result'=>'Wyświetlanie %1$d&ndash;%2$d z %3$d wyników' . "\0" . 'Wyświetlanie %1$d&ndash;%2$d z %3$d wyników' . "\0" . 'Wyświetlanie %1$d&ndash;%2$d z %3$d wyników','With our blocks, you can select and display products, categories, filters, and more virtually anywhere on your site — no need to use shortcodes or edit lines of code. Learn more about how to use each one of them.'=>'Dzięki naszym blokom można wybierać i wyświetlać produkty, kategorie, filtry i wiele innych praktycznie w każdym miejscu twojej witryny - bez potrzeby używania shortcodów lub edycji kodu. Dowiedz się więcej o tym, jak używać każdego z nich.','With the release of WooCommerce 4.0, these reports are being replaced. There is a new and better Analytics section available for users running WordPress 5.3+. Head on over to the <a href="%1$s">WooCommerce Analytics</a> or learn more about the new experience in the <a href="https://woocommerce.com/document/woocommerce-analytics/" target="_blank">WooCommerce Analytics documentation</a>.'=>'Wraz z wydaniem WooCommerce 4.0 te raporty są zastępowane. Jest już dostępna nowa, ulepszona sekcja statystyk dla użytkowników z uruchomionym WordPressem w wersji od 5.3 wzwyż. Przejdź do <a href="%1$s">Statystyk WooCommerce</a> lub dowiedz się więcej o nowościach w <a href="https://woocommerce.com/document/woocommerce-analytics/" target="_blank">dokumentacji Statystyk WooCommerce Analytics</a>.','With WooCommerce Shipping you can Print shipping labels from your WooCommerce dashboard at the lowest USPS rates.'=>'Dzięki WooCommerce Shipping możesz drukować etykiety wysyłkowe z pulpitu nawigacyjnego WooCommerce po najniższych stawkach USPS.','With WooCommerce Shipping you can save time by printing your USPS and DHL Express shipping labels at home'=>'Dzięki WooCommerce Shipping możesz zaoszczędzić czas, drukując etykiety wysyłkowe USPS i DHL Express w domu','With WooPayments, you can securely accept major cards, Apple Pay, and payments in over 100 currencies – with no setup costs or monthly fees – and you can now accept in-person payments with the Woo mobile app.'=>'Dzięki WooPayments możesz bezpiecznie akceptować główne karty, Apple Pay i płatności w ponad 100 walutach - bez kosztów konfiguracji i opłat miesięcznych - a teraz możesz akceptować płatności osobiste za pomocą aplikacji mobilnej Woo.','With WooPayments, you can securely accept major cards, Apple Pay, and payments in over 100 currencies. Track cash flow and manage recurring revenue directly from your store’s dashboard - with no setup costs or monthly fees.'=>'Dzięki Płatnościom WooCommerce można bezpiecznie akceptować główne karty, Apple Pay i płatności w ponad 100 walutach. Śledź przepływ gotówki i zarządzaj cyklicznymi dochodami bezpośrednio z panelu sterowania swojego sklepu. To wszystko bez kosztów konfiguracji i opłat miesięcznych.','Wix'=>'Wix','Woo Email Content Pattern'=>'Wzorzec treści wiadomości e-mail Woo','Woo Email Template'=>'Szablon wiadomości e-mail Woo','Woo icon'=>'Ikona Woo','Woo! Let’s get your features ready'=>'Woo! Przygotujmy twoje funkcje','Woo! Some items you purchased are being fulfilled. You can use the below information to track your shipment:'=>'Woo! Niektóre z zakupionych przez ciebie produktów są w trakcie realizacji. Możesz użyć poniższych informacji, aby śledzić przesyłkę:','WooCommerce'=>'WooCommerce','woocommerce'=>'woocommerce','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s database?'=>'Tworzenie tabeli WooCommerce %1$s nie powiodło się. Czy użytkownik %2$s ma uprawnienia CREATE w bazie danych %3$s?','WooCommerce &rsaquo; Setup Wizard'=>'Kreator ustawień WooCommerce','WooCommerce action names associated with the webhook.'=>'Nazwy akcji WooCommerce powiązane z webhookiem.','WooCommerce Admin'=>'WooCommerce Admin','WooCommerce Admin has been disabled'=>'WooCommerce Admin został wyłączony','WooCommerce Admin icon'=>'Ikonka WooCommerce Admin','WooCommerce Analytics: %s'=>'WooCommerce Analytics: %s','WooCommerce API. Use a consumer key in the username field and a consumer secret in the password field.'=>'WooCommerce API. Użyj klucza w polu nazwy użytkownika i klucza prywatnego w polu hasła.','WooCommerce Blocks development mode requires files to be built. From the root directory, run %1$s to ensure your node version is aligned, run %2$s to install dependencies, %3$s to build the files or %4$s to build the files and watch for changes.'=>'Tryb deweloperski WooCommerce Blocks wymaga zbudowania plików. Z katalogu głównego uruchom %1$s, aby upewnić się, że wersja węzła jest zgodna, uruchom %2$s, aby zainstalować zależności, %3$s, aby zbudować pliki lub %4$s, aby zbudować pliki i obserwować zmiany.','WooCommerce Brand Description'=>'Opis marki WooCommerce','WooCommerce Brand Layered Nav'=>'Warstwowa nawigacja marki WooCommerce','WooCommerce Brand Thumbnails'=>'Miniaturki marek WooCommerce','WooCommerce can accept both online and offline payments. <a href="%s" target="_blank">Additional payment methods</a> can be installed later.'=>'WooCommerce może przyjmować płatności online i tradycyjne. <a href="%s" target="_blank">Dodatkowe metody płatności</a> mogą być zainstalowane później.','WooCommerce Cart Page'=>'Strona koszyka WooCommerce','WooCommerce Checkout Page'=>'Strona kasy WooCommerce','WooCommerce Classic Template'=>'Klasyczny szablon WooCommerce','WooCommerce Customer Data'=>'Dane klienta WooCommerce','WooCommerce Customer Downloads'=>'Pliki do pobrania klientów WooCommerce','WooCommerce Customer Orders'=>'Zamówienia klientów WooCommerce','WooCommerce Customer Payment Tokens'=>'Tokeny płatności klientów WooCommerce','WooCommerce Customer Stock Notifications'=>'Powiadomienia o stanach magazynowych klientów WooCommerce','WooCommerce database update'=>'Aktualizacja bazy danych WooCommerce','WooCommerce database update complete. Thank you for updating to the latest version!'=>'Aktualizacja danych WooCommerce została zakończona. Dziękujemy za aktualizację do najnowszej wersji!','WooCommerce database update done'=>'Aktualizacja bazy danych WooCommerce wykonana','WooCommerce database update in progress'=>'Aktualizacja bazy danych WooCommerce w toku','WooCommerce database update required'=>'Wymagana aktualizacja bazy danych WooCommerce','WooCommerce database version'=>'Wersja bazy danych WooCommerce','WooCommerce Docs'=>'Dokumenty WooCommerce','WooCommerce Endpoint'=>'Punkt końcowy WooCommerce','WooCommerce Endpoints'=>'Punkty końcowe WooCommerce','WooCommerce endpoints'=>'Punkty końcowe WooCommerce','WooCommerce eWAY Gateway'=>'Bramka płatności WooCommerce eWAY','WooCommerce Extensions'=>'Rozszerzenia WooCommerce','WooCommerce extensions'=>'Rozszerzenia do WooCommerce','WooCommerce has been updated! To keep things running smoothly, we have to update your database to the newest version.'=>'WooCommerce został zaktualizowany! Aby wszystko działało sprawnie, musimy zaktualizować bazę danych do najnowszej wersji.','WooCommerce has detected that some of your active plugins are incompatible with currently enabled WooCommerce features. Please <a>review the details</a>.'=>'WooCommerce wykrył, że kilka 