ments of WooCommerce ProductForm Field: %1$s'=>'Brakuje Ci wymaganych argumentów pola formularza produktu WooCommerce: %1$s','You are missing required arguments of WooCommerce ProductForm Section: %1$s'=>'Brakuje Ci wymaganych argumentów sekcji formularza produktu WooCommerce: %1$s','You are missing required arguments of WooCommerce ProductForm Tab: %1$s'=>'Brakuje Ci wymaganych argumentów karty formularza produktu WooCommerce: : %1$s','You are not allowed to make this request.'=>'Nie możesz złożyć takiego żądania.','You are paying for a guest order. Please continue with payment only if you recognize this order.'=>'Płacisz za zamówienie gościa. Proszę kontynuować płatność tylko wtedy, gdy rozpoznajesz to zamówienie.','You are ready to go!'=>'Jesteś gotowy do pracy!','You are viewing active plugins that are incompatible with currently enabled WooCommerce features.'=>'Wyświetlasz włączone wtyczki, które są niezgodne z obecnie włączonymi funkcjami WooCommerce.','You are viewing the active plugins that are incompatible with the \'%s\' feature.'=>'Wyświetlasz włączone wtyczki, które są niezgodne z funkcją "%s".','You attempted to edit an order that does not exist. Perhaps it was deleted?'=>'Próbujesz edytować zamówienie, które nie istnieje. Być może zostało ono usunięte?','You can access to more details of your order by visiting <a href="%s" target="_blank">My Account > Orders</a> and select the order you wish to see the latest status of the delivery.'=>'Możesz uzyskać dostęp do szczegółowych informacji na temat swojego zamówienia, odwiedzając <a href="%s" target="_blank">Moje konto >Zamówienia</a> i wybierając zamówienie, którego status chcesz sprawdzić.','You can access to more details of your order by visiting My Account > Orders and select the order you wish to see the latest status of the delivery.'=>'Możesz uzyskać dostęp do szczegółowych informacji na temat swojego zamówienia, odwiedzając stronę Moje konto > Zamówienia i wybierając zamówienie, którego status chcesz sprawdzić.','You can access your account area to view orders, change your password, and more via the link below:'=>'Możesz uzyskać dostęp do obszaru konta, aby przeglądać zamówienia, zmienić hasło i nie tylko, korzystając z poniższego odnośnika:','You can add multiple shipping methods within this zone. Only customers within the zone will see them.'=>'Możesz dodać wiele metod wysyłki do tej strefy. Tylko klienci z tej strefy będą je widzieć.','You can also:'=>'Możesz również:','You can change the attribute\'s name in <link>Attributes</link>.'=>'Nazwę atrybutu można zmienić w <link>Atrybuty</link>.','You can edit your content later in the Editor'=>'Zawartość można później edytować w edytorze','You can learn more about the benefits of switching to blocks, compatibility with extensions, and how to switch back to shortcodes <a>in our documentation</a>.'=>'Możesz dowiedzieć się więcej o korzyściach płynących z przejścia na bloki, kompatybilności z rozszerzeniami i sposobie powrotu do skrótów <a>w naszej dokumentacji</a>.','You can manage this payment gateway’s settings by clicking the button below'=>'Możesz zarządzać ustawieniami tej bramki płatności, klikając poniższy przycisk','You can manually run queued updates here.'=>'Tutaj można ręcznie uruchamiać aktualizacje w kolejce.','You can now %1$sview your recent orders%4$s, manage your %2$sshipping and billing addresses%4$s, and edit your %3$spassword and account details%4$s.'=>'Możesz teraz %1$sprzeglądać swoje ostatnie zamówienia%4$s, zarządzać swoimi %2$sadresami wysyłkowymi i rozliczeniowymi%4$s oraz edytować swoje %3$shasło i szczegóły konta%4$s.','You can only have 1 %s in your cart.'=>'Możesz mieć tylko 1 produkt (%s) w koszyku.','You can specify a <a href="#" class="switch-to-general-tab">default value</a> for all variations'=>'Możesz określić <a href="#" class="switch-to-general-tab">wartość domyślną</a> dla wszystkich odmian (wariantów)','You can switch order data storage <strong>only when the posts and orders tables are in sync</strong>. There are currently orders out of sync.'=>'Możesz przełączyć przechowywanie danych zamówień <strong>tylko wtedy, gdy tabele postów i zamówień są zsynchronizowane</strong>. Obecnie zamówienia nie są zsynchronizowane.','You can try'=>'Możesz spróbować','You cannot add &quot;%s&quot; to the cart because the product is out of stock.'=>'Nie możesz dodać &quot;%s&quot; do koszyka, ponieważ produktu nie ma w magazynie.','You cannot add &quot;%s&quot; with a quantity less than or equal to 0 to the cart.'=>'Nie można dodać „%s” do koszyka w ilości mniejszej lub równej 0.','You cannot add a new payment method so soon after the previous one. Please wait for %d second.'=>'Nie można dodać nowej metody płatności tak szybko po poprzedniej. Proszę poczekać %d sekundę.' . "\0" . 'Nie można dodać nowej metody płatności tak szybko po poprzedniej. Proszę poczekać %d sekundy.' . "\0" . 'Nie można dodać nowej metody płatności tak szybko po poprzedniej. Proszę poczekać %d sekund.','You cannot add another "%s" to your cart.'=>'Nie możesz dodać kolejnej sztuki "%s" do koszyka.','You cannot add that amount of &quot;%1$s&quot; to the cart because there is not enough stock (%2$s remaining).'=>'Nie możesz dodać tej ilości &quot;%1$s&quot; do koszyka, ponieważ nie mamy tyle w magazynie (pozostało: %2$s).','You cannot add that amount to the cart &mdash; we have %1$s in stock and you already have %2$s in your cart.'=>'Nie możesz dodać takiej ilości do koszyka &mdash; w magazynie posiadamy %1$s a w koszyku masz już %2$s.','You cannot add the same tax rate twice!'=>'Nie można dodać jednakowej wysokości podatku 2 razy!','You cannot edit the content of this block. However, you can move it and place other blocks around it.'=>'Nie można edytować zawartości tego bloku. Można go jednak przesuwać i umieszczać wokół niego inne bloki.','You cannot edit this item because it is in the Trash. Please restore it and try again.'=>'Nie możesz edytować tego elementu, ponieważ znajduje się on w koszu. Proszę przywrócić go, a następnie spróbować ponownie.','You created %s'=>'Utworzono %s','You currently don’t have any actionable statuses. To display orders here, select orders that require further review in settings.'=>'Obecnie nie masz żadnych statusów wymagających działania. Aby wyświetlić zamówienia w tym miejscu, wybierz zamówienia wymagające dalszej weryfikacji w ustawieniach.','You currently have no express payment integrations active.'=>'Obecnie nie masz aktywnej integracji płatności ekspresowych.','You currently have the following express payment integrations active.'=>'Obecnie aktywne są następujące integracje płatności ekspresowych.','You currently have the following payment integrations active.'=>'Obecnie aktywne są następujące integracje płatności.','You do not have permission to access this page'=>'Nie masz wystarczających uprawnień na dostęp do tej strony','You do not have permission to assign API Keys to the selected user.'=>'Nie masz uprawnień do przypisywania kluczy API do wybranego użytkownika.','You do not have permission to edit API Keys'=>'Nie posiadasz uprawnień do edycji kluczy API','You do not have permission to edit this API Key'=>'Nie masz uprawnień do edytowania tego klucza API','You do not have permission to edit this order.'=>'Nie posiadasz wystarczających uprawnień, by edytować to zamówienie','You do not have permission to edit Webhooks'=>'Nie masz uprawnień do edycji webhooków','You do not have permission to install plugins.'=>'Nie posiadasz uprawnień do instalacji wtyczek.','You do not have permission to manage log entries.'=>'Brak uprawnień do zarządzania wpisami dziennika.','You do not have permission to manage log files.'=>'Brak uprawnień do zarządzania plikami dziennika.','You do not have permission to manage logging settings.'=>'Brak uprawnień do zarządzania ustawieniami logowania.','You do not have permission to modify the list of approved directories for product downloads.'=>'Nie masz uprawnień do modyfikowania listy dozwolonych katalogów pobierania produktów.','You do not have permission to revoke API Keys'=>'Nie masz uprawnień do unieważniania kluczy API','You do not have permission to revoke this API Key'=>'Nie masz uprawnień do unieważnienia tego klucza API','You do not have permission to update Webhooks'=>'Nie masz uprawnień do aktualizowania webhooków','You do not have permissions to install plugins. Please contact your site administrator.'=>'Nie masz uprawnień do instalowania wtyczek. Skontaktuj się z administratorem witryny.','You don&#8217;t have permission to do this.'=>'Nie posiadasz uprawnień do wykonania tej operacji.','You don\'t have a subscription for <strong>%1$s</strong>. Subscribe to receive updates and streamlined support.'=>'Nie masz subskrypcji na <strong>%1$s</strong>. Subskrybuj, aby otrzymywać aktualizacje i usprawnione wsparcie.','You don\'t have permission to create a new order.'=>'Nie posiadasz uprawnień do dodania nowego zamówienia','You don\'t have subscriptions for <strong>%1$s Woo extensions</strong>. Subscribe to receive updates and streamlined support.'=>'Nie masz subskrypcji dla <strong>%1$s Rozszerzenia Woo</strong>. Subskrybuj, aby otrzymywać aktualizacje i usprawnione wsparcie.','You have %d new thing to do'=>'Masz %d nowych rzeczy do zrobienia' . "\0" . 'Masz %d nowych rzeczy do zrobienia' . "\0" . 'Masz %d nowych rzeczy do zrobienia','You have %d order to fulfill'=>'Masz %d zamówień do zrealizowania' . "\0" . 'Masz %d zamówień do zrealizowania' . "\0" . 'Masz %d zamówień do zrealizowania','You have %d review to moderate'=>'Masz %d recenzji do moderowania' . "\0" . 'Masz %d recenzji do moderowania' . "\0" . 'Masz %d recenzji do moderowania','You have <strong>%1$s Woo extension subscriptions</strong> expiring soon. <a href="%2$s">Enable auto-renewal</a> to continue receiving updates and streamlined support.'=>'Twoja <strong>%1$s subskrypcja rozszerzenia Woo</strong> wkrótce wygaśnie. <a href="%2$s">Włącz automatyczne odnawianie</a>, aby nadal otrzymywać aktualizacje i usprawnione wsparcie.','You have <strong>%1$s Woo extension subscriptions</strong> that expired. <a href="%2$s">Renew</a> to continue receiving updates and streamlined support.'=>'Masz <strong>%1$s subskrypcji rozszerzenia Woo</strong>, które wygasły. <a href="%2$s">Odnów</a>, aby nadal otrzymywać aktualizacje i usprawnione wsparcie.','You have already joined the waitlist! Click {manage_account_link} to manage your notifications.'=>'Dołączyłeś już do listy oczekujących! Kliknij {manage_account_link}, aby zarządzać powiadomieniami.','You have already joined this waitlist.'=>'Dołączyłeś już do tej listy oczekujących.','You have already joined this waitlist. Please complete the sign-up process by following the verification link sent to your e-mail.'=>'Dołączyłeś już do tej listy oczekujących. Dokończ proces rejestracji, korzystając z odnośnika weryfikacyjnego wysłanego na twój adres e-mail.','You have already signed up too many times. Please try again later.'=>'Zarejestrowałeś się już zbyt wiele razy. Spróbuj ponownie później.','You have attempted to register a duplicate form %1$s with WooCommerce Form: %2$s'=>'Próbowałeś zarejestrować zduplikowany formularz %1$s z formularza WooCommerce: %2$s','You have exceeded the request limit. Please try again after a few minutes.'=>'Przekroczyłeś limit żądań. Spróbuj ponownie za kilka minut.','You have installed a development version of WooCommerce which requires files to be built and minified. From the plugin directory, run <code>pnpm install</code> and then <code>pnpm --filter=\'@woocommerce/plugin-woocommerce\' build</code> to build and minify assets.'=>'Obecnie zainstalowana jest wersja rozwojowa WooCommerce, która wymaga zbudowania i zminifikowania plików. Aby to zrobić, proszę uruchomić <code>pnpm install</code>, a potem <code>pnpm --filter=\'@woocommerce/plugin-woocommerce\' build</code> z poziomu katalogu wtyczki.','You have inventory to review and update'=>'Masz zapasy do przejrzenia i aktualizacji','You have joined the "{product_name}" waitlist.'=>'Dołączyłeś do listy oczekujących na produkt "{product_name}".','You have not set up any product tags on your store.'=>'W sklepie nie skonfigurowano żadnych tagów produktów.','You have not set up this type of address yet.'=>'Nie ustawiłeś jeszcze tego adresu.','You have received the following WooCommerce log message:'=>'Otrzymałeś następujący komunikat z logów WooCommerce:' . "\0" . 'Otrzymałeś następujący komunikaty z logów WooCommerce:' . "\0" . 'Otrzymałeś następujący komunikaty z logów WooCommerce:','You have received this message because your e-mail address was used to sign up for stock notifications on our store.'=>'Otrzymałeś tę wiadomość, ponieważ twój adres e-mail został użyty do zarejestrowania się w celu otrzymywania powiadomień o stanach magazynowych w naszym sklepie.','You have received this message because your e-mail address was used to sign up for stock notifications on our store. Wasn\'t you? Please get in touch with us if you keep receiving these messages.'=>'Otrzymałeś tę wiadomość, ponieważ twój adres e-mail został użyty do zarejestrowania się w celu otrzymywania powiadomień o zapasach w naszym sklepie. Nie zgadza się? Skontaktuj się z nami, jeśli nadal będziesz otrzymywać takie wiadomości.','You have successfully connected your store to WooCommerce.com'=>'Pomyślnie połączono sklep z WooCommerce.com','You have successfully disconnected your store from WooCommerce.com'=>'Pomyślnie odłączono sklep od WooCommerce.com','You have successfully signed up and will be notified when "%s" is back in stock! Note that a new account has been created for you; please check your e-mail for details.'=>'Pomyślnie się zarejestrowałeś i otrzymasz powiadomienie, gdy "%s" będzie ponownie dostępny w magazynie! Pamiętaj, że utworzono dla ciebie nowe konto; sprawdź swoją skrzynkę e-mail, aby uzyskać szczegółowe informacje.','You have successfully signed up! You will be notified when "%s" is back in stock.'=>'Pomyślnie się zarejestrowałeś! Otrzymasz powiadomienie, gdy produkt "%s" będzie ponownie dostępny w magazynie.','You have unsaved changes. If you proceed, they will be lost.'=>'Zmiany nie zostały zapisane. Jeśli będziesz kontynuować, zostaną one utracone.','You have unsaved changes. Please save the post before previewing.'=>'Zmiany nie zostały zapisane. Zapisz post przed wyświetleniem podglądu.','You have used this coupon %s in another transaction during this checkout, and coupon usage limit is reached. Please remove the coupon and try again.'=>'Podczas składania zamówienia użyto tego kuponu %s w innej transakcji i limit wykorzystania kuponu został już osiągnięty. Usuń kupon i spróbuj ponownie.','You haven\'t published any products to list here yet.'=>'Nie opublikowałeś jeszcze żadnych produktów.','You may also like'=>'Możesz także polubić','You may also like&hellip;'=>'Może spodoba się również&hellip;','You may be interested in&hellip;'=>'Zobacz inne równie interesujące&hellip;','You may be interested in…'=>'Zobacz inne równie interesujące…','You may need to manually restore the item\'s stock.'=>'Może zaistnieć konieczność ręcznego przywrócenia stanu magazynowego.','You may select up to %d items.'=>'Możesz wybrać do %d elementów.','You may want to switch to the database for log storage.'=>'Możesz ustawić bazę danych, jako miejsce przechowywania logów.','You must accept our %1$s and %2$s to continue with your purchase.'=>'Musisz zaakceptować nasze %1$s i %2$s, aby kontynuować zakup.','You must be %1$slogged in%2$s to post a review.'=>'Musisz się %1$szalogować%2$s, aby dodać opinię.','You must be logged in to checkout.'=>'Musisz się zalogować, aby zrealizować zamówienie.','You must be logged in to download files.'=>'Musisz się zalogować, aby pobierać pliki.','You must enter a valid license key on the <a href="%1$s">MaxMind integration settings page</a> in order to use the geolocation service. If you do not need geolocation for shipping or taxes, you should change the default customer location on the <a href="%2$s">general settings page</a>.'=>'Musisz wprowadzić prawidłowy klucz licencyjny na <a href="%1$s">stronie ustawień integracji z MaxMind</a>, aby rozpocząć korzystanie z usługi geolokalizacji. Jeśli nie potrzebujesz geolokalizacji do wysyłki lub obliczania podatków, zmień domyślną lokalizację klienta na <a href="%2$s"> stronie ustawień ogólnych</a>.','You must supply an array of options and values.'=>'Musisz podać tablicę opcji i wartości.','You must supply an array of options.'=>'Musisz podać tablicę opcji.','You need to reset your test account to continue onboarding with %1$s. This will create a new test account and reset any existing %2$s account details and test transactions.'=>'Musisz zresetować swoje konto testowe, aby kontynuować onboarding z %1$s. Spowoduje to utworzenie nowego konta testowego i zresetowanie wszystkich istniejących danych konta %2$s i transakcji testowych.','You need WooCommerce 4.2 or newer to run this tool.'=>'Musisz mieć WooCommerce 4.2 lub nowszy, aby uruchomić to narzędzie.','You want your product catalog and images to look great and align with your brand. This guide will give you all the tips you need to get your products looking great in your store.'=>'Chcesz, aby katalog produktów i zdjęcia wyglądały świetnie i były zgodne z marką. Ten przewodnik dostarczy ci wszystkich wskazówek, których potrzebujesz, aby produkty wyglądały świetnie w sklepie.','You will need to manually issue a refund through your payment gateway after using this.'=>'Musisz ręcznie dokonać zwrotu w systemie płatności po użyciu tej funkcji.','You won’t have access to this functionality until the extensions have been purchased and installed.'=>'Nie będziesz mieć dostępu do tej funkcji, dopóki rozszerzenia nie zostaną zakupione i zainstalowane.','You\'ll lose any changes you\'ve made to your store\'s design and will start the process again.'=>'Utracisz wszelkie zmiany wprowadzone w projekcie sklepu i rozpoczniesz proces od nowa.','You\'re almost there — time to activate payments!'=>'Już prawie - czas aktywować płatności!','You\'re almost there! Once you complete store setup you can start receiving orders.'=>'To już prawie wszystko! Dokończ konfigurację swojego sklepu, aby rozpocząć otrzymywanie zamówień.','You\'re invited to share your experience'=>'Zapraszamy do podzielenia się swoimi wrażeniami','You\'re only one step away from getting paid. Verify your business details to start managing transactions with WooPayments.'=>'Już tylko krok dzieli cię od otrzymywania płatności. Zweryfikuj dane swojej firmy, aby rozpocząć zarządzanie transakcjami za pomocą WooPayments.','You\'re ready to add products to your store.'=>'Teraz możesz dodać produkty do swojego sklepu.','You\'re ready to start selling!'=>'Możesz rozpocząć sprzedaż!','You\'re ready to test payments!'=>'Jesteś gotowy do testowania płatności!','You\'ve hit the 10 orders milestone! Look at you go. Browse some WooCommerce success stories for inspiration.'=>'Osiągnąłeś próg 10 zamówień! Dobrze ci idzie. Przejrzyj historie sukcesu sklepów opartych o WooCommerce, aby zdobyć inspiracje.','You\'ve set background color to an opaque image, the background color cannot be seen.'=>'Po ustawieniu koloru tła na nieprzezroczysty obraz, kolor tła nie będzie widoczny.','Your %1$s order #%2$s has been partially refunded'=>'Twoje zamówienie %1$s nr %2$s zostało częściowo zwrócone','Your %1$s order #%2$s has been refunded'=>'Twoje zamówienie %1$s nr %2$s zostało zwrócone','Your %s Report will be emailed to you.'=>'Raport %s zostanie wysłany pocztą e-mail.','Your account has been successfully created'=>'Twoje konto zostało pomyślnie utworzone','Your account was created successfully and a password has been sent to your email address.'=>'Twoje konto zostało utworzone pomyślnie, a hasło zostało wysłane na podany adres e-mail.','Your account was created successfully. Your login details have been sent to your email address.'=>'Twoje konto zostało utworzone pomyślnie. Twoje dane logowania zostały wysłane na podany adres e-mail.','Your account with %s is using a temporary password. We emailed you a link to change your password.'=>'Twoje konto z %s używa tymczasowego hasła. Wysłaliśmy ci link do zmiany hasła.','Your active theme will be changed and you could lose any changes you’ve made to it.'=>'Aktywny motyw zostanie zmieniony, a wprowadzone w nim zmiany mogą zostać utracone.','Your Blueprint has been imported!'=>'Twój Blueprint został zaimportowany!','Your Blueprint has been imported, but there were some errors. Please check the messages.'=>'Blueprint został zaimportowany, ale wystąpiły błędy. Sprawdź komunikaty.','Your business location does not match your store location. {{link}}Edit store location.{{/link}}'=>'Lokalizacja Twojej firmy nie odpowiada lokalizacji Twojego sklepu. {{link}}Edit store location.{{/link}}','Your cart'=>'Twój koszyk','Your cart is currently empty!'=>'Twój koszyk jest obecnie pusty!','Your cart is currently empty.'=>'Twój koszyk aktualnie jest pusty.','Your changed data will be lost if you leave this page without saving.'=>'Wprowadzone zmiany zostaną utracone, jeśli opuścisz tę stronę bez ich zapisania.','Your changes have been saved.'=>'Twoje zmiany zostały zapisane.','Your changes were not saved. Please retry.'=>'Zmiany nie zostały zapisane. Spróbuj ponownie.','Your configuration will be overridden'=>'Twoja konfiguracja zostanie zastąpiona','Your CSV needs to include columns in a specific order. %1$sClick here to download a sample%2$s.'=>'Twój plik CSV musi zawierać kolumny w odpowiedniej kolejności. %1$sKliknij tutaj, aby pobrać przykład%2$s.','Your current password is incorrect.'=>'Aktualne hasło jest nieprawidłowe.','Your customers will see the name of this shipping method during checkout.'=>'Twoi klienci zobaczą nazwę tej metody wysyłki podczas składania zamówienia.','Your customers will see this on the product page'=>'Klienci zobaczą to na stronie produktu','Your customers will see this on the thank-you page and in their order confirmation email.'=>'Twoi klienci zobaczą to na stronie z podziękowaniem i w wiadomości e-mail z potwierdzeniem zamówienia.','Your email address'=>'Twój adres e-mail','YOUR EMAIL ADDRESS <optional />'=>'TWÓJ ADRES E-MAIL <opcjonalnie />','Your email address <optional/>'=>'Twój adres e-mail <opcjonalny/>','Your entire site is visible to everyone.'=>'Cała witryna jest widoczna dla wszystkich.','Your feedback will be only be shared with WooCommerce and treated in accordance with our <privacyLink>privacy policy</privacyLink>.'=>'Twoja opinia zostanie udostępniona wyłącznie WooCommerce i będzie traktowana zgodnie z naszą <privacyLink>polityką prywatności</privacyLink>.','Your feedback will go to the WooCommerce development team'=>'Twoja opinia trafi do zespołu programistów WooCommerce','Your feedback will help create a better experience for thousands of merchants like you. Please tell us to what extent you agree or disagree with the statements below.'=>'Twoja opinia pomoże stworzyć lepsze doświadczenia dla tysięcy sprzedawców takich jak Ty. Powiedz nam, w jakim stopniu zgadzasz się lub nie zgadzasz z poniższymi stwierdzeniami.','Your in-store purchase #%1$s at %2$s'=>'Twój zakup w sklepie nr %1$s w %2$s','Your inbox is empty'=>'Twoja skrzynka odbiorcza jest pusta','Your installation of WooCommerce is incomplete. If you installed WooCommerce from GitHub, %1$splease refer to this document%2$s to set up your development environment.'=>'Instalacja WooCommerce nie jest kompletna. Jeśli instalowałeś WooCommerce z GitHub, %1$ssprawdź ten artykuł%2$s aby skonfigurować środowisko deweloperskie.','Your installation of WooCommerce is incomplete. If you installed WooCommerce from GitHub, please refer to this document to set up your development environment: https://github.com/woocommerce/woocommerce/wiki/How-to-set-up-WooCommerce-development-environment'=>'Instalacja WooCommerce nie jest kompletna. Jeśli instalowałeś WooCommerce z GitHub, sprawdź ten artykuł aby skonfigurować środowisko deweloperskie: https://github.com/woocommerce/woocommerce/wiki/How-to-set-up-WooCommerce-development-environment','Your item is on the way!'=>'Twoja przesyłka jest już w drodze!','Your order'=>'Twoje zamówienie','Your order #%s has been cancelled.'=>'Twoje zamówienie nr %s zostało anulowane.','Your order at {site_title} was unsuccessful'=>'Twoje zamówienie w {site_title} nie powiodło się','Your order can no longer be cancelled. Please contact us if you need assistance.'=>'Twoje zamówienie zostało już przetworzone i nie może zostać anulowane. Proszę skontaktuj się z nami jeśli potrzebujesz pomocy.','Your order cannot be processed as the originating bank/merchant has declined your transaction. Please attempt your purchase again.'=>'Twoje zamówienie nie może zostać zrealizowane, ponieważ bank/sprzedawca odrzucił twoją transakcję. Spróbuj dokonać zakupu ponownie.','Your order details are as follows:'=>'Szczegóły twojego zamówienia są następujące:','Your order from %s has been partially refunded.'=>'Twoje zamówienie z %s zostało częściowo zwrócone.','Your order from %s has been refunded.'=>'Twoje zamówienie z %s zostało zwrócone.','Your order from {site_title} is on its way!'=>'Zamówienie z {site_title} jest już w drodze!','Your order has been cancelled.'=>'Twoje zamówienie zostało anulowane.','Your order on %s has been partially refunded. There are more details below for your reference:'=>'Twoje zamówienie na %s zostało częściowo zwrócone. Poniżej znajduje się więcej szczegółów:','Your order on %s has been refunded. There are more details below for your reference:'=>'Twoje zamówienie na %s zostało zwrócone. Poniżej znajduje się więcej szczegółów:','Your order was cancelled.'=>'Twoje zamówienie zostało anulowane.','Your order was refunded %s.'=>'Twoje zamówienie zostało zwrócone %s.','Your password has been reset successfully.'=>'Twoje hasło zostało zresetowane pomyślnie.','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Twoje dane osobowe będą użyte do przetworzenia zamówienia, ułatwienia korzystania ze strony internetowej oraz innych celów opisanych w naszej %s.','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Twoje dane osobowe zostaną użyte do obsługi twojej wizyty na naszej stronie, zarządzania dostępem do twojego konta i dla innych celów o których mówi nasza %s.','Your product will be published at the specified date and time.'=>'Twój produkt zostanie opublikowany o określonej dacie i godzinie.','Your products are now being imported...'=>'Twoje produkty są teraz importowane…','Your rating'=>'Twoja ocena','Your rating *'=>'Twoja ocena *','Your recent creations will appear here as soon as you begin.'=>'Twoje ostatnie dzieła pojawią się tutaj, gdy tylko zaczniesz.','Your Report Download'=>'Pobierz raport','Your report file is being generated.'=>'Twój plik raportu jest generowany.','Your requested data is loading'=>'Żądane dane są ładowane','Your review'=>'Twoja opinia','Your review *'=>'Twoja recenzja *','Your review is awaiting approval'=>'Twój komentarz czeka na moderację','Your review is awaiting moderation.'=>'Twoja opinia oczekuje na moderację.','Your review is awaiting moderation. This is a preview; your review will be visible after it has been approved.'=>'Opinia oczekuje na moderację. To jest podgląd; twoja opinia będzie widoczna po jej zatwierdzeniu.','Your selection has been reset. Please select some product options before adding this product to your cart.'=>'Twój wybór został zresetowany. Wybierz niektóre opcje produktu przed dodaniem go do koszyka.','Your server does not have fsockopen or cURL enabled - PayPal IPN and other scripts which communicate with other servers will not work. Contact your hosting provider.'=>'Serwer nie ma włączonego fsockopen ani cURL - PayPal IPN i inne skrypty komunikujące się z zewnętrznymi serwerami nie będą działać. Proszę skontaktować się z hostingodawcą.','Your server does not have the %s class enabled - HTML/Multipart emails, and also some extensions, will not work without DOMDocument.'=>'Twój serwer nie ma włączonej klasy %s - e-maile HTML/Multipart, a także niektóre rozszerzenia nie będą działać bez DOMDocument.','Your server does not have the %s class enabled - some gateway plugins which use SOAP may not work as expected.'=>'Twój serwer nie ma włączonej obsługi %s - niektóre bramki płatności, które używają SOAP mogą nie działać poprawnie.','Your server does not support the %s function - this is required to use the GeoIP database from MaxMind.'=>'Serwer nie obsługuje funkcji %s - jest to wymagane do korzystania z bazy danych GeoIP z MaxMind.','Your server does not support the %s functions - this is required for better character encoding. Some fallbacks will be used instead for it.'=>'Twój serwer nie obsługuje funkcji %s - jest to wymagane dla lepszego kodowanie znaków. Zostaną użyte inne funkcje.','Your settings have been saved.'=>'Twoje ustawienia zostały zapisane.','Your settings have been successfully saved.'=>'Ustawienia zostały pomyślnie zapisane.','Your shipment has been updated'=>'Twoja przesyłka została zaktualizowana','Your shipping rates have been updated'=>'Stawki wysyłki zostały zaktualizowane','Your site is currently connected to WooCommerce.com using <b>%1$s</b>, but your actual site URL is <b>%2$s</b>. To fix this, please reconnect your site to <b>WooCommerce.com</b> to ensure everything works correctly.'=>'Twoja witryna jest obecnie połączona z WooCommerce.com przy użyciu <b>%1$s</b>, ale rzeczywisty adres URL witryny to <b>%2$s</b>. Aby to naprawić, ponownie połącz swoją witrynę z <b>WooCommerce.com</b>, aby upewnić się, że wszystko działa poprawnie.','Your site is hidden from visitors behind a “Coming soon” landing page until it’s ready for viewing.'=>'Twoja witryna jest ukryta przed odwiedzającymi za stroną docelową "Wkrótce", dopóki nie będzie gotowa do wyświetlenia.','Your site is hidden from visitors behind a “Coming soon” landing page until it’s ready for viewing. You can customize your “Coming soon” landing page via the <a>Editor</a>.'=>'Twoja witryna jest ukryta przed odwiedzającymi za stroną docelową "Coming soon", dopóki nie będzie gotowa do oglądania. Stronę docelową "Coming soon" można dostosować za pomocą <a>Edytora</a>.','Your site might be on a private network. Jetpack can only connect to public sites. Please make sure your site is visible over the internet, and then try connecting again 🙏.'=>'Twoja witryna może być w sieci prywatnej. Jetpack może łączyć się tylko z witrynami publicznymi. Upewnij się, że witryna jest dostępna przez Internet, a następnie spróbuj połączyć się ponownie 🙏.','Your store'=>'Twój sklep','Your store address is required to set the origin country for shipping, currencies, and payment options.'=>'Adres twojego sklepu jest wymagany, żeby ustawić kraj wysyłki, waluty i opcje płatności.','Your store contact email.'=>'Adres e-mail kontaktowy Twojego sklepu.','Your store does not appear to be using a secure connection. We highly recommend serving your entire website over an HTTPS connection to help keep customer data secure. <a href="%s">Learn more here.</a>'=>'Wygląda na to, że twój sklep nie korzysta z bezpiecznego połączenia. Rekomendujemy przesyłanie danych witryny za pomocą połączenia HTTPS, aby lepiej chronić dane użytkowników. <a href="%s">Dowiedz się więcej.</a>','Your store does not have any payment methods that support the Checkout block. Once you have configured a compatible payment method it will be displayed here.'=>'Twój sklep nie ma żadnych metod płatności obsługujących blok Checkout. Po skonfigurowaniu kompatybilnej metody płatności zostanie ona wyświetlona tutaj.','Your store does not have any Shipping Options configured. Once you have added your Shipping Options they will appear here.'=>'Twój sklep nie ma skonfigurowanych żadnych opcji wysyłki. Po dodaniu opcji wysyłki pojawią się one tutaj.','Your store doesn\'t have any product attributes.'=>'Twój sklep nie ma żadnych atrybutów produktów.','Your store doesn\'t have any product categories.'=>'Twój sklep nie ma żadnych kategorii produktów.','Your store doesn\'t have any products with ratings yet. This filter option will display when a product receives a review.'=>'Twój sklep nie ma jeszcze żadnych produktów z ocenami. Ta opcja filtra zostanie wyświetlona, gdy produkt otrzyma recenzję.','Your store doesn\'t have any products.'=>'Twój sklep nie ma żadnych produktów.','Your store emails have had an upgrade!'=>'Twoje e-maile w sklepie zostały zaktualizowane!','Your store is almost ready! To activate services like %s, just connect with Jetpack.'=>'Twój sklep jest prawie gotowy! Aby aktywować usługi, takie jak %s, połącz się z Jetpack.','Your store is already connected.'=>'Twój sklep jest już połączony.','Your store is configured to serve digital products using "Redirect only" method. This method is deprecated, <a href="%s">please switch to a different method instead.</a><br><em>If you use a remote server for downloadable files (such as Google Drive, Dropbox, Amazon S3), you may optionally wish to "allow using redirects as a last resort". Enabling that and/or selecting any of the other options will make this notice go away.</em>'=>'Twój sklep jest skonfigurowany do obsługi produktów wirtualnych przy użyciu metody "Tylko przekierowanie". Ta metoda jest przestarzała, <a href="%s">zamiast tego przełącz się na inną.</a><br><em>Jeśli do pobierania plików używasz zdalnego serwera (na przykład Dysk Google, Dropbox, Amazon S3), właściwa metoda zostanie zastosowana automatycznie, więc wybierz dowolną inną opcję, aby pozbyć się tego powiadomienia.</em>','Your store is not connected to WooCommerce.com. Run `wp wc com connect` command.'=>'Twój sklep nie jest połączony z WooCommerce.com. Uruchom polecenie `wp wc com connect`.','Your store is not using HTTPS. <a href="%s" target="_blank">Learn more about HTTPS and SSL Certificates</a>.'=>'Twój sklep nie używa protokołu HTTPS. <a href="%s" target="_blank">Dowiedz się więcej o HTTPS i certyfikatach SSL</a>.','Your store is ready for launch!'=>'Twój sklep jest gotowy do uruchomienia!','Your store is using shortcode checkout. Use the Checkout blocks to activate this option.'=>'Twój sklep korzysta z realizacji zamówienia za pomocą krótkiego kodu. Aby włączyć tę opcję, użyj bloków realizacji zamówienia.','Your store looks great!'=>'Twój sklep wygląda świetnie!','Your store might be at risk as you are running old versions of WooCommerce plugins.'=>'Twój sklep może być zagrożony, ponieważ używasz starych wersji wtyczek WooCommerce.','Your store today'=>'Twój sklep dzisiaj','Your store\'s uploads directory is <a href="%1$s">browsable via the web</a>. We strongly recommend <a href="%2$s">configuring your web server to prevent directory indexing</a>.'=>'Katalog do umieszczania plików sklepu <a href="%1$s">jest publicznie dostępny w sieci</a>. Rekomendujemy <a href="%2$s">konfigurację serwera w celu uniknięcia zindeksowania katalogu</a>.','Your subscription expired on %s. Get a new subscription to continue receiving updates and access to support.'=>'Twoja subskrypcja wygasła %s. Wykup subskrypcję ponownie, aby otrzymywać aktualizacje i mieć dostęp do pomocy technicznej.','Your subscription expires in %d days. Enable autorenew to avoid losing updates and access to support.'=>'Twoja subskrypcja wygaśnie w ciągu %d dni. Włącz automatyczne odnawianie, aby nie stracić dostępu do aktualizacji oraz pomocy technicznej.','Your subscription for <strong>%1$s</strong> expired. <a href="%3$s">%4$s</a> to continue receiving updates and streamlined support.'=>'Twoja subskrypcja <strong>%1$s</strong> wygasła. <a href="%3$s">%4$s</a>, aby nadal otrzymywać aktualizacje i usprawnione wsparcie.','Your subscription for <strong>%1$s</strong> expires on %2$s. <a href="%3$s">Enable auto-renewal</a> to continue receiving updates and streamlined support.'=>'Twoja subskrypcja <strong>%1$s</strong> wygasa w dniu %2$s. <a href="%3$s">Włącz automatyczne odnawianie</a>, aby nadal otrzymywać aktualizacje i usprawnione wsparcie.','Your subscription has been connected.'=>'Twoja subskrypcja została połączona.','Your subscription has been disconnected.'=>'Twoja subskrypcja została odłączona.','Your test account was successfully reset.'=>'Twoje konto testowe zostało pomyślnie zresetowane.','Your theme has a woocommerce.php file, you will not be able to override the woocommerce/archive-product.php custom template since woocommerce.php has priority over archive-product.php. This is intended to prevent display issues.'=>'Twój motyw zawiera plik woocommerce.php, nie możesz zmodyfikować szablonu woocommerce/archive-product.php, ponieważ woocommerce.php ma wyższy priorytet niż archive-product.php. Ma to na celu zapobieganie problemów z wyświetlaniem.','Your trusted payments partner in Asia and around the world.'=>'Twój zaufany partner w zakresie płatności w Azji i na całym świecie.','Your WooCommerce extension subscription is missing a payment method for renewal. <a href="%s">Add a payment method</a> to ensure you continue receiving updates and streamlined support.'=>'W twojej subskrypcji rozszerzenia WooCommerce brakuje metody płatności za odnowienie. <a href="%s">Dodaj metodę płatności</a>, aby nadal otrzymywać aktualizacje i usprawnione wsparcie.' . "\0" . 'W twoich subskrypcjach rozszerzeń WooCommerce brakuje metody płatności za odnowienie. <a href="%s">Dodaj metodę płatności</a>, aby nadal otrzymywać aktualizacje i usprawnione wsparcie.' . "\0" . 'W twojej subskrypcji rozszerzenia WooCommerce brakuje metody płatności za odnowienie. <a href="%s">Dodaj metodę płatności</a>, aby nadal otrzymywać aktualizacje i usprawnione wsparcie.','Your WooCommerce extension subscription is missing a payment method for renewal. Add a payment method to ensure you continue receiving updates and streamlined support.'=>'W twojej subskrypcji rozszerzenia WooCommerce brakuje metody płatności za odnowienie. Dodaj metodę płatności, aby nadal otrzymywać aktualizacje i usprawnione wsparcie.' . "\0" . 'W twoich subskrypcjach rozszerzeń WooCommerce brakuje metody płatności za odnowienie. Dodaj metodę płatności, aby nadal otrzymywać aktualizacje i usprawnione wsparcie.' . "\0" . 'W twojej subskrypcji rozszerzenia WooCommerce brakuje metody płatności za odnowienie. Dodaj metodę płatności, aby nadal otrzymywać aktualizacje i usprawnione wsparcie.','Your WooPayments test account was successfully created.'=>'Konto testowe WooPayments zostało pomyślnie utworzone.','Your {site_title} account has been created!'=>'[{site_title}] Twoje konto zostało utworzone!','Your {site_title} order #{order_number} has been partially refunded'=>'[{site_title}] Twoje zamówienie {order_number} zostało częściowo zwrócone','Your {site_title} order #{order_number} has been refunded'=>'[{site_title}] Twoje zamówienie {order_number} zostało zwrócone','Your {site_title} order has been received!'=>'[{site_title}] Otrzymaliśmy twoje zamówienie!','Your {site_title} order is now complete'=>'[{site_title}] Twoje zamówienie zostało zrealizowane','Youssoufia'=>'Youssoufia','You’ll be briefly redirected to connect your store to your WordPress.com account and unlock the full features and functionality of WooPayments'=>'Nastąpi krótkie przekierowanie w celu połączenia sklepu z kontem WordPress.com i odblokowania wszystkich funkcji WooPayments','You’ll be taken to the classic editing screen that isn’t optimized for commerce but offers advanced functionality and supports all extensions.'=>'Zostaniesz przeniesiony do klasycznego ekranu edycji, który nie jest zoptymalizowany pod kątem handlu, ale oferuje zaawansowane funkcje i obsługuje wszystkie rozszerzenia.','You’re almost there'=>'Już prawie jesteś na miejscu','You’re awesome! One less item on your to-do l