">The Legacy REST API plugin</a> is installed and active on this site.</b> Please be aware that the WooCommerce Legacy REST API is <b>not</b> compatible with HPOS.'=>'⚠ <b><a target="_blank" href="%s">Wtyczka Legacy REST API</a> jest zainstalowana i aktywna na tej stronie.</b> Pamiętaj, że WooCommerce Legacy REST API jest <b>nie</b> kompatybilny z HPOS.','⚠ <b><a target="_blank" href="%s">The Legacy REST API</a> is active on this site.</b> Please be aware that the WooCommerce Legacy REST API is <b>not</b> compatible with HPOS.'=>'⚠ <b><a target="_blank" href="%s">Starszy interfejs API REST</a> jest aktywny na tej stronie.</b> Pamiętaj, że WooCommerce Legacy REST API nie jest <b>kompatybilny</b> z HPOS.','⚠ Incompatible plugins detected (%1$s, %2$s and %3$d other).'=>'⚠ Wykryto niezgodne wtyczki (%1$s, %2$s i %3$d inna).' . "\0" . '⚠ Wykryto niezgodne wtyczki (%1$s, %2$s i %3$d inne).' . "\0" . '⚠ Wykryto niezgodne wtyczki (%1$s, %2$s i %3$d innych).','⚠ This plugin is incompatible with the enabled WooCommerce feature \'%s\', it shouldn\'t be activated.'=>'⚠ Ta wtyczka jest niezgodna z włączoną funkcją WooCommerce "%s", nie powinna być włączona.','⚠ This plugin is incompatible with the enabled WooCommerce features \'%1$s\' and \'%2$s\', it shouldn\'t be activated.'=>'⚠ Ta wtyczka jest niezgodna z włączonymi funkcjami WooCoomerce \'%1$s\' i \'%2$s\', nie powinna być włączona.','⚠ This plugin is incompatible with the enabled WooCommerce features \'%1$s\', \'%2$s\' and %3$d more, it shouldn\'t be activated.'=>'⚠ Ta wtyczka jest niezgodna z włączonymi funkcjami WooCoomerce \'%1$s\', \'%2$s\' oraz %3$d innymi, nie powinna być włączona.','⚠ Usage tracking must be enabled to use remote logging.'=>'⚠ Śledzenie użycia musi być włączone, aby korzystać ze zdalnego rejestrowania.','⚠️ Only %s files can be searched at one time. Try filtering the file list before searching.'=>'⚠️ Liczba plików możliwych do przeszukania na raz: %s. Spróbuj najpierw przefiltrować listę plików przed 